INSERT INTO `review` VALUES (10002,1,'자주 놀러가는 곳! 전반적으로 넓은 편이어서 좋아요. 봄에는 벚꽃도 예쁜 곳이예요','Y'),(10003,1,'그늘이 있어서 쉴수도 있고 대형견 소형견들 분리가 되어 있어 안전합니다\n강아지들이 많아 사회성 키우기에도 좋고 항상 활성화되어 있어 좋습니다','Y'),(10004,1,'크기는 보라매공원 사이즈에 비해 생각보다 아담한 듯. 깨끗하고 좋음.','Y'),(10005,1,'강아지가 근처만 가도 놀이터로 돌진합니다 ㅋㅋㅋㅋㅋ','Y'),(10006,1,'다른 강아지들하고 교류하며 사회성 기르기 좋아요. 여기 들어오는 강아지들은 비교적 다른 강아지들하고 잘 지내는 것 같아요. 소형견/대형견 나눠져 있어 체구에 맞게 어울려 놀 수 있어요.','Y'),(10007,2,'도심속의 넓은 공원으로 개설된지 수십년이 지나 나무들도 크고 동물원, 식물원, 지금도 명칭이 동일한지 모르지만 청룡열차를 비롯한 놀이기구 등이 여전하다. 주변에 사는 사람들에게는 쉽게 접근할 수 있으니 그야말로 소중한 공원이겠다.','N'),(10008,2,'주차는 동물원인지 정문말고 다른데 했다. 가족 단위 방문객이 많아서 유모차 끌고다니기 편하다. 오랜만에 동물 봐서 재밌다. 동물원 설명도 아이들 수준에 맞춰져있어서 좋았다.','N'),(10009,2,'금요일에 갔는데 줄 안서고 이용했어요 직원분들도 다 친절하시고 너무 무섭다 싶은 놀이기구는 없어서 잘 용했습니당 ^^( 회전그네는 생각보다 많이 어지러워요 ) 어릴때 방문했다가 성인되고 방문하니 옛추억도 생각나고 좋았습니당 동물원이랑 식물원은 무료관람 가능해요! 방문일자 (2024년 11월 1일)','Y'),(10010,2,'서울 도심 속에 자리잡은 오랜 역사를 자랑하는 유원지 겸 공원.\n옛 유적지 위에 지어져 공원 한쪽에 유강원이 있다.\n나무들도 울창하고 녹지도 상당하여 돌아다니면 제법 시간이 걸리는데다 동식물원, 음악분수, 놀이동산 등 다양한 즐길 거리가 준비되어 있어 가족이나 연인이 함께 가면 매우 알찬 시간을 보낼 수 있다.\n공원 가운데 팔각당은 전망대 역할을 하며 이 건물 안에도 아이들이 놀 수 있는 놀이방 같은 공간이 있다.\n공원 남쪽에는 야외수영장, 눈썰매장도 ','Y'),(10011,2,'추석연휴에 갔다가 그늘은 넘 시원했는데 찌는듯한 태양에 땀샤워에 더위 먹었던....\n하지만 무료라서 넘 좋아요. 공휴일이라 주차 자리가 없어서 주차하기 힘들었어요.\n웨건 빌릴수 있어서 아기 둘은 덜 힘들었겠지만...\n더운 날씨속에 동물원의 동물들도 많이 안보이고 활동을 안해서 아쉬웠어요.\n그래도 애들이 좋아 하니 담에 또 놀러 갈 것 같아요.','Y'),(10012,3,'서울시 마포구 상암동에 위치한 2002년 한국과 일본 공동개최한 월드컵을 위해 건설한 월드컵경기장에 조성한 공원입니다 지금은 생태공원이 잘조성되어 있고 주변에 하늘공원 농수산물시장과 디지털미디어 시티 마포구청 등 주요 지역이 있는 시민들의 휴식공간입니다\nLocated in Sangam-dong, Mapo-gu, Seoul, this park was created at the World Cup Stadium built for the 2002 World C','Y'),(10013,3,'서울시 마포구 성산동 서울월드컵경기장 맞은편의 평화의 공원. 공원 내 분수도 있고, 호수도 있음. 넓은주차장 덕분에 여름,겨울을 제외하면 많은이들이 찾는 휴식공간.','N'),(10014,3,'블루 마라톤 참석하느라 오랜만에 월드컵 공원에 갔습니다. 언제와도 너무 좋은 공원이에요~','Y'),(10015,3,'가까이 살아서 자주 방문하는데 축복 받았다고 생각이 들지경~^^\n한여름에도 그늘과 테이블이 있어서 걷고 쉬었다 올수 있고\n수고하시는분들 덕에 눈도 행복합니다\n말이 필요 없고 가보셔야되는데...\n곧 4월 중순엔 왕벚꽃 보러 오세요','Y'),(10016,3,'월드컵공원은 서울 마포구 상암동과 성산동 일원에 2002 FIFA 월드컵을 기념하여 조성된 공원입니다.\n올림픽공원(송파구), 서울숲(성동구), 북서울꿈의숲(강북구)과 함께 서울의 대표적인 공원입니다.\n월드컵공원은 대표 공원인 평화의공원을 비롯해 하늘공원, 노을공원, 난지천공원, 난지한강공원의 5개 테마공원으로 조성되었습니다. 현재 4개의 테마공원은 서부공원녹지사업소에서 관리하고 있으며 난지한강공원은 한강사업본부에서 관리하고 있다.','Y'),(10017,5,'시민을 위한 다양한 편의 시설과 , 농구, 배구 , 테니스장이 있어요. 세월의 흐름에 따라 외국의 유명한 공원 느낌도 나요.','Y'),(10018,5,'피자 조각 모양의 공원 이에요. 가벼운 산책을 하기에 괜찮습니다. 공원 중간에, 찻길이 있어서 횡단보도로 건너야 되는데, 기둥에 있는 버튼을 눌러야만, 보행자 파란불이 들어와요 (그것을 몰라서, 한참을 기다렸네요 ㅠㅠ)\n\n공원 중앙에, 윤봉길 의사 기념관이 있고, 남쪽으로는, 대한항공 희생자 위령탑과 삼풍 백화점 참사 위령탑이 있습니다. 삼풍 위령탑 위치가, 연관없는 위치에 있어서, 왠지 씁쓸한 마음이 들더라고요. (그래도, 대한민국 역사상 최악의 참사','N'),(10019,5,'양재천과 경부고속도로가 교차하는 곳에 두개의 숲 공원이 있다. 고속도로의 동편에 있는 매헌시민의숲은 양재시민의숲에서 윤봉길 의사의 호로 근래에 변경하였다. 조성된지 오래되어 나무들이 우거지고 크고 굵다. 윤봉길 의사의 동상과 기념관, 체육시설, 산책로와 화단 등을 잘 조성해 놓아 시민들의 휴식 공간으로 좋다.','Y'),(10020,5,'도심 속 여유를 즐기기 충분한 곳.\n사계절의 변화를 뚜렷하게 감상 할 수 있고 잘 꾸며 놓은 숲과 정원 운동시설 뭐하나 빠짐 없이 휴일의 여유를 만끽할 수 있는 곳','Y'),(10021,5,'윤봉길의사기념관이 생겼네요♡ 이름도 매헌 시민의숲으로 바뀌었어요.\n\n윤봉길의사의 호가 매헌이라, 신분당선 전철역 이름 보면서 매헌시민의숲역이 왠지 낯설지 않다고 생각했더니 역시 윤봉길의사와 연관된 장소네요.\n\n이번에 일본여행 가면서 오사카성 제4사령부 형무소 터에도 다녀오고, 가나자와 윤봉길의사 암장지와기념탑에도 다녀왔습니다.\n\n오사카와 가나자와에선 많이 슬펐는데, 그래도 선조들의 희생에 힘입어 지금의 대한민국이 있다는 생각에 힘이 납니다.\n\n문화의 힘','N'),(10022,6,'몇년을 비가오나 눈이오나 매일 산책겸 운동하러가는 멋진 공원입니다.\n편하게 걸어다닐수있고 계절마다 꽃들이 가지가지 피어서 저는 항상 사진에 담는것도 즐겁고 각종 운동기구들도 맘껏 이용할수있어  아주 저에게는 항상 고마운 공원입니다 . 그리고 무엇보다가 구석구석 깨끗하게 유지되는게 기분을 상쾌하게 해줍니다 . \"공원 관리자님들께 감사드립니다 !\"','Y'),(10023,6,'창동 초안산 옛전에는 배밭과 달동네 구옥집들이 있었는데 지금은 잘정리가\n되어서 옛모습은 추억속으로 깨끗이 잘정리 되어있으며 주위에 텃밭도 있으며 초안산 근린공원 으로서 잘갖추어 졌네요\n하늘꽃공원 쪽으로 불암산 나비공원 과같이 까페가 있으면 구민소득도 되며 초안산이 서울시에서 홍보가 될것이라 생각이되네요 ~~~','Y'),(10024,6,'가까운곳에 반려견 놀이터가 있어서 넘조아요 산책로도 넘좋고 자주가야할듯합니다','Y'),(10025,6,'아이들이 놀기에 아주좋습니다.\n근데 화장실은 좋진않습니다.','Y'),(10026,6,'가장 높은곳의 전망대에서 일몰을 감상하기 좋습니다. 남쪽에는 공유 텃밭이 있어 주말에 텃밭을 가꾸는 사람들을 볼 수 있습니다.','Y'),(10027,7,'천연 그대로의 느낌이 아직 남아있는 큰천! 둘레길 잘되어 있어 산책하기 좋아요','Y'),(10028,7,'주변 산책로와 자전거탈수있는길이 상당히 잘 되어있음.','Y'),(10029,7,'탄천유수지내 각종체육시설이 있어서 편리하게 이용할수 있네요','Y'),(10030,7,'음악들으면서 자연과 함께..잠시 힐링하거나 생각정리하기 좋아요','Y'),(10031,7,'송파둘레길 산책하기 좋습니다 자전거, 킥보드 등이 다닐 수 없게 되어 있어서 탈것들 신경쓰지 않아도 돼서 편하구요 좀 좁지만 양쪽으로 걸어서 통행하는 데 무리 없어요\n다만 가끔 어린이용 킥보드 갖고 와서 타게 하는 부모들 있는데 아무리 애들이어도 타면 안 되는 곳인데 규칙은 좀 지키셨으면 좋겠네요','Y'),(10032,10,'이 다리를 이용해서 중랑천 양쪽의 산책로/자전거길 사이를 이동하는 것은 추천하지 않습니다. 중랑천과 다리를 잇는 통로가 다리 한 쪽에만 있지 않고 남쪽과 북쪽으로 나뉘어 있습니다. 그래서 부득이 사가정로를 건너야 하는데 횡단보도가 당연히 다리 위에 없기 때문에 멀리 돌아야 중랑천의 동서간 이동이 가능합니다.\n다리 자체는 참 잘 지어져 있는데 왜 이렇게 설계가 되었는지 아쉽습니다.','N'),(10033,10,'장안교 다리에서 부터 중량교 다리까지를 소개하고 싶다.장안벗꽃길로 불리는 중량천 뚝방길이 왕벗꽃길로 이름을 떨친다. 평소에도  사철 산책로로 각광 받고 있슴.동대문구 사진작가들의 작품사진을 감상  할 수 있는것은  덤.','N'),(10034,10,'벗꽃때문에 사람이 너무 많긴 하지만 그래도 쾌적합니다.\n유리 가림막 덕분에 밖도 잘보여요','Y'),(10035,10,'2만보 걷기할 때 지나 가는 곳 입니다.\n이 쪽 벚꽃길은 사람이 참 많네요\n출근하는 길에 지나가는 길이었는데\n지난 금요일에 그만 두어 이젠 이쪽으로 지나갈 일이 별로 없을듯요.','N'),(10036,10,'동대문구에서 운영하는 도시농업생태체험학습장이 근처에 있어 자주 들릅니다. 중랑천 공원이야 이명박 정부 당시 자전거길 조성 사업으로 쾌적하고 깨끗하고 넓게 공원으로 만들어놨죠. 봄 여름 가을 겨울 온갖 꽃들이 피고 다양한 용도의 인근 주민을 위한 문화체육여가 시설 들이 있어 참 좋습니다.','Y'),(10037,11,'첫 방문이었습니다.드넓은 터에 북서울꿈의숲  12경을 깨끗하고 단정하게 조성해놓았습니다.첫걸음에 다 보지는 못했지만 서울 외곽에 가지 않더라도 그보다 더 넓고 볼 것 많은 곳이 있다는 것이 좋았습니다.\n전망대에 올라 주변 전경을 보며 다음에 저녁때 다시 오겠노라고 다짐하며 돌아왔습니다.드림랜드가 없어져 아쉬운 마음에 한 번도 가볼생각도 안했는데 공원도 괜찮았습니다.','Y'),(10038,11,'서울 강북구 번동에 위치한 대형 공원입니다. 2009년에 개장하였으며, 원래 드림랜드가 있던 장소인데, 시설노후 및 쇠락으로 서울시가 인수하여 운영하고 있습니다. 이곳에는 다양한 산책로는 물론 콘서트홀과 갤러리·다목적홀을 갖춘 꿈의숲 아트센터, 전망대, 숲속문화전시장, 이벤트정원, 거울못 등이 있고 어린이놀이터 및 휴게공간들이 있어 강북지역 주민들에게 생활공원으로서의 역할을 하고 있습니다.\n다만 주차공간이 많이 모자라는 불편함이 늘 있습니다.','Y'),(10039,11,'북서울 꿈의숲은 넓다.\n운동, 산책, 구경할 거리가 많다.\n서울 시민들이 누리는 행복이다.','Y'),(10040,11,'강북 도심에서 오아시스와 같은 역할을 하는 큰 공원입니다. 여유 있게 산책하기 좋습니다.','Y'),(10041,11,'과 비교하자면, 규모는 작고 대중교통 접근성이 떨어지고 주변 상권과 좀 거리가 있는 면이 있지만, 산책로 등 전반적으로 깔끔하게 조성이 잘 되어있고 공원 중간에 매점, 식당 등이 있습니다.\n\n에 비해 좀 더 아늑한 느낌을 주는 공원 이지만, 공원 전체적으로 경사가 있어서 나름 특색으로 볼 수도 있지만, 평지를 걷는 느낌이 아니라서 약간은 아쉽더라고요.\n\n전망대도 있지만, 전망이 그리 예쁘지는 않아서 굳이 안가셔도 될 듯 하고요, 주말 주차는 정말 힘드니','Y'),(10042,16,'토리 미용겸 치료차 들렷읍니다\n친절하시고 24시간  운영하는  병원 입니다','Y'),(10043,16,'야간에도 오픈해서 편리해요 급히 사야할 때 살 수 있어요','Y'),(10044,16,'우리 강아지 애기때부터 꾸준히 다니는곳입니다 친절하고 좋아요','Y'),(10045,16,'나름 조용하고 애들 적응 하기엔 조아요.단지 한가지 청소 하시는분이 너무도 열심히 닦고 계셔서 좀 불편 햇어요.지나간 자리는 바로 닦고 또 닦고 이건 원 돌아 다니기가 왠지 불편 하고 눈치 보여요.','Y'),(10046,16,'친절하고,깨끗하고\n인상 좋으신 원장님의\n수준높은 의술로\n16년5개월 노견인\n우리 애견 앤디 큰 수술 후\n집에서 잘 회복되고\n있음에 감사드립니다.','Y'),(10047,22,'의료진들이 친절하며 전문적입니다. 강아지 치료뿐 아니라 강아지와의 출국 절차를 직접 관계 기관에 전화 상담까지 해가면서 재확인하고 새로 변한 절차에 대해 설명해 주셨습니다. 과잉진료도 없고 병원이 용산인데 타 지역에서 다니던 병원이랑 비용 차이도 없었습니다. 추천합니다.','N'),(10048,22,'강아지 허리 디스크 때문에 내원했는데 서준용 원장님께 치료 너무 잘 받고 다시 건강해졌습니다.\n\n추가 (2024년 11월 4일자): 줄기세포 엑소좀 치료로 수술이나 스테로이드 등 부작용 큰 시술 없이  건강하게 나았습니다. 건강해진 저희 강아지의 모습을 보고 같이 기뻐해주신 서원장님 보고 이 선생님 만난 것이 저와 제 반려견의 큰 행운이라는 생각이 들었습니다.\n\nFor anyone wondering about this place, I can confid','Y'),(10049,22,'우리 반려동물을 위한 훌륭한 클리닉! 높은 기술을 갖춘 고도로 전문적입니다. 나는 항상 우리 강아지의 건강을 위한 최고의 조언을 받아왔습니다. 나는 그것을 완전히 추천합니다. 나는 그들의 작업에 대해 정말 감사드립니다! 매우 감사합니다!','Y'),(10050,22,'이 글을 보시는 모든 분들을 위해:\n나는 이 수의사가 내 개 치료를 인터넷에서 온라인으로 공유하는 데 동의한 적이 없습니다. 애완동물과 애완동물 소유자가 의료 프라이버시에 대해 동일한 권리를 갖고 있는지는 확실하지 않지만 가능하다면 법적 조치를 취하겠습니다.\n\n여기에 애완동물을 데려오지 마세요. 수의사는 엄청나게 무례했습니다. 불필요하고 심지어 잔인한 절차를 여러 번 상향 판매하려고 시도한 다음 적절하지 않거나 저렴하지 않으면 죄책감을 느낄 것입니다… ','N'),(10051,22,'제가 동물병원에 대한 리뷰를 쓰게 될 줄은 몰랐는데 이곳은 최고 수준이었습니다. 영어가 매우 유창하고 수의사가 매우 친절합니다!','Y'),(10052,25,'강아지 미용 잘 했어요! 진료도 친절하게 잘 봐주심!','Y'),(10053,25,'친절하고 진심으로 진료 하네요.','Y'),(10054,27,'간호사 분들 친절해요. 불필요한 검사 강요하지 않아요. 거의 9년 정도 방문한거 같네요. 다행히도 저희 강아지가 크게 아파본적은 없어서 큰 수술이나 다른 치료를 받진 않아서 솔직히 그런 부분은 잘 모르겠어요. 저는 저희 강아지 피부병, 근육통, 멍울 같은 문제로 방문해서 진료 받고, 약 처방 받은적 있는데 그런 부분은 잘 개선되었습니다. 물론 피부병은 재발하는 고질병이라 완치는 안되었지만 집에서도 꾸준히 관리중이고, 가려움증이 심각할땐 병원 처방약으로 ','N'),(10055,27,'**저는 여기서 미용만 했습니다**\n이곳에 전화하시면 아시겠지만 전화하시면 미용과 병원 업무가 나눠져있습니다.\n은 대 만족입니다. 동네에서 강아지키우시는 분들 대부분이 여기서 미용하시고 미용사분이 너무 친절하세요.\n미용 이후에 강아지들 스트레스도 적고 가끔 미용 끝나면 귀여운  넥 악세사리 해주세요.\n- 인기가 많아서 2주나 최소 1주 전에 전화하셔야지 원하시는 날짜에 미용 받으실 수 있어요.','Y'),(10056,27,'절대 안가. 무서워라','N'),(10057,27,'좋아요 모두 친절하세요.','Y'),(10058,27,'바가지 요금','N'),(10059,33,'KTX, 새마을호, 무궁화호 타고 서울역에 내려서 서울지하철 4호선 타고 4정거장 가서 \'동대문역사문화공원역(舊동대문운동장역)\'에 내려서 도보 6~7분이면 호텔에 도착함. 호텔은 오래 되었는데(Since1962, 60년 이상), 최근에 리모델링을 해서 지내기에 문제는 없음. 호텔 근처가 서민동네여서 저렴한 식당들이 많음. 호텔예약 사이트에서 저렴한 가격으로 투숙예약 가능함. 중부시장 방산시장 평화시장 광장시장 및 동대문시장 인근에서 볼일이 있을 경우에 ','Y'),(10060,33,'관광객을 위한 투어리스트 호텔 이었지만..\n룸살롱과 캬바레로 인하여 망한 케이스..\n지금은 캬바레도 없지만, 한번 실망한 관광객은 다시 돌아오지 않기 때문에...\n관광객을 위한 것에는 0점..\n술 좋아하는 사람들 에게는 70점 을 주고 싶은곳.','N'),(10061,33,'사진과 동일한 오래된 객실이었기에 객실은 넓은 편이고 괜찮았습니다 하지만 1층에 카바레가 있고 3층에 룸샬롱이 있어 가족과 함께하기엔 좋지않은 환경이었고 금연방을 요청했지만 없어서인지 담배냄새와 남자 화장품 냄새가 많이 났어요 왠만하면 돈 좀 더주고 좋은데 가길 추천드려요','N'),(10062,33,'가격 저렴하게 시설은 오래됐으나\n가성비 좋음^^','Y'),(10063,33,'어메니티 구림. 욕실구림. 추움. 침대ㆍ수건은 나름 괜춘','N'),(10064,35,'닭뼈 먹어서 엄청 놀랐는데 늦은 시간에도 친절하고 꼼꼼히 봐주셔서 금방 나앗어요🫶🏻','Y'),(10065,37,'양천구 동물병원 중에서 제일 친절함\n24시병원도 3군데 이상 다녀봤고, 목동에 유명하다는 동물병원들 최소 5군데는 갔었는데 다 불친절하고 가격으로 장난질만 쳐서 짜증\n여기는 병원비도 저렴하고 친절해서 앞으로 애들 아프면 꾸준히 다닐 듯','N'),(10066,39,'항상친절하고 저희라떼도행복하게잘있네요~♡','Y'),(10067,39,'울집 대가족 냥이들 1년에 한번씩 방문하는곳입니다.\n매번 발톱정리 이쁘게해주셔 감사합니다.','Y'),(10068,39,'모두들 친절하고 좋으세여','Y'),(10069,39,'의사선생님 너무 친절하시고, 간호사선생님분들도 정말 친절했어요.\n애가 배에 가스가 차서 급하게 병원에 갔는데 설명도 잘해주시고 응급처치도 잘해주셔서 정말 감사했습니다.^-^~','Y'),(10070,39,'선생님들이 친절하고 무엇보다 가격이 투명해서 좋아요','Y'),(10071,42,'강서구에도 큰 동물병원이 생겨서 넘 기쁜 1인\n다른 지역에 큰 병원있는거 항상 부러웠는데 드뎌 우리 댕댕이도 안심하고 갈 수 있는 큰 병원이 있어서 넘 좋음\nCT도 있다는데 그런건 찍는날 없었으면 좋겠....','Y'),(10072,43,'여긴 진짜 낭만닥터 김사부의 돌담병원 동물병원 버전임.\n진짜 다른 동물병원처럼 어떻게든 이것저것 검사돌리고 엑스레이찍으려 하지 않고\n딱 증상에 맞는 치료와 수치 결과의 위중성을 판단해서 환자묘나 사람까지 안심시켜주심.\n그리고 치료받고 집에 오자마자 우리 냥이 믿을 수 없을 정도로 빨리 회복됨 ㅠㅠ\n감사합니다','Y'),(10073,43,'아주 오래된 곳,입니다. 수의사는 경력이 오래된분이 실력도 좋다고 하죠. 강아지 키운지 21년차로써  과잉없이 적정하게 진료보십니다. 단, 24시간 입원이 안되어 큰 수술은 어려워 다른병원으로 연결시켜주셨어요.( 연결시켜준 병원은 별로였습니다만..ㅠ)  우리가 병원가면 동네의원가듯이 주치의개념으로 멍이냥이 관리하며 다니긴 제격인듯합니다.','N'),(10074,43,'귓병이 여름만되면 생겨서 다녀왔어요.단골 병원인데 진료도 꼼꼼히 봐주시고 쌤들이 친절합니다.무엇보다 바가지요금이 없어요~','Y'),(10075,43,'수의사 분들이 너무 잘해주시고 인간적이고 친절하다. 거기다가 실력도 있다 !!! 차타고 30분 가야 하는거리지만.. 시간과 돈이 아깝지 않다.','N'),(10076,43,'의사선생님이 실력이 좋으시고 금액도 양심적으로받으시는분같아요  소개받고갔는데  대기실에서 만난 분들이 몇십년 단골분들이신데 얘기나눠보니 같은 마음이시더라구요','Y'),(10077,44,'예약하고 가면 기다리지않고 충분한 설명해주고 아이에 대해 진심인 병원이고 전문성도 좋아요.\n건강검진과 발치및 치아치료했어요.저렴한곳은 절대 아니니 알고 가시길요.','Y'),(10078,44,'주차 편해요. 치과 내과 각 전문 수의사 선생님이 계셔서 건강검진과 치과치료를 한번에 할 수 있고 고양이 친화 병원입니다.','Y'),(10083,57,'혼자서 깔끔하게 샤브샤브를 즐길 수 있어서 너무 좋았어요. 야채도 신선하고 같이 나온 반찬도 깔끔함. 절임고추 소스가 너무 맛있음. 얼큰하게 먹고자 하면 김치(무료) 요청해서 드세요. 각자 주문해서 본인 취향따라 먹을 수 있어서 너무 좋았어용','Y'),(10084,57,'음식: 고기가 질긴편\n서비스: 젊은 남자 직원 둘다 서비스마인드가 전혀없음. 말투도 불친절하고 껄렁껄렁함.\n자리배치: 2명이 갈경우 거의 바로 옆에 다른 손님이 앉을수 있는 구조임.  두명이 왔는데 4명이 일행처럼 어색하게 식사함\n\n구글리뷰에 왠만하면 나쁜리뷰 안쓰는데 지금까지 방문한 샤브집중 최악임','N'),(10085,64,'원장님이 안과진료를 잘보시고 왠만한 2차병원 이상으로 안과검사기계를 구비하고 있습니다.\n뭔가 수술과 치료에 오타쿠스러운 의욕을 병원에서 느꼈고 눈 질환도 정말 좋아졌습니다.\n다만 원장님이 너무 바쁘신데 아래 직원분들은 일을 잘 안하는 느낌을 받아 아쉬웠어요\n하지만 근골격계 수술, 눈질환은 무조건 찾아갈것 같아요','Y'),(10086,64,'난이도가 있는 간종양 수술이었는데 원장님께서 잘 끝내주셨습니다. 노견이라 고민 많이 했는데 긴 상담시간동안 믿음을 주셔서 결정할 수 있었어요. 남은 항암치료도 아이가 잘 버텨줬으면 좋겠어요.','Y'),(10087,64,'의료진 수준이 높고 정성을 다하려는 모습이 확연합니다. 요로결석 수술로 울아들인 포메 입원 시켰는데 안심하고 맡길 수 있었어요. 안과진료도 전문적으로 하는 것으로 보입니다. 주치의 있는 집 앞 병원에서 십분 드라이브 거리에 있는 이곳으로 옮길 예정입니다','Y'),(10088,64,'저희집 노견이 녹내장 수술한 병원입니다. 확실히 앞을 잘 보는 것 같고 걸을 때도 덜 불편해 보입니다. 안과전문병원이라고 추천 받고 내원했는데 확실히 전문성을 갖춘 병원 같습니다.','Y'),(10089,64,'리뷰 정보\n우리아이가 아파 검색해서 급하게 응급실을 찾아간게 이병원과의 첫 인연이었습니다. 원장님, 정말 진심으로 소중하게 아이들 보살펴주시고요 돈만 밝히던 다른병원들과는 비교가 불과할 정도로 금전적인 부분이 아닌 아이들 회복에만 힘쓰십니다.','N'),(10090,65,'친절한 상담 감사드려요 24시간 동물병원이 집주변에 있어서 마음이 놓이네요','Y'),(10091,65,'과잉 진료와 미흡하고 미숙한 진료. 이곳에서 고양이가 무지개 다리 건넘','N'),(10092,68,'경관이 좋네요','Y'),(10094,69,'집에서 도보 가능한 거리에 좋은 병원이 있어서 다행입니다.','Y'),(10095,69,'최근 갑자기 애가 설사를 하고 밥도 잘 못먹길래 뭐가 문젠가 싶어 찾아갔는데, 어떤어떤게 의심된다고 말해주고, 어떤 검사는 어떤걸 확인하는거다고 자세하게 알려줘서 믿고 맡길수 있었어요','N'),(10096,69,'지역이 충주인데 전화로 무료 상담을 여러번 해주셨어요. 고양이 치과치료와 중성화수술을 진행했는데 가격도 합리적인것 같고(중성화 수술비는 심지어 충주보다 15만원정도 저렴)  치료 중간중간 전화로 증상이 어떤지  무슨 치료를 어떻게 할건지 친절하게 이야기 해주셨고  수술후 고양이를 데리러 갔을때도 사진과 동영상으로 어떤 상태였는데 어떻게 치료했는지  설명해 주셨어요. 매우 만족하고 거리에도 불구하고 다시 이용할 예정입니다.','Y'),(10097,69,'여기 방문 이전에 다른동물병원에 아이를데리고갔었는데요  폐수종이다 이것저것 검사하고 입원시켜라 라고 하길래 중단시키고 아는지인이 소개해준 이로동물병원에 와서 다시 제대로 검사해보니 다행이 아주 정상적이라고하셨습니다 설명도 팩트있게 잘해주시고 가격도 다른곳보다는 저렴한편이였고 정말 친절하십니다','Y'),(10098,69,'친절하고 꼼꼼하시네요. 병원비도 과한 편은 아닌데 이쪽 자체 병원비가 높은 편은 아닌것 같아요. 단점은 퇴근하고 가면 선생님이 한분이라 그런지 오래 기다려야해요.','N'),(10099,70,'상암동의 중심 