6,'편안한 마음으로\n이용하지요','Y'),(10145,119,'주차 편하고 강서지점에서만 구입할수있는 왕새우튀김 새러드가 별미라 자주 갔었는데 왕새우튀김 샐러드 코너가 폐점했네요~ ㅠㅠ','Y'),(10146,119,'직원분들 친절하고 다양한 종류의 제품이 눈길을 끕니다. 하지만 전자제품쪽이 다양하지 못해서 아쉽네요','Y'),(10147,119,'초등생 책상 침대보러 가서 상품 품질이나 가격은 잘모르겠지만 금천시흥 금천독산 강서가양 등에 비해서는 상품 디스플레이가 훨씬 보기 좋게 잘 정리되어 있고 뷰티하며 진열대간 공간도 넓어 아이쇼핑이 안정적인 느낌을 받았고 참 좋았습니다. 첫쇼핑이지만 다음에 근처에 온다면 다시 방문 예정입니다. 출차시에도 주차권 확인 안하시네요!^^* 안개등','Y'),(10148,119,'좋은 위치에있다. 각종 생필품은 물론이고 1층은 키즈카페(챔피언), 푸드코트, 아트박스, 기타 잡화류를 파는 상가가있고, 윗층에도 여러 브랜드샵, 가구, 전자제품까지 여러 상가들이있다. 주차장은 자리가 넉넉한편이긴 하지만 매장 접근성이 좋은 몇몇층은 조금 자리가 부족하게 느껴질때도 있다. 그렇다고 특별히 대기 어렵지는 않았다. 경차 주차장이 중간중간 끼어있는데 의외로 매우 불편하다.','N'),(10149,119,'주말 여행 때문에 장을 보러 다녀옴. 항상 느끼는거지만 홈플러스 강서점은 주차부터, 상품진열, 넓은 이동 통로라서 가양 이마트처럼 병목현상은 없다.\n그래서 이마트보다는 식품종류가 좀 적은듯 해도 강서 홈플러스로 가는 편인듯 싶다.  회코너에서 연어2팩, 물회2팩 사서 카트에 담았더니 어디선가 나타나신 아주머니 몇개의 아이스팩까지 챙겨주시고 완전꽁꽁친절 서비스, 좀 아쉬운 점은 가양 이마트 보다  종류가 많이 없긴 없는듯 싶다.\n\n이마트가 없어지면서 ..','Y'),(10150,123,'단풍 설경 맛집 동간 거리가 넓어 개방감이 좋아요.','Y'),(10151,123,'교통좋고 시장가깝고 건물튼튼하고 북한산 삼각산 인수봉이 한눈에 보이는 경관 좋은곳','Y'),(10152,123,'굿','Y'),(10155,124,'장점\n주차장 스트레스 없음\n대중교통, 쇼핑의 편리함\n불꽃놀이 볼 수 있음\n\n단점\n주차장 입구에 택시들\n환기 안됨\n창문 열면 소음, 닫으면 더움','N'),(10156,124,'용산역 바로앞에 이렇게 화려한 주복; 정말 볼떄마다 너무 살고 싶은곳','N'),(10157,124,'그럴싸해보이지만 실제론 별로..\n창이 싸구려인지 소음 다이렉트로 들어옴\n비싸기만함..','N'),(10158,124,'용산역 재개발 이전의 이자리엔 무엇이 있었을까?','N'),(10159,124,'용산 아이파크몰 바로 건너편 빌딩','Y'),(10160,129,'고양이 진료때문에 집 근처 괜찮은 병원을 찾아보다가 지인이 로운동물병원 정말 괜찮다고 추천해줘서 다녀왔어요! 저희집 고양이가 겁이 많아서 강아지가 짖기라도 하면 무서워할까봐 걱정했는데 다행히 강아지 고양이 대기실이 분리되어 있어 좋았고 병원 자체도 깨끗하고 깔끔하고 쾌적해서 집사입장에서도 맘놓고 진료 볼 수 있었습니다ㅠㅠ 의사쌤이 과잉진료도 하지않아주셔서 더 좋았어요!! 덕분에 부담없이 진료 너무 잘 받았습니다! 감사합니다 :)','Y'),(10161,129,'집사친구가 목동 고양이 진료는 로운이 괜찮다고 해서 가봤는데.. 병원 안에 고양이가 있는줄은 몰랐어요 너무 귀여워요 완전 개냥이들...♥️ 병원도 깨끗하고 저희 집 고양이 검사도 안 아프게 해주신 것 같아서 감사합니다 앞으로 고양이진료 보러 자주 방문할게요~!','Y'),(10162,129,'저는 병원에 방문할 때 무조건 깔끔함부터 체크하는데 전체적으로 정말 깔끔했고 관리에 신경을 쓴다 느꼈던 부분이 강아지와 고양이 대기실, 진료실을 구분해 뒀더라고요!\n모든 선생님들이 다 친절하셨고 저희 집 아가한테 하는 행동이며 말투를 보면 반려동물을 정말로 아끼는 분들이다 느껴졌어요ㅎㅎ\n진료도 굉장히 꼼꼼하시고 과잉진료도 없으셨는데 앞으로 정착 예정입니다!','Y'),(10163,129,'고양이 진료 때문에 병원 알아보다가 추천받아서 다녀왔는데, 전반적으로 만족스러웠습니당\n고양이 대기실도 따로 있고, 선생님께서 너무 꼼꼼하고 친절하게 봐주셔서 좋았어요~\n덕분에 우리 칼리 진료 잘 받고 왔네요~','Y'),(10164,129,'카카오맵 닫고 네이버리뷰는 조작이 많네요 ㅋ\n정말 모든 수의사쌤 별로입니다. 제 아이 오진으로 다른곳에서 약물로만 간단히 치료한 질병을ㅡ 뻘 수술할뻔했고 다른병원가니 다른병명으로 나왔어요. 그냥 중성화나 간단한 처치만 받으시길 바랍니다. 조금 몇달 안났는다고 다른걸 해보지도 않았으면서 제가 세밀검사 해달라고했는데도 그럴필요없다고 하고, 마지막 방문시 세밀검사도 안하고 비싼수술과 입원부터 권유하는 원장 태어나서 처음봄 오진이라도 아니였으면 제가 돈들여서 ','N'),(10165,131,'상가가 잘 형성되어있네요','Y'),(10166,131,'옆단지 아파트.\n우리보다 싼 관리사무소 업체 쓰는데\n관리는 허버 잘되어있음','N'),(10167,131,'레이안타워에요\n아파트잘정리','N'),(10168,131,'가재울 뉴타운 최고의 아파트','Y'),(10169,131,'깔끔함 그자체. 최고의 입지','Y'),(10170,137,'이곳 상가 몇군데에 매주 신문을 주러 다녀옵니다. 길음뉴타운아파트중 역에서 가장가깝고 길음역으로 통할수 있는 출구를 이곳 지하로 연결하는 공사가 한창입니다. 상가는 아직 비어있는곳이 몇군데 있어요','N'),(10171,137,'신규건물인데 벌써 하자가 보임.','N'),(10172,137,'아직 인프라가..','N'),(10173,137,'여기에 있어요^^','Y'),(10174,137,'역세권.. 상가 입점중','N'),(10175,138,'신축이라 깔끔하고 지상에는 차가 다닐 수 없게 되어 있어 쾌적하다. 지하에 헬스장과 독서실 등 편의시설이 모든 동과 연결되어 있어 편리하다. 아파트 현관을 들어가면 엘리베이터가 내려오고 밖에서도 집 안 조명이나 온도조절을 할 수 있는 등 여러가지 편리한 부분들이 잘되어있다.','Y'),(10176,138,'조경좋고 최신 아파트라 깨끗함.\n주변 편의시설이 부족한 점은 있지만 최근 동네가 지속적으로 업그레이드 중~~조만간 살기 좋은 동네가 될듯...','Y'),(10177,138,'신축한지 1년이 되어가는 재건축단지로  단지내 헬스장 골프장등  편의시설이 원스톱으로 가능한단지입다','N'),(10178,138,'조경이 사계절감상을위해 특별한 설계가 아주잘조성된 명품 아파트입니다.','Y'),(10179,138,'단지 깨끗하고 좋지만\n주차장 안내도가 정말 갈때마다 헷갈림 ㅡㅡ.','N'),(10180,146,'신내프라디움  메가커피..진심   깨끗해요.\n실내  좌석도  굿뜨...음료도 굿','Y'),(10181,146,'멋진 고층 건물~','Y'),(10182,146,'오피스텔 과 찾는데 구분하기힘듬','N'),(10183,146,'업무방문,  상가 공실이 많네요','N'),(10184,146,'집사러 왔는데 대출 알아봐야겠네ㅋ','Y'),(10186,155,'선생님들 너무 친절하시고 아이를 정말 아껴주시는구나 느껴지더라구요. 진료비도 저렴한 편이고 개원한지 얼마 안되서 그런지 시설도 전반적으로 깨끗해요👍🏻👍🏻','Y'),(10187,155,'깨끗한 시설과 친절한 직원분들 또 자세하게 설명주신 원장님 덕분에 내원이 편했어요','Y'),(10188,155,'원장님이 신뢰가 갑니다. 시설도 좋네요','Y'),(10189,162,'놀이터에 집라인이 있다!','N'),(10190,170,'관리 체계적으로 잘 해주십니다. 인정!','Y'),(10191,170,'좋아요.','Y'),(10192,170,'관리 안됨','N'),(10193,170,'........ㅏ가야나구너ㅏ대애','N'),(10194,170,'ㅇㅇㅇㅇㅇ','N'),(10195,174,'냉동식품 유통기간이 지난것이 제법 눈에띄었어요..;;사진은 찍을수가 없어서 못올려요..','N'),(10196,174,'편의점 복권방 미용실 치킨집과 기업은행제휴\nATM기기가 있습니다.','Y'),(10197,174,'장소 협조하고 주차공간이 부족함','N'),(10198,174,'칠남형수 대동인테리어','Y'),(10199,174,'어여머리미용실','N'),(10200,176,'우리집 강아지 다 생각하시고 봐주시는듯 친절합니다','Y'),(10201,176,'친절하고 원장님이진료를잘봐요','Y'),(10202,176,'너무 친절하시고, 적정선에서 진료 봐주세요 과잉진료없음ㅎㅎ','Y'),(10203,176,'원장쌤 양심적~ 설명도 자상하게','N'),(10204,176,'친절한 동물병원.  냥이 강아지 병원','Y'),(10210,187,'넓고 꽤 쾌적한 곳이었습니다 보안에 굉장히 유의하고 있는 것 같고 경비원분께서 설명도 잘해주십니다. 숙박앱을 이용하는 분이 꽤 많은 것 같습니다','Y'),(10211,187,'뷰가 정말 좋습니다. 바로 앞에 석촌호수도 있어서 살기에는 최고입니다.','Y'),(10212,187,'오피스텔 뷰가 너무 좋아요 살고싶어요','Y'),(10213,187,'석촌호수를 내려다보는 최고의 전망뷰 오피스텔 중의 한곳이지만...방구조(공간활용)및 마감을 급하게 한듯한 점이 함정;;;','Y'),(10214,187,'좀 오래되었지만 상가도 많고 위치도 석촌호수랑 가까워서 좋네요!','Y'),(10215,195,'도심속의 넓은 공원으로 개설된지 수십년이 지나 나무들도 크고 동물원, 식물원, 지금도 명칭이 동일한지 모르지만 청룡열차를 비롯한 놀이기구 등이 여전하다. 주변에 사는 사람들에게는 쉽게 접근할 수 있으니 그야말로 소중한 공원이겠다.','N'),(10216,195,'주차는 동물원인지 정문말고 다른데 했다. 가족 단위 방문객이 많아서 유모차 끌고다니기 편하다. 오랜만에 동물 봐서 재밌다. 동물원 설명도 아이들 수준에 맞춰져있어서 좋았다.','N'),(10217,195,'금요일에 갔는데 줄 안서고 이용했어요 직원분들도 다 친절하시고 너무 무섭다 싶은 놀이기구는 없어서 잘 용했습니당 ^^( 회전그네는 생각보다 많이 어지러워요 ) 어릴때 방문했다가 성인되고 방문하니 옛추억도 생각나고 좋았습니당 동물원이랑 식물원은 무료관람 가능해요! 방문일자 (2024년 11월 1일)','Y'),(10218,195,'서울 도심 속에 자리잡은 오랜 역사를 자랑하는 유원지 겸 공원.\n옛 유적지 위에 지어져 공원 한쪽에 유강원이 있다.\n나무들도 울창하고 녹지도 상당하여 돌아다니면 제법 시간이 걸리는데다 동식물원, 음악분수, 놀이동산 등 다양한 즐길 거리가 준비되어 있어 가족이나 연인이 함께 가면 매우 알찬 시간을 보낼 수 있다.\n공원 가운데 팔각당은 전망대 역할을 하며 이 건물 안에도 아이들이 놀 수 있는 놀이방 같은 공간이 있다.\n공원 남쪽에는 야외수영장, 눈썰매장도 ','Y'),(10219,195,'추석연휴에 갔다가 그늘은 넘 시원했는데 찌는듯한 태양에 땀샤워에 더위 먹었던....\n하지만 무료라서 넘 좋아요. 공휴일이라 주차 자리가 없어서 주차하기 힘들었어요.\n웨건 빌릴수 있어서 아기 둘은 덜 힘들었겠지만...\n더운 날씨속에 동물원의 동물들도 많이 안보이고 활동을 안해서 아쉬웠어요.\n그래도 애들이 좋아 하니 담에 또 놀러 갈 것 같아요.','Y'),(10220,198,'강아지 폐 종양 수술 받고 관리하고 있는 병원입니다. 절제술 후 조직검사 결과가 좋지 않았지만 노견임을 감안하여 항암치료 보다는 아이 컨디션 올리는데 먼저 힘 쓰자고 하시네요. 슬프지만 동네에 큰 병원이 있어 다행입니다…','Y'),(10221,198,'여기서 디스크 진단 받고 수술까지 마무리 지었네요 mri촬영도 가능 하고 큰병원이라 제대로 수술 받아서 다행입니다 .. 수술 비용은 큰병원만 비교 해서 그런지 다 비슷 했구요 !','Y'),(10222,198,'이렇게 자세히 설명해주시고 성심성의껏 진료하는 병원 처음입니다.\n비교적 큰 수술이었는데 수술도 정말 잘 됐고 덕분에 잘 회복되었어요.\n정말 감동스러울 정도로 정성으로 치료해주셨어요.','Y'),(10223,198,'2.1키로 9살 노견 갑작스레 찾아온 자궁축농증이란 병에걸렸어요 중성화를 안해서ㅜㅜ\n전날부터 피고름에 악취까지 ㅠㅠ\n다음날 바로 달려가 응급수술하고 이틀만인 오늘 퇴원했네요\n언제 수술을 했냔듯 회복두 넘 빠르고 잘먹고 잘싸고 뛰어다녀요 ㅋㅋ\n원장님 정확한 진단과 수술실력은 완전 짱이고 간호사 쌤 넘 친절 하게 입원내내 돌봐주시고 안심시켜주셨어요','Y'),(10224,198,'강아지 디스크 때문에 여러 병원 방황했습니다. 약 먹이며 나아지는가 싶다가 다시 재발하고 반복해서 좀 더 큰 병원에서 수술해보자고 해서 찾은 병원이 월드펫입니다. 고난이도의 수술이라고 들었는데 경험 많으신 선생님들 덕분에 수술 잘 끝냈습니다.','Y'),(10225,204,'선생님도 너무 친절하시고 미용선생님도 신경많이써주시고 금액도 다른병원보다 저렴해요~  이사왔어도 항상 여기병원만 가요^^','Y'),(10226,204,'강아지가아파 병원방문 의사선생님 강아지\n아픈이유 예를들어가며 설명해주셨는데\n귀에 쏙쏙들어오고 넘~친절하심','N'),(10227,204,'친절한 으사선상님... 절대 바가지 없다고 소문난곳..그렇기때문에 믿고 찾는 우리 댕댕이 병원','Y'),(10228,204,'의사선생님이 고양이를 잘아세요! 친절하시고 무지 양심적이십니다..감사해요 선생님^^!!','Y'),(10229,204,'우리 강아지들이 아프거나 미용할때 가는곳\n친절하고 동물을 진심으로 좋아하는분들인것 같아서 안심하고 다님','Y'),(10230,209,'좁아요','N'),(10231,209,'사는곳','N'),(10234,214,'의사선생님, 간호사분 모두 친절하시고,\n영수증에 진료비가 별도로 없음. 처치값만 받음.\n원장님께서 아이 상태를 듣고 촉진하는거에 시간을 많이 할애해주셔서 궁금하고 걱정되는거를 자세히 여쭤볼수 있어서 아주 좋음.\n밤 9시까지 진료(접수는 8시까지)\n저녁때 가면 대기가 항상 20~30분 있음.\n강아지, 고양이 모두 보심','Y'),(10235,214,'진짜 여기  남자원장님...동물을 사랑하시는게 느껴집니다...어떤 동물이던 아이 소중하게 살살 다루시는 모습을 보신다면...\n아마 동물계의천사 수의사 님을 보고 계신겁니다..\n\n설명또한 얼마나 잘해주시는지...\n직원분들도 얼마나 열심이 신지...\n\n병원은 원장 분위기만 봐도 직원을 알 수 가있지요..\n강동구 이곳저곳 병원15군데는 다녔어요 이곳이 가장 최고의 진료를 봐 주세요...\n\n진짜 좀 제발 쉬셨으면 좋겠어요..원장님 아프실까봐 걱정입니다...애완','Y'),(10236,214,'세상 제일 친절 ^^\n10일된 아가가 감기걸렸어요\n내 애기처럼 대해주시는 원장님 믿고 5년째 다니고 있습니다','Y'),(10237,214,'진료 잘 봐주시고, 무리한 진료비 청구 절대 안하시고, 모든 작원이 친절하고, 여튼 좋아요. ^^&','Y'),(10238,214,'20년 가까이 여러 동물병원 다녀 번 중에서 베스트로 꼽히는 친절한 의사와 간호사선생님들! 의사선생님이 전문지식을 알기쉽게 설명해주셔서 좋고 아이들을 사랑하는게 넘나 느껴져요. 24시간 병원이 아니라서 새벽응급진료를 받을 수 없는 건 아쉽지만 개인병원이니까 당연히 어쩔 수 없는거겠죠. 과잉진료 없이 합리적인비용으로 따뜻함까지 얻을 수 있는 좋은 병원이에요~','Y'),(10239,218,'과잉진료안하고 친절하심','Y'),(10240,226,'원장님 매우 친절하시고, 설명도 자세히 해주셔서 항상 감사히 다니고 있습니다.','Y'),(10241,226,'예전에 키우던 애기들 병원이였는데 이사가서 다른데 다니다가 도저히 못다니겠어서  멀지만 다시갔어요 원장님 12-3년만에 뵈었는데 알아보시더라구요\n친절히 설명도 잘해주시고 👍👍👍👍👍👍','Y'),(10242,226,'6년째 다니고 있는데 과잉진료없고 꼼꼼하게 잘 봐주세요~ 막 친절하지는 않지만 그건 원장님이 수줍어서? 일 수도 있어요^^','Y'),(10243,226,'울냥이들 아가때부터 다니던곳\n친절하시고 과잉진료도 없고 편안하니 좋아요','Y'),(10244,226,'최고에요~^^','Y'),(10245,229,'동네 저렴하고 진료잘보는 동물병원\n한가지아쉬운점은 24시간 하면좋겠지만 그건 내 욕심이겠죠','Y'),(10246,229,'친절하고  잘봐주십니다. 주차불가','Y'),(10247,229,'세심하게 잘 보살펴  주세요~','N'),(10248,229,'정말 친절하세요','Y'),(10249,229,'친절한 선생님','Y'),(10250,236,'매년 종합검진을 받았는데\n여기만큼 꼼꼼하고 정확하게 알려준곳이 없었어요\n이제 여기만 다니려구요','Y'),(10251,236,'울 멍멍이 용이 ㅡ디스크랑 결석이 수술없이도 눈에 띄게 좋아져서 ㅡ걷고 점프까지 합니다.\n명의세요~~감사합니다.','Y'),(10252,236,'저는 오래전부터 다닌 병원입니다.\n확실히 다른 동물병원에비해 병원비가 저렴하게나와요 !! 원장님께서 바쁘신데도 인상한번 쓰는거 본적없고 물어보면 잘봐주시고 예전부터 청결에도 항상 신경쓰세요 ~ 한달에 한번씩 가야되서 매번 예약진료를 보고있는데 처방이랑 진료랑 잘보셔서 그런지 꾸준히 진료가 많으세요 !!\n가실때는 전화하셔서 문의해보시고 가는걸 추천해드려요 ~','Y'),(10253,236,'일단 병원에 도착하면 아무도 나와보지 않아요.\n대기시간은 아무도 없는데도 30분 정도 걸리고요, 사람이 많으면 1시간은 훌쩍 넘어요.\n진료 본 다음에도 약 나오는 시간이 30분 정도 추가로 걸려요. 이럴 거면 왜 예약을 잡죠? 예약 시간 맞춰서 진료 본적 한 번도 없네요.\n\n소동물은 스트레스에 취약한데 대기시간 때문에 너무 힘들어했어요.\n\n동물농장 보고 믿을만해서 갔는데 정말 별로네요.\n선생님은 친절하신 게 딱 방송용 수의사가 맞네요.\n\n저희 햄스터가 ','N'),(10254,236,'바쁘면 직원을 더 두던지 그게 어려움 최소한 안내하시는 분이라도 있어야 하는거 아닌가싶다 기존대기자 새로운손님등 앉을곳도없는데 20분동안 아무도 안나와보더군.성질나서 몰상식하지만 조제실이라고 써있는곳 문을 박차고 들어갔다.\n얼핏봤지만 한두명만 동분서주중이고 한명은 휴대폰 만지고있더라.\n컴다운과 릴렉스를 최순위에 두고 살기러 마음 먹었지만 순간 욱 했음.\n기다리는거야 기다릴수있지만 최소한 왜왔는지 뭐가 필요한지는 물어봐줘야 하는거아닌가??그래야 막연한 기','N'),(10255,250,'집과 가까워서 잘 다닙니다.\n댕댕이등록증 만들고 왔어요','Y'),(10256,250,'친절한 진료. 미용도 잘하고 오픈 미용실 다보임.','Y'),(10257,250,'친절하고  고양이  잘 봐줘요','Y'),(10258,250,'정말 좋은 병원이에요.','Y'),(10259,250,'친절합니다','Y'),(10260,258,'비교적 젊은 수의사로 가득한 Vip 청담지점은\nMRI장비가 있고 규모가 커서 많이 찾아가는듯.\n개인적으로 내 주변 지인이 간다면 극구 말리고 싶다.. 굳이?\n\n이렇게 젊은 페이닥터한테 진료받아도 이정도의 진료비를 내는건\n그만큼 보호자들이 절실하다는 뜻인데, 좀더 겸손해야할 것.\n(검강건진은 비싸지 않은편)\n\n체인점이기에 총세번을 갔지만 청담점만\n타지점보다 특별한것이 없는데  강남구에 위치하는 이유로 진료비를 더받는 부분도 잘 이해되지 않음.\n\n*온라인 ','N'),(10261,258,'의료진이 120명인 국내 최대의 동물병원 입니다','N'),(10262,258,'너무 친절~','N'),(10263,258,'내 개가 타이레놀 과다 복용이 의심되어 여기로 오기 시작했습니다.\n1) 응급 진료는 훌륭하고 응급 전화를 조심스럽게 받아들입니다. (너무 바빠서 다른 곳으로 전화하라고 한 다른 동물병원과는 달리... 그리고 저는 겁에 질려 응급 전화로 전화를 걸었습니다.) 긴급 상황에 이 수의사를 강력히 추천합니다\n2) 일반적인 검진도 훌륭했지만 이는 귀하가 보는 특정 수의사에 따라 다르다고 생각합니다.  약속을 잡기 전에 항상 조사를 하십시오.\n3) 치과 청소는 정말','N'),(10266,262,'개인병원에서 모르쇠 하던걸\n김준영 교수님께서 캐치해주심.\n동물병원은 건대로 추천드림.','N'),(10268,264,'2020년에 입주시작한 상가와 오피스텔로 구성된 상업용빌딩으로 상가에는 주로 병의원이  많이 입점이 되어 있는 상태이며 고덕역 바로 인근에 위치하여 접근성이 좋음. 최근(2021.7월) 바로 옆에 고덕역대명밸리온 빌딩이 준공되어 입점이 시작된 상태로 고덕역 인근 오래된 건물들이 하나 둘 바뀌기 시작하여 주변환경들이 좋아지고 있음.','Y'),(10269,264,'새로 지은지 얼마되지 않아 깨끗한 오피스텔입니다~~','Y'),(10273,267,'낙후된 느낌이지많\n그만큼 가성비대비 좋은 물건들이 많이 있습니다\n행사도 많이  하고 가성비최고입니다\n신도림에서도 가까워 접근성도 아주좋습니다','Y'),(10274,267,'이른 퇴근하고 들렀더니 조용하니 좋았다.\n마트로는 안좋겠지만 ㅎㅎ\n싱싱한 물건이 많아서 눈이 즐거웠지만 집까지 가져오기가 힘들어서 포기했다.','Y'),(10275,267,'속옷을 사기위해 가끔 방문을 하고있는 곳입니다','N'),(10276,267,'세일도 많이하고 맥주 아이스가방 행사도 다양해요 사람이 너무 없어서 구경하기 편했어요 규모는작은데 알차요','Y'),(10277,267,'다양한 홈플러스 지점을 가보았다. 신도림점은 유동인구가 많아서 그런지 언택트와 컨택트가 적절히 조화를 이루는 것 같다. 필요하지 않을 때 말 걸지 않아주셔서 감사하고, 무언가 여쭤보면 잘 알려주심에 감사드린다. 갈 때마다 소비하고 싶은 욕구를 뿜뿜! 일으킨다. 오래 가는 지점은 이유가 있다!!\n\n방문했던곳 1. 동물병원 옆 펫샵(용품 판매 및 소동물 분양 관련)\n- 첫번째는 팬더 인형을 사러 갔다. 정말 귀여운 팬더 인형 겟!\n- 두번째는 첫번째 방문 ','Y'),(10278,269,'지정병원, 과잉진료.과한 진료비 없고 선생님들 친절하시고 설명도 잘해주세요. 중간중간 사진도 보내 주시고.','Y'),(10279,269,'안동 가면. 안동땜에 있는 이곳ㆍ 맛집으로 가고 다들 좋아들해요','Y'),(10280,269,'이곳은 애완견을 기르시는 분들이 자주 찾아\n오곤합니다.\n개업을 한지는 2년 정도 됐고요.\n시설은 깨끗한 편인걸로 알고 있습니다.\n애완견이 아플때 멀리 가지마시고 이곳\n경인동물병원에 방문을해서 애완견 진료를\n받으시면 될것 같습니다.\n아! 이곳 경인동물병원은 야간 응급센터도\n있는걸로 알고 있습니다.','N'),(10281,269,'지인 추천으로 계속 다니는 병원입니다! 영등포역에서 멀지않고 원장님 간호사님들 모두 친절하시고 좋은 정보도 많이 알려주셔요! 그리고 길냥이 치료 시 할인되니 참고!','Y'),(10282,269,'동물병원은 원래 돈이 많이들어요. 그렇다면 빨리 병의 원인을 파악할 수 있고 치료할 수 있는 곳을 찾아야합니다.\n여기가 그곳입니다.','N'),(10283,270,'영국에 무사히 도착했습니다.  자료 감사합니다 각 레벨을 순조롭게 통과할 수 있습니다.  이제 새로운 삶에 적응한 Alex는 영국에 온 이후로 그 어느 때보다 건강하고 젊어졌습니다.','Y'),(10284,270,'병원 깔끔하고 원장님이 푸근하세요','Y'),(10285,275,'족발먹고 싶을때 드시는거 추천드려요\n포장도되니 참고하세요','N'),(10286,275,'주차장이 넖어서 좋아요.\n지하에 스크린 골프가 가능합니다.','Y'),(10287,275,'주차하고 밥 먹기 좋음.\n식당에서 식사하면 주차료 무료','Y'),(10288,275,'용산리첸시나가면 스파에코만 가요 피부관리는 스파에코가 짱이지요 ㅎㄹ','Y'),(10289,275,'약국, 뚜레쥬르 빵집, 롯데슈퍼 등의 상가들이 있습니다.','Y'),(10290,276,'14살 저희 강아지 폐종양 수술했어요. 이규석 대표 원장님께서 상담도 자세히 잘 해주시고 수술이랑 입원까지 잘 돌봐주셔서 무사히 잘 퇴원할 수 있었어요. 큰 수술이라 걱정이 너무 컸는데 병원에서 안심할 수 있게 잘 돌봐주셔서 너무 감사했어요.\n잘 회복하도록 돌보면서 계속 관리받고 싶은 병원입니다.','Y'),(10291,276,'다른 동물병원에서 갑상선 종야과 종격동 종양 소견이 보여 한꺼번에 수술할 수 있는 곳을 찾다가 내원했습니다. 원장 선생님의 자세한 설명과 수술에 대한 자신감으로 진행하였고 쉬운 수술이 아니였음에도 불구하고 성공적으로 수술해서 너무 좋아요 직원분들도 친절합니다.','Y'),(10292,276,'13살 말티즈 간암수술했어요 아주건강히 항암까지마치고 한달에한번씩 건강검진 차원으로 진료다니고 있어요~ 이규석원장님께서 진료도 친절히 알뜰살뜰 잘봐주시고 간호사분들이며 모든분들이 너무너무 친절하세요~ 상담톡도 친절한응대 좋아요^^','Y'),(10293,276,'노령견 수술전문이라고 해서 갔고, 우리 아이 여기서 담낭제거수술과 위종양 수술 받고 다시 살아났습니다. 너무 감사해요~! 이규석 원장님 정말 친절하시고, 실력있으세요 👍 수술해주시고 회복 도와주신 의료진분들 모두 감사합니다!','Y'),(10294,276,'고양이 폐암수술이후에 알수있는\n어떤 종류의 종양인지 들엇을때\n예후가안좋은 악성종양인 검사결과를듣고\n지금까지 정말 많이 걱정했는데요\n수의사선생님이 현재고양이나이,체중,활력,이전\n수면마취했들때 많이힘들어했던점들\n모든 과거력을 세심하게 고려해주시면서\n보호자가 현명한 판단내릴수있는 충분한 설명과\n정보를 주셔서 감사합니다 4주뒤에\n건강검진받으러 또오겠습니다','Y'),(10295,284,'너무 친절. 내가 진료받고 싶다. 강아지로 태어나면 여기서 진료받게 해주세요 주인님.','N'),(10296,284,'모든사람이친절합니다.(취소합니다. 이유는, 2019년도 까지는 친절했는데, 2020년 방문하곤, 정말 불친절합니다.\n김태화 동물병원에서 김태화원장이 그만 두고, 젊은 사람이 하더니,2020년 더 젊은 사람이와서, 진찰을하더니, 폐렴이래요, 작년에폐렴이라고 큰수술을했다하니, 그건 그원장한태 물어보래요.\n원장님어디갔냐니, 세미나갔데요.\n코로나가 한창번창하고 거리두기하는데, 계속 물어보니 옆의간호산지  몬지가 듣지않으려 면  나가래요.\n참  황당했습니다.\n김','N'),(10297,284,'정확한 진단 해주셨어요 친절한 설명과 친절한 진료 잘받고 왔습니다.\n병원비 도 저렴합니다.감사합니다','Y'),(10298,284,'원장님께서 실력이 뛰어나시고 매우 친절하십니다. 과잉진료도 없으시구요. 추천드립니다^^','Y'),(10299,284,'15년째 이용합니다. 동물에 개한 애정이 있으세요','Y'),(10300,286,'기침을 많이하여 다른 동물병원에서는 폐가 안좋다 하였는데 심장이 안좋다고 병명을 정확하게 진단해 주어 걱정이 많이 즐어들었다. 지금까지 여러 동물병원 많이 가봤지만 가장 신뢰가 간다.','Y'),(10301,286,'주변에 비해 약값, 사료값, 간식값 특히 부르는게 값이라는 치료비 뭐하나 비싼거는 눈 씻고 찾아볼 수 없는 곳입니다~~^^ 우리 강아지들도 많이 이뻐해주시고 서비스도 잘 챙겨주시고 미용언니도 친절하시고 강추×강추입니다~~^^','Y'),(10302,286,'과잉진료 없이 솔직하게 진료하시고 수술도 직접 하시는 수의사 선생님의 신뢰도 때문에 이사가서도 10년째 다니는 동물병원','Y'),(10303,286,'동물병세에 따라 정확한 진단으로 과잉진료가 없는편. 타병원보다 비용도 저렴한 편이다. 미용도 잘 한다','Y'),(10304,286,'원장님이 친절하시고 진료도 잘봐주시네요','Y'),(10305,293,'의사선생님과 간호사선생님 모두 친절하세요\n과잉진료도 안하시고 설명도 자세히 해주셔서 항상 감사합니다','Y'),(10306,293,'과잉진료없음. 원장님.테크니션선생님 왕친절','Y'),(10307,293,'친절한 동물병원입니다','Y'),(10308,293,'서비스 친절','N'),(10311,303,'송강준 원장님이 진단, 치료 모두 신속, 정확, 친절하게 해주셨습니다. 20년동안 경험한 수의사 중 최고입니다.','Y'),(10312,303,'친절하고  진료 잘보고 훌륭한 선생님들입니다','Y'),(10316,305,'슬개골 탈구로 동네 병원 몇 곳 갔는데.. 역시 대학병원이 좋네요. 새로운 정보와 정확한 사실을 알 수 있어 좋았고 의료진 선생님들 너무 친절하셔요.  세세하게 동영상과 사진, 모형 보여주시면서 설명해주셔서 이해하기 좋았습니다. 접수처 직원분들도 친절하시구요. 주차도 무척 편합니다.','Y'),(10317,305,'닥스노견 경추디스크로 2차병원전전하다 한방쪽으로 내원 오랜만에 왔더니 엄청 현대적으로 잘해놨네요 의료진분들도 엄청친절하시구요','Y'),(10318,305,'병원 자체가 사람이나 동물이나 보통 아파서 오게 마련인데 별 계산대 직원들 너무 불친절하다 어느 땐 간도 빼주듯이 어느땐 성질을 부린다 개인의 기분에 따라 태도가 바뀐다면 성질 난다 무조건 상냥하라는 게 아니라 톡 쏘거나 쌀쌀맞을 거까지 있냐는 거다 대우받을라는 게 아니라 병원 이용 고객으로 존중은 되어야 하는 거 아닌가? 가운데 직원은 뭐 늘 불친절하다 병원비는 좀 비싼 가.. 비싼 게 진료비 안에 직원들 친절보다는 기본적 태도도 포함이라고 본다 이병','N'),(10319,305,'최고에 병원답게 믿음이 가는 병원입니다','Y'),(10320,305,'정확한진단을  해서  믿음이 가요','Y'),(10321,310,'지인의 추천으로 방문한곳입니다.\n주차장은 건물뒤에 위치하고 있는데 주차안내하시는분 정말 친절하세요.\n1층에서 접수후 대기하면 이름을 불러주시는데\n따라서 진료실에 들어가면 친절한 선생님께서 하나하나 설명해주십니다.\n\n검사실도 장비들이 어마어마하더군요.\n이곳은 24시간 운영되고 있어서 생명이 위험한 친구들이 중환자실에 따로 집중 치료를 받고 있더라구요.\n\n또, 강아지와 고양이 친구들을 따로따로 분리해서 검사, 치료, 입원을 하는것 같더군요.\n\n최신장비에 친','Y'),(10322,310,'서울동물메디컬센터때부터 다니고있어요.\n새건물로 이전해서 새롭게 리뉴얼된것도 너무 좋구요.더좋은건 기존 진료봐주시던 의사쌤이랑 간호사쌤들 그대로라서 거부감없이  믿고다니고있어요.24시간 진료되니 동물 대학병원같은 느낌이라서요. 좀더 체계적이고 전문적인 진료 받는것같아 좋아요!','Y'),(10323,312,'이전에도 평을 올렸는데 최근 소식을 올립니다. 8년 된 강아지가 고개도 못들 정도로 병마에 시달렸는데 신영동 월드펫 윤홍준 원장님을 비롯한 모든 분들이 너무나도 꼼꼼하고 신중하게 돌보아 주셔서 이제는 뛰어다닙니다. 만성 췌장염, 갑상선 이상, 당뇨병 그리고 쿠싱스 까지 겹쳐서 한 두어달은 일체 먹지도 못했는데 이제는 즐겁게 살아갑니다.\n갈때마다 피검사를 해서 주사에 찔리는데도 모든 분들이 너무 친절하셔서 강아지가 꼬리를 치며 병원에 갑니다.\n노견병 난치','Y'),(10324,312,'강아지가 여러해 동안 심각한 여러가지 병들로 고생 중입니다. 진단 치료를 잘해주실뿐 아니라 원장선생님을 비롯해 모든 분들이 다 정말로 동물들에게 진정한 배려를 해주십니다.\nGreat care. Truly cares for animals. If you need English translation ask them to contact Jjong’s mom. I’ll be happy to assist.','N'),(10325,312,'이곳인가요\n윤샘네 병원이...','N'),(10328,314,'개 1층, 고양이 2층으로 별도로 진료공간이 있으며 적절한 치료를 받을 수 있었습니다.\n병원앞에 주차공간이 있어 편리하게 이용가능한 24시간 동물병원 입니다.','Y'),(10329,314,'우리댕댕이가 갑자기하혈을해서갔더니 자궁축농증이라고 수술을하지않으면 위험하다고하셔서 수술하고 회복중입니다.                     선생님 친절하시고 실력도 좋으신것같네요','Y'),(10330,314,'친절한 젊은 부부 원장님이 운영 하시는 곳.\n거의 연중무휴로 밤 늦게까지 운영하시고, 급한 환자가 있으면 영업시간 넘어서까지도 친절히 봐주신다.\n동물 건강이 아니라 원장님 내외분 건강이 걱정 될 정도.\n덕분에 퇴근 후나 주말에 비교적 여유있게 찾을 수 있어 매우 만족한다.\n다른 병원은 그 시간에 가면 야간 진료비 붙는데 품은 아직 야간 진료비 붙는건 보지 못함','Y'),(10331,314,'병원두 깨끗하고  시설완비\n원장님이  진료를 친절하게  봐주십니다\n오늘도  저희고양이  우리는   병원입원치료로 입원했습니다','Y'),(10332,314,'이곳분들 엄청 잘하신다고 소문 났어요 가봤는데 잘하시는거 같아요 다른곳에서 치료하다 낫질 않아서 이곳에 갔는데 그전 병원이 오진 난거더라구요 ㅠㅠ','Y'),(10334,320,'큰수술도 가능할만큼 의료기기 설비들이 좋아요.\n그리고 선생님들도 너무 친절하시고 진료도 꼼꼼히 잘 봐주십니다.\n저희아이 수술도했는데 회복 잘해서 잘지내고 있습니다.\n고양이 3녀석 있는데 건강검진부터 모두 여기 다니고 있어요.\n동물병원 유목민들 추천합니다.','Y'),(10335,320,'깨끗하고 친절한 동물병원\n고양이전용 웨이팅룸도있고 편해요\n여기로 계속다니는중','Y'),(10336,320,'시설도 좋고, 선생님들도 친절 하십니다.\n무엇보다, 강아지랑 고양이 진료소가 분리가 되어 있어서 너무 좋았네요.','Y'),(10337,320,'선생님들이 친절하게 설명을 잘 해 주세요','Y'),(10338,320,'친절하고 체계적이고 깔끔함','Y'),(10339,322,'제가 전화했을 때, 응대 태도가 친절하지 않았습니다.\n병원에 방문해서 시술을 받은 후에는 이미 반쯤 사용된 소독제를 하나 주셨습니다.\n다른 고객들에게도 이런 식으로 대하시는지 궁금하네요.\n\n집에 돌아와서 영수증을 확인하다가 궁금한 점이 생겨 다시 전화를 드렸는데,\n응대하시는 분이 매우 불친절하게 답변하셨습니다.\n제가 돈을 내고 서비스를 받았는데, 존중받지 못하는 기분이 들었습니다.','N'),(10340,322,'우리 강아지가 다른 병원에 갔는데 약을 먹어도 소용이 없었어요. 요기에 가는데 진짜 좋고 가격도 저럼하고 너무 친절해요. 매번 갔을때 서비스 간식을 많이 줬어요. ❤️❤️❤️','Y'),(10341,322,'고양이 중성화 수술 여아 13만원 남아 10만원\n울 애기들 전부 여기서~~ㅎ\n접종비도 엄청 저렴해요\n박사님 최고에요♡♡♡','Y'),(10342,322,'간판이 항상  눈에띄는곳  진료빋은적없음','N'),(10343,322,'충무로에서 태어나서 오랫동안 생활해온 저로써는, 과거에 이 병원을 방문한 경험을 토대로 동물을 사랑하고 케어하는 의지보다는 돈을 얻으려는 목적이 강조되는 느낌을 받았습니다. 이곳은 주로 상업적인 성격이 강하게 느껴지며, 사실적으로 이러한 비즈니스적인 면모가 없다면 과장된 얘기일 것입니다. 제 개인적인 경험을 바탕으로, 만약 박사님이 이 리뷰를 보신다면 이에 대해 물어보고 싶습니다.\n심지어 심각한 상황인 범백에 걸린 길 고양이를 치료비가 높더라도 (사실 ','N'),(10344,323,'꼼꼼하고 정성껏 봐주셔서 너무 좋았습니다. 병원 인테리어도 센스있고 동물을 정말 잘 이해하고 계신 느낌입니다. 고양이 대기 방이 따로 있어요..^^','Y'),(10345,323,'고양이에 대해 잘 알고 경험이 많은 의사선생님의 병원입니다. 대형견이 많은 인근 동네의 특성상 진찰대도 넓고 수술대도 넓어 엑스레이 촬영시 이리저리 옮기지 않아도 되어 마음이 놓였습니다. 동물자유연대에서 오랜기간 수의사를 하셔서 그런지 동물을 사랑하는 선생님입니다.이게 당연한 소리 아닌가 생각하겠지만 경험상  그런 느낌을 받기 어려운 병원도 많았거든요..','Y'),(10346,323,'지인 소개로 멀리까지 가서 우리 강아지 진료했는데  선생님이 정확하게 진단해주시고 사랑으로 돌봐주셔서 마음이 놓이고 믿음이 갔습니다ㆍ동물을 정말 좋아하시는 선생님이라 개인적으로 수년전 길가에 다쳐서 버려진 길고양이들을 치료해서 데리고 사신다고 합니다.앞으로 계속 다닐것같습니다','Y'),(10347,323,'수의사샘이 마음씨가 좋아요','Y'),(10349,324,'우리 고양이 용용이 때문에 자주 갔던 곳이예요.\n고양이는 워낙 검진을 자주 받을 일이 없다보니 남은 아이들 때문에 자주 가는 건 아니지만 과잉진료 없고 친절하시고 굉장히 많은 정보를 차근 차근 알려주세요.\n\n간호사 없이 혼자 하시는 곳이고 주차는 인근 다른 건물에 유료로 하시고 가시는 것을 추천드립니다.','Y'),(10351,325,'믿음을 주는 동물병원입니다. 반려동물을 진정 사랑하시는 맘이 느껴지고 군더더기 없이 치료해 주십니다. 감사합니다.','Y'),(10352,325,'원장님과 간호사분이 친절하시고\n설명을 잘해주십니다. 감사합니다','Y'),(10353,325,'넘 자상하시고 섬세하게 아가들을 진심으로 대하는 원장님 최고의 수의사십니다~','Y'),(10354,325,'시설은 오래되어 보이지만 친절히 잘봐주셨어여','Y'),(10355,325,'굉장히 친절하시고 잘 설명 해주심','Y'),(10356,331,'무당만 가득하고 오래된 상가들만 겨우 살아남아있던 동네가 이렇게 상전벽해 할 줄이야. 운도 따라줘서 이 동네에서 계속 자리 잡고 살고 있는게 다행이다.\n예전의 빈민촌, 산골 판자집 동네 이미지가 확 바뀌어서 세상 신기하게 다가온다.\n입지가 참 좋기도 하고 종로 인근 대규모 대형 아파트 단지는 정말 귀하긴 한 듯\n살아보면 고만고만 운좋아서 자리잡은 졸부 티나는 민도가 한계라고 느껴지는 아파트','N'),(10357,331,'재개발 천여세대 단지. 최근 신축아파트며 대단지에 속하며 서대문 내거리 대장아파트라고 본다. 영천시장 건너편 도심권아파트로서 인기 있다. 5호선, 3호선 역세권이기도 하다.\n강북삼성병원, 적십자병원, 역사문하고원, 광화문 등이 가깝다.','N'),(10358,331,'예전에 상가들어갈걸 입주민으로 잘못들어갔는데\n뭐 외부인은 호출해야들어갈수있다 들었습니디만\n주차요원분들이 그냥 들여보내주길래 상가겸용인줄알았음\n코로나 백신맞느라 40분가량 있었는데 8만원인가 10만원인가 청구해주심\n\n부당이득으로 인해 청구대상에 해당하지만\n주차요금 관련하여 고지를 안한점 당시 상가/입주민 주차장 안내문 부착이 없었던점\n설령 미리 고지받았다고 하더라도 금액산정근거가 말도 안되는 수준이라 판례 법령 무엇을 근거로 하든 만에 하나 무효는 아니여','N'),(10359,331,'조용하고 좋다','Y'),(10360,331,'대단지~!! 서울 중심 한복판 좋아요^^','Y'),(10361,334,'강아지 치료비가 너무 비쌉니다 ㆍ 그냥암것도 모르시고 하라는데로했다간  ㅡㅡ감당이 안되네요   자가면역질환 매개성혈소판감소증 진단받고 약먹기시작했는데  차도가 계속없이 약종류만 계속 늘어가고  당연히  약값은 배로 점점 늘어나더군요  ㅡㅡ\n중간에 병원을 옮기자니좀그래서   아직까지는 치료중입니다\n처방약을 구할수가없어 어쩔수가없으나  조금이라도 깍아주시지도않네요\n그리고 귀청소를 부탁했는데 그거 얼마안되는것도  돈을받더군요\n원장님이  아주 잘본다고는  말못','N'),(10362,334,'비싼 가격대비 치료보다는 다른데 더 신경많이 쓰시는 의사선생님 덕분에 좋은경험 했습니다.  돈주고 가라해도 안갈겁니다.','N'),(10363,334,'항시 모든 분들이 친절하고 반려견의 상태를 쉽게 설명해 줍니다.','Y'),(10364,334,'엄청난실력은아닌것같지만 친절하고 중병아닌이상 괜찮게보십니다.','Y'),(10365,334,'12년째 저희 아이 돌봐주시는 곳입니다','Y'),(10366,336,'지방에서는 줄기세포 치료를 하는곳이 없어서 멀어도 전문병원으로 가보자 상의하고 마지막 희망이라고 생각했는데 결과적으로는 안왔으면 어쩔뻔했나 싶어요. 하루하루 눈물로 보냈는데 지금 잘먹고 잘뛰는 모습 보니까 보호자가 많이 알아야 하고 부지런해야 한다는 생각이 확실히 들었습니다.','Y'),(10367,336,'멀지만 마지막 기회라고 생각했습니다!! 결과를 바라기엔 아직 이른것 같지만 차도가 있어요!! 점점 좋아지는걸 보니 마음도 놓이고 행복한 요즘입니다. 우리 아이 아프지 않게 다정하게 대해주셔서 늘 감사하고 있습니다! 항상 친절하신 원장님과 직원분들 너무 감사합니다!!','Y'),(10368,336,'고양이는\n데리고 가지 마세요. 고다 추천글 좀 보여서 갔었는데 여기 다녀온 이후로 고양이가 병원에 가는걸 엄청 두려워 합니다.\n강아지 미용도 같이 하다보니 냄새도 심하고 대기실에 개들 짖어대고 정신없어요.\n고양이에 대한 배려가 1도 없어요.\n얼마나 애를 강압적으로 잡았는지 오줌싸고 똥까지 지려서 나왔어요.\n그전엔 병원에 대한 거부감이 거의 없던 앤데 이후로 병원 가는게 엄청 힘들어 졌습니다.\n애 잡고 싶지 않으시면 다른 곳으로 가세요.\n강아지 전용이지 ','N'),(10369,336,'다니던 병원에서 시한부 판정받고 추천받은 병원은 다 가본것 같아요. 그러던 중 우리애랑 똑같은 증상을 줄기세포로 치료했다는 후기를 보고 한걸음에 달려왔어요. 확실히 차도가 있는걸 보고 희망이란걸 다시 찾았습니다. 후기 이런거 잘 안쓰는데 감사한 마음에 올려보아요.','N'),(10370,336,'강아지 줄기세포 치료하는곳이에요\n아이들이 건강하게 치료받았으면 좋겠어요','Y'),(10371,337,'이 글이 다른분들에게 도움이 되길 간절히 바랍니다.\n14살 노견 담낭점액종 수술 후 4일간 입원하다가 사망했습니다.\n사망 당일 병원에 면회차 방문중이였으며 심폐소생술 중임을 전달받고 수술실에 입장을 요청했으나 거부 당하였으며  약 10분간 들어가지 못하였고 제차 요청하여 입장을 하였고 들어갔을때는 이미 강아지 상태는 안좋은 상태였습니다.\n심폐소생술중인 선생님께서는 강아지가 토를 많이 해 기도가 막힌것으로 의심된다고 말씀주셨습니다.\ncctv에 대해 요청했','N'),(10372,337,'아기 고관절,슬개골 문제로 추천받아 방문했어요. 선생님들 친절하게 상담해주시고 병원 시설 좋고 깨끗해요.\n첫진료 잘 받고 왔습니다. 다음 진료때 뵐게요 감사합니다','Y'),(10373,337,'외과 원장님 최고에요 추천받아서 방문한 것도 아니고 집이 가까워서 찾아가게된 병원인데 그저 감사하다는 말밖에는... 김규창 선생님 설명 진짜 명확하시구요 군더더기가 하나 없어요 책임져주었겠다고 말씀 주신 부분도 너무 감사합니다 수술 잘 되서 책임지실 일 없어서 다행이긴 했지만 너무나 감사하고 믿음이 갔던 선생님이에요 병원 유목민이었던 제가 여기 정착하게 될 거 같아요! 비용도 동물병원이니 각오하고 갔는데 친구들 얘기 들어보니 2차 큰 병원들에 비해서는 ','Y'),(10374,337,'슬개골 수술 잘 마무리 했네요 비용도 평균수준이라 만족 합니다','Y'),(10375,337,'김규창 원장님 너무 친절하시고 잘 알려주셔서 감사해요\n선생님들도 너무 좋으시고 병원도 깨끗해서 갈때마다 안심되고 좋아요.','Y'),(10376,338,'KTX, 새마을호, 무궁화호 타고 서울역에 내려서 서울지하철 4호선 타고 4정거장 가서 \'동대문역사문화공원역(舊동대문운동장역)\'에 내려서 도보 6~7분이면 호텔에 도착함. 호텔은 오래 되었는데(Since1962, 60년 이상), 최근에 리모델링을 해서 지내기에 문제는 없음. 호텔 근처가 서민동네여서 저렴한 식당들이 많음. 호텔예약 사이트에서 저렴한 가격으로 투숙예약 가능함. 중부시장 방산시장 평화시장 광장시장 및 동대문시장 인근에서 볼일이 있을 경우에 ','Y'),(10377,338,'관광객을 위한 투어리스트 호텔 이었지만..\n룸살롱과 캬바레로 인하여 망한 케이스..\n지금은 캬바레도 없지만, 한번 실망한 관광객은 다시 돌아오지 않기 때문에...\n관광객을 위한 것에는 0점..\n술 좋아하는 사람들 에게는 70점 을 주고 싶은곳.','N'),(10378,338,'사진과 동일한 오래된 객실이었기에 객실은 넓은 편이고 괜찮았습니다 하지만 1층에 카바레가 있고 3층에 룸샬롱이 있어 가족과 함께하기엔 좋지않은 환경이었고 금연방을 요청했지만 없어서인지 담배냄새와 남자 화장품 냄새가 많이 났어요 왠만하면 돈 좀 더주고 좋은데 가길 추천드려요','N'),(10379,338,'가격 저렴하게 시설은 오래됐으나\n가성비 좋음^^','Y'),(10380,338,'어메니티 구림. 욕실구림. 추움. 침대ㆍ수건은 나름 괜춘','N'),(10381,339,'직장이 서울 도심시내에 있으신 분께 강추','Y'),(10382,339,'이곳은 일반거주지로 관광지가 아닙니다. 사는 사람마다 만족하기도 불만족하기도 한데요, 지리적으로 매우 뛰어난 위치라는데는 이견이 없을거예요:)','N'),(10383,339,'서울역 근처 최고의 단지','Y'),(10384,339,'도심속 공원 같은 아파트... 사통팔달 어디든 쉽게 갈수 있는 아파트... 아파트내 편의 시설이 무지 좋은 최고의 아파트 입니다.','N'),(10385,339,'이동네 보안알바들은 일을 하기 싫은것인지 근무태만이 수준급입니다.\n방문하는데 보안알바들이 쏘아붙여서 매우 불쾌했네요.','N'),(10386,340,'최고로 친절한 선생님과 직원들 입니다.\n전 미국에서 상담하고 도움을 요청했는데요, 번거로운 부탁까지도 최선으로 도와주시네요.\n덕분에 우리 고양이도 건강을 되찾고 있어요.\n추천+추천 입니다~','Y'),(10387,340,'친절하고 친절해요\n상담도 잘해주시고','Y'),(10388,340,'24시라 좋고 친절한 선생님들과 고양이전용대기실이 있어 기다리는동안 아이들과 편히 대기하고있을수도있고 면회를 병실아닌 면회실에서도 편히면회가 가능하고 전망도 좋고 집사를 위한 음료수도 많이 준비되어있더라구요3','Y'),(10389,340,'강추하고싶은 병원입니다!!!\n우리집 댕댕이가 피똥을 누길래 리뷰를 보고 평이 좋아서 찾아갔는데 말대로 의사선생님이 너무 친절하시고 설명도 잘해줄뿐만아니라 과잉치료가 없이 필요한 검사만 하시더라구요. 그리고 장염이라며 일주일치 약을 처방해주셨는데 복용후 바로 나았어요. 앞으로 이곳만 애용할것 같아요.','Y'),(10390,340,'시설 청결하고 체계적으로 구성됨\n원장님이 매우 친절하고\n의약외품 뿐 아니라 병원에서만 취급하는 간식들도잇어서 넘좋앗음','Y'),(10391,344,'까미가 포동껍대기를 삼키는 바람에 응급으로 왔는데 대처를 너무 잘해주신 덕분에 아주 똥꼬발랄하게 살아났어요.. 살려주셔서 감사합니다..ㅠㅠ 치료비때문에 사실 너무너무 걱정했는데 과잉진료없어서 다행이었어요. 앞으로도 여기 다닐게요..','Y'),(10392,344,'올해로 12살 맞이하는 울 강아지, 주인의 주의부족으로 종양을 크게 키워왔습니다. 뒤늦게서야 부랴부랴 수술을 해주려고 찾아간 효창동물병원입니다.\n\n효창동물병원의 이기업 수의사님께서 우리 강아지의 상태를 진단하시자마자 바로 수술이 필요하다고 빠른 판단을 내려주셨고\n기도하는 마음으로 정성으로 수술대에 올라가시어\n예상보다 많고 깊게 자라 있는 종양을 제거해주셨고, 수술비를 저렴하게 책정 해 주셨고, 9만원 하는 항생제를 그냥 맞춰주시고 가지고 계신 소독약도 ','Y'),(10393,344,'의사선생님이  친절하세요\n동물들도  사랑하시구요 ~~~~','Y'),(10394,344,'원장님 실력있고 친절해요 ~~','Y'),(10395,344,'원장님의 동물사랑이 진짜 진짜 느껴집니다!!!','Y'),(10396,347,'28년전부터 다니던 당골병원입니다. 원장님께서 정직하시고 아주좋은곳이예요. 제가 서울을 벗어나서 살지만 찾아다는곳입니다^^','N'),(10397,347,'친절하고 깔끔합니다.. 분위기가 조금 산만한 듯해요','Y'),(10398,347,'친절하고 자세한 안내 감사합니다!','Y'),(10399,347,'울 아이들 단골병원~','Y'),(10400,347,'원장샘  친절해용.','N'),(10401,349,'토끼 키우는 사람들의 성지입니다\n이곳의 선생님은 토끼명의 이십니다\n이시대 토끼집사들의 희망...\n항상 감사하며 다니고 있습니다..\n좀 혼내시는 편이지만 그건 우리가 못해서입니다... 반성합시다..','Y'),(10402,349,'원장님께서 너무 친절하세요. 저는 고양이 때문에 가는데.. 고양이 진료도 잘해주세요.','Y'),(10403,349,'수의사쌤이 썩 친절하신편은 아니시지만, 그래도 고양이를 너무나 사랑하시는 분이시라, 정성껏 진료해 주십니다.\n믿고 진료 맡길 수 있어요','Y'),(10404,349,'친절하신 원장선생님입니다 10년 넘게 다른곳을 못가고 힝상 차오름만 가기 있습니다 토끼를 너무 잘 보는 동물병원입니다','Y'),(10405,349,'믿고 진료받습니다. 집 근처 병원으로 옮겨볼까 생각해 봤지만 이원장님 만큼 믿음이 갈까 의문이라 못 옮기겠네요.','Y'),(10406,362,'오래전부터 다니던 동물병원 원장님이 친절하시니 직원분 모두 너무 친절하고 자상하십니다 믿고 다니셔도 좋습니다 반려동물과 함께 사시는분들은 꼭 알아놓으셔야할 오렌지 동뭉병원 입니다','Y'),(10407,362,'5년째 다니고 있는 병원이자 애견미용샵~ 늘 친절하시고 좋아요!','Y'),(10408,362,'늦게까지 하고 선생님들이 친절하셔서 좋아요. 그런데 많은 강아지가 호텔에 있다보니 시끄럽기도 했어요.','Y'),(10409,362,'항상다니는 단골병원, 가격과 진료가 합리적이에요. 과잉진료없고, 의사선생님이 너무 친절해요!','Y'),(10410,362,'원장님께서 일단 실력이 있구요~ 치과엑스레이도 있을만큼 진단장비도 충분해서 신뢰가 갑니다~~','Y'),(10411,365,'제가 앵무새를 돌보는데 다녀본 동물병원중에 가장 만족스러운곳입니다 과잉진료비도없고 예약제라 많이 기다리지도않고 의사님도 실력있으시고...','Y'),(10412,365,'앵무새 치료 가능한 동물병원들 많이 다녀봤지만 이 만한 곳이 없었습니다. 수의사 선생님께서 정말 친절하시고 무엇보다도 과잉진료가 없으십니다. 믿고 갈 수 있는 동물병원을 찾아서 좋네요. 감사합니다:)','Y'),(10413,365,'도치가 아파서 특수동물 병원을 알아봤더니 여기를 추천해주더군요. 샘이 에버랜드에서 근무도 하셨고 도치를 진료할 때 상태를 꼼꼼히 챙겨주시고 설명도 잘 해주셔서 감사합니다. 초음파 검사도 할 수 있어 정확한 원인 파악도 할 수 있었어요.진료비도 비싸지 않고 합리적인 것 같아요.\n저희 도치는 피부 종양인거 같다는데 치료가 잘 되기를 바랍니다.','Y'),(10414,365,'우리 앵무새들이 못배워먹어서 원장님의 머리끄댕이를 붙잡고 난리펴도 얼굴 색깔 하나 안변하시고 평화롭게 진료를 봐주셔서 감사합니다. 한국에 특수 동물를 보는 곳이 많지 않은데 가뭄에 단비 같은 곳','N'),(10415,365,'친절 애견을 먼저 생각하느\n동물병원','Y'),(10416,367,'정말 좋은 곳이에요. 난 정말 좋아! 그곳에는 두 명의 스타, 제이홉과 정국이 살고 있습니다. 나는 항상 당신 옆에 있고 당신을 지원할 것입니다. 영원히 영원히 방탄소년단. 인도에서 온 사랑.🧡🤍💚💜💜💜','Y'),(10417,367,'말이 필요 없습니다\n연예인 하우스에 펜트는 주변 갤러리아 포레랑 대림 아크로와 같이 쌍벽을 이룹니다.. 다만 한강뷰는 원톱이구요\n보안시설부터 자체 호텔 조식 서비스까지 말이 필요없는 곳입니다 말 보다는 돈이 먼저죠 ㅎㅎ 우리나라 길고 나는 수입차 여기가면 많이 봅니다','Y'),(10418,367,'나의 최종 목표 이걸 위해 22살때부터 주식을 공부했고 쌩초보자 수준이였던 과거와 달리 26살인 지금은 나름대로 고수가 된거 같다 그때까지 기다려줘 꼭 가고야 만다','Y'),(10419,367,'적절한 원형구조의 모던함이 별미. 90년대엔 한남동등 한강 부촌이였다면 현대에 와선 자양 가까운 쪽의 안락함을 선사해주는 최고. -디자인 담당 킴정음 슈르 박사 돈벌이 : 졸부 딴따라 포섭','Y'),(10420,367,'전국에서 전망으로 치면 탑3엔 무조건 든다고 생각합니다.','Y'),(10421,379,'길에서  밥도못먹고 형편없든아기를 구조해서 캣맘언니의 소개로 조은병원에 갔는데요\n원장선생님과 간호사선생님들이. 너무잘 치료해주시고 보살펴주셔. 노랑이가 이렇게밥도 잘먹고 이쁘졌습니다💕💕💕','Y'),(10422,379,'서울에있을때 큰강아지 중성화 했는데 너무 친절하게 섬세하게 수술을 잘해주셨어요  남양주로 이사와서 작은 강아지도 중성화수술을 하러 다시 찾아갔는데 5년지난 지금도 변함이없이 친절하셨어요','Y'),(10423,379,'갑작스런 배변장애로 장안동 큰병원에서 처방받고 3일간 약먹어도 차도가 없어 온종일 배변패드에서 힘쓰다보니 발바닥 젤리가 터져 핏방울 천지가되었어요...가까운 조은동물병원에 전화드리니 퇴근시간 넘도록 기다려주시고 발바닥치료에 약과 처방식을 바꿔주셨는데 바로 효과가 나타났어요 빠르게 회복되는거보며 연륜있으신 병원장님신뢰가 갑니다 늦은시간까지 세세하게 친절히 상담해주시고 간호사쌤도 편안하게 대해주시고 넘감사했어요 울 멍양14살에 병원장님 잘만나 끔찍한 고통해','Y'),(10424,379,'저희집 애견도 여기서진료받는만큼.\n수의사 분께서 친절하며 상세히 설명 잘해주십니다','Y'),(10425,379,'친절한수의사선생님의 도움 덕분에 아이 응급한상황에 많은도움이 되었습니다','Y'),(10426,382,'친절하시고 과잉진료도 없고 냥이도 잘보세요\n매우 추천합니다','Y'),(10427,382,'원장님 넘 친절하심여ㅠㅜ 갈때마다 감동받고 옵니다','Y'),(10428,382,'모두 다 친절하시고\n과잉진료도 안하시고\n너무 좋아요!\n여러군데 가봤지만 여기가\n정말 찐입니다!!!!','Y'),(10429,382,'최고','Y'),(10431,383,'공부많이하시는 실력파 선생님이 개업하셨다 추천 받아멀리서 왔는데 그럴 가치가 있었다. 전문적인 검사(과잉없음)와 처방. 18세 고양이 기르는데 관리에 대해서도 조언주시고 쓸데없는 보조제는 권하지 않으심. 작지만 깔끔하고 시설도 정말 좋은편이다.','Y'),(10432,383,'진짜 좋은 선생님이세요. 시설 깨끗하고 간호사선생님들 매우 친절하세요! 저희는 병원이 아니라 원장선생님따라 개업하시자마자 오늘동물병원으로 옮겨 강아지 돌봐왔습니다.\n\n쿠싱때매 고생하던 저희 강아지 선생님이 진료하고 나서 4년을 더 살고 갔어요 :) 루이 떠나는 날 같이 슬퍼해주시는 모습에 저희도 너무 감사했습니다.\n\n과잉진료 아니고 항상 친절하고 자세하게 설명해주세요. 서울에서 유명하다는 병원 많이 다녔지만, 정착한 곳은 오늘동물병원입니다.','Y'),(10433,383,'1. 발 만지기만해도 파닥거리던 우리 고양이. 접수하는 짧은 사이에 발톱이 전부 깎여나가는 경이로운 광경을 보며 간호사님 전문스킬에 1감탄.\n2. 다른 동물병원들 방문했을때마다 저 안쪽에서 알수없는 살벌한 비명소리가 들려서 무슨 일이 벌어지고 있는건지 궁금했었는데, 이 병원은 모니터로 실시간 모니터링 가능해서 2감탄+신기방기.\n3. 미용하러 온 어떤 강아지 신나서 선생님한테 앵기는거 보며 3감탄\n4. 선생님이 우리 부부 앉혀두고 진료내용 이상으로 우리 ','Y'),(10434,383,'2022년에 21살된 강아지가 많이아파서 조카의 소개로 \"오늘동물병원\" 을 방문했는데 기존병원 선생님과는 너무 달랐습니다\n과잉진료 없을뿐만 아니라 저희강아지가 그때 너무 아파서 혈관주사을 많이맞아서혈관이 나오지 않는강아지를 다른병원은 말못하는동물을그저 돈벌이 라고 생각했는지 마구꽃아서 혈관이 안나오는데\n윤선생님 은 혈관이안나온다고 배려해주었고\n이뿐만 아니고 윤선생님같은 동물병원 선생님들이\n더 많다면 얼마나좋을까요.\n그리고 다른병원 (( TV 에  나오는','N'),(10435,383,'원장선생님 진심으로 차분, 다정하심. 고양이에 대해 풍부한 학문적 지식을 바탕으로 엄청 꼼꼼하고 자세하게 설명해주시는데 과잉진료도 없어 정말 만족헸습니다.','Y'),(10436,397,'아담한 병원이지만 의사 선생님의 친절과 솔직한 의료 서비스에 감사 드립니다.','Y'),(10437,397,'확실히 잔소리는 심하시지만 거짓말을 안하고 과잉진료 안함 특히 미용할때 멍멍이가 그나마 안싫어하는곳이 여기임','Y'),(10440,400,'자세한 설명과 예상 진료비를 알려주므로 대처할수있어 선택에 효과적입니다.','Y'),(10441,400,'저희 양이들 단골 동물병원이에요 고양이를 아끼다 못해서 엄마잃은 길냥이도 보호해주는곳','Y'),(10442,400,'정말 친절한 동물병원~!!\n감동입니다~^^','Y'),(10443,400,'친절하고 정확한 진료','Y'),(10444,400,'안심하고 이용중','Y'),(10445,403,'냥이 중성화수술을 했는데 의쌤과 간호사님 다들 친절하고 특히 감사할일은 중성화수술 흔적이 거의 안보여요 깜쪽같이 수술해주신 여원장님께 감사드립니다','Y'),(10446,403,'우리 렐라 중성화수술을 했는데 원장님과 간호사님들 너무 친절하시고 상처가 엄청 작아 하루만에 날아다닙니다\n원장님 수술 이쁘게 해주셔서 감사해요','Y'),(10447,403,'친절하고 전문적이에요','Y'),(10448,403,'2주에 한번씩 예방접종 맞히러 가는데, 설명두 잘 해주시고 아가 검진도 최대한 애들한테 스트레스 안가게 정성껏 봐주시는것 같아요!\n목욕이나 미용은 받은적 없지만..\n일주일 내내 오픈해두는 병원이라 믿음직스럽습니다.','Y'),(10449,403,'집앞에 있어 걸어서도 다니고 있어요. 선생님들이 친절하여 다른 곳을 가지도 않아요~쉬는 날이 없어서 주말에도 냥이들이 아프면 바로 진료를 받을 수 있어서 정말 좋습니다!','Y'),(10450,405,'친절하세요\n과잉진료없으시고 가격 눈탱이도없어요\n상주고양이들도 있어요\n길냥이 중성화사업지원 병원이네요','Y'),(10453,421,'원장님께서 친절하시구 어디가 아프고 왜 아픈지, 어떻게 해야 하는지 명쾌하게 잘 알려주셔서 꾸준히 다니고 있어요. 원장님이 세미나, 수술 등 일정으로 안 계실 때가 있으니 미리 전화해보시구 가는걸 추천합니다','Y'),(10454,437,'질문에 차근차근 설명해주시는 선생님이세요. 유기견을 입양하셨고 아이를 꼼꼼히 살펴주세요. 과잉진료하지 않으시고 접종하러가면 기본관리로 발톱도 깎아주고 항문낭도 봐주시고 귀도 소독해줘요.\n아쉬운건 하나 주차공간이 협소해요','Y'),(10455,437,'선생님의 진정성이 느껴졌어요.아이를 사랑으로 진료하시더라구요.ㅌㄴ동물병원보다 진료비도 싸고 비치해놓은 사료도 많이 싸고 ㅌㄴ은 바이입니다. 시진을 연예인들 사인 해놓은것밖에 못찍었어요','Y'),(10456,437,'저희강아지 애기때 우연히 검색해서 다니게된 첫병원인데요 요즘 입소문이났는지 원장님 진료받으려면 대기시간이 길어져서 좀 아쉽지만ㅜㅜ 원장선생님 진짜친절하시고 동물을 진짜 사랑하시는 마음이 느껴진다고해야할까 제가초보견주라 궁금한거 갈때마다 질문을하면  항상 1가지 질문에 10가지씩답변주세요ㅜㅜ 너무도움많이되고 여기밖에 안가봐서 병원이 어떤지 좀 검색해보면 진료비 거품없어 좋다고하시더라구요 암튼 전 너무만족해서 이사가서도 다닐려고하고 생각중이에요ㅋㅋ','Y'),(10457,437,'간호사님도 친절하시구 무엇보다 의사선생님이 진심으로 생명을  존중해서 진료하시는것보구 ㅂ감동받았어요 진료비도 과잉진료가없어서 저렴해서 조았어요','Y'),(10458,437,'오늘 처음 가봐서 치료를 잘 하는지는 아직 모르구요, 한시간정도 기다렸다 진료봤는데 의사샘도 직원들도 모두 친절하고 좋았어요','Y'),(10459,439,'내 아기 둘이 이곳을 통해 무지개다리 건넜어요\n원장선생님께서 융통성있게 친절하십니다\n보통 장 자 붙은 분들과 아주 다르세요\n그리고 아이들을 치료하는 시설이 따로 있어요\n물과 함께 놀이를 하며 치료하는 곳인데 그냥보면 강아지들을 위한 목욕탕(??) 또는 찜질방 같은 곳이에요\n그리고큰 강아지들을 목욕시키는 시설이 따로 있어요','N'),(10460,439,'강아지 눈물이 워낙 많이나서 누관시술했는데 누관시술하고나니 눈물이 덜 나오네요 근데 비용이 만만찮게 드네요;;뭐든 다 비용 계산되서 나오니 역시 동물병원이라 병원비가 비싸긴하네요','N'),(10461,439,'방광 결석 수술 80만원대라고 다른 병원에 물어본 금액보다 수용가능한 선이라 여기서 결정하고 검사 했더니 말이 달라짐.\n12살 노견 강아지 건강 생각하면 이런저런 검사 추가로 더 해야 한다며 계속 안정성, 건강 들먹이면서 검사 추가로 권함.\n그로인해 현재 거의 150만 넘게 들은듯.\n이미 검사하고 수술까지 한 후라 다른 곳으로 옮길 수 없어 울며 겨자먹기로 다니고 있는데 후회 막심.\n방광에 카테터(오줌 줄)도 달고 있는데 일주일이면 된다면서 매일 소독,','Y'),(10462,439,'기본접종 받으러 가도 뭔가 추가되는게 많음.챙겨주시는 건지 덮어쓰는 건지 헷갈리는데 추가되는 것에 대한 금액에 사전고지가 없어 덮어 쓰는 느낌이  있음, 그래도 친절하심.','N'),(10463,439,'간단한수술정도를할수있는동물병원입니다\n강아지가열살이넘어가니가끔갈일이생기네요','Y'),(10464,452,'의사샘 왕친절하시고 쉽고 꼼꼼하게 설명 잘해주세요~~\n개인적으로 거기 상주하는 피버라는 까망고양이 궁디팡팡해주면 아옹아옹 하는거 진짜 치명적매력입니다.\n전 여기 강추.냥이 두마리 다 여기 다녀요.','Y'),(10465,452,'여기 미용사 미용 못합니다 다신 안갑니다아이털을 엉망 해놓고선 사과도 없고 여러군대 다녀봤지만 여기처럼 쓰레기 같은곳은 처음 봅니다.','N'),(10466,452,'할많하않. 제대로 처치 못받고와서 반 죽어가 다른 병원으로 급하게 감. 돈은 돈대로 씀…','N'),(10467,452,'다른동네 사는데 굳이 굳이 여기까지 와서 애기 진료받는데는 다 이유가있음. 일하시는 간호사님 의사님들 다 진국이에요','N'),(10469,466,'구조가 너무 좋고 주방 펜트리 현관 펜트리 등 수납 공간이 좋네요. 드레스룸도 매우 넖어요.\n판상형이라 통풍도 잘 되네요.\n지하에 세대 창고도 있어요','Y'),(10470,466,'아직은 대중교통이 불편하지만 향후 10년 뒤에는 많이 변하겠죠?','Y'),(10471,466,'살기좋은 아파트!\n주차장 간격 넓어요\n주변 산책로 잘 되어 있어요\n층간 소음도 없어요','Y'),(10472,466,'위례 광장과 이어져있는 넓은 장소가 있어서 운동하고 산책하기 좋은곳','Y'),(10473,466,'상가도 나름 괜찮아요 주차 공간이 좀 적은게 단점','Y'),(10474,468,'원장님 양심적이시고 불필요한 검사안하고 병원비 저렴하고 치료 잘해주신다','Y'),(10475,468,'선생님 상냥함','Y'),(10476,468,'명의!','N'),(10479,472,'단풍 설경 맛집 동간 거리가 넓어 개방감이 좋아요.','Y'),(10480,472,'교통좋고 시장가깝고 건물튼튼하고 북한산 삼각산 인수봉이 한눈에 보이는 경관 좋은곳','Y'),(10481,472,'굿','Y'),(10484,474,'공기맑고 바람신선하고,올드타운쪽 시장물가가 목동보다 30퍼센트이상 싸고 음식맛은 미원맛 안나요.30분이내 걸어서 북한산둘레길과 북한산 등산길 갈슨있어요.','Y'),(10485,474,'경비실의 직원분들이\n무척 친절하셔서\n배송일을 항상 깔끔하고\n잘하게됩니다\n감사합니다','Y'),(10486,474,'교통 쇼핑 산책로 주변 환경 모든 것이 만족스러움','Y'),(10487,474,'큰도로가에 비교적 편리한 주거지역','Y'),(10488,474,'정원이 멋있어요','Y'),(10489,475,'8년째 단골.원장님 차분하게 설명 잘해주시고,진료잘하시고,진료비 일관되서 신뢰감','Y'),(10490,475,'친절하고 동물을 좋아하시는게 느껴집니다 링웜도 여기서 치로했습니다~~^^','Y'),(10491,475,'강아지 이발하는 여자분 나쁨,불친절,','N'),(10492,475,'좋와요','Y'),(10493,475,'불친절함','N'),(10494,484,'미아뉴타운 래미안트리베라1차아파트, 자연친화적인 숲세권아파트, 살기 좋습니다. 단지 조경과 산책로가 잘되있습니다.','Y'),(10495,484,'몇달전까지 트리베라1단지의 비즈니스 소유가 화목부동산으로 무단 점유 기재되어 있어 화목부동산과 구글측에 수정을 요구했고 구글측에서 수정한건지 화목부동산에서 수정한건지 알 수 없으나 현재는 트리베라 1차 관리실로 정상 수정 되어있습니다\n\n—————————————————————-\n\n화목 부동산? 왜 아파트 단지가 일개 부동산중개업자의 업장으로 등록 되어 있는건가요?\n아주 이동네 부동산 업자들 하는짓이 가관일세\n\n단지는 훌륭하고 주거수준도 높아서 만족도는 대','N'),(10496,484,'좋은 아파트 입니다.\n거주자를 위한 커뮤니티가 잘 되어 있어요.','Y'),(10497,484,'매우 좋습니다.\n모든면에서 완전하고 우수한 작품입니다.\n삼성 래미안 트리베라 1차아파트와 정문 경비실 그리고 관리사무소와 시설관리자님 모두 감사드립니다~~~~*^^*\n고맙습니다!사랑합니다!🤷‍♂️','Y'),(10498,484,'길음에 이게 왜있지?(길음비하아님) 라고 생각되는 단지임\n비유하자면 대림동에 트라펠리스 있는느낌?(대림동비하 절대아님)\n놀러가봤는데 깨끗하고 살기 좋아보임','N'),(10499,489,'갈 때마다 한결같이 친절하시고 진료도 정말 꼼꼼히 봐주셔요. 집에서 좀 먼 거리이지만 매번 이곳으로 방문하는 이유입니다.','Y'),(10500,489,'우리 강쥐 주치의 병원.\n다른곳 보다 처치비,치료비,검사료 저렴 하며\n선생님 친절 하시고 보호자 주문 사항 잘 조합 해서 적절하게 처방 해 주십니다.','Y'),(10501,489,'네이버 평점보다 구글이 좋은거 보면 정말 좋은 1차병원 입니다 이런병원이 집앞에  있어 복받은거같습니다 항체검사를 제외하곤 매우저렴하고 양심적인 병원이고 보호자가 먼저 물어보기전까진 권하지 않습니다 소풍 떠나보낸뒤로 유기견 입양까지 많이 도와주고계십니다\nps mri는 없습니다! 수술 잘하십니다','Y'),(10502,489,'의사선생님께서\n꼼꼼히 신경써서 봐주심니다\n또 대기하는 동안에도 친절하\n게 대해주셔서 저의 아이랑\n편한 마음으로 방문할수있어\n좋아요^^','Y'),(10503,489,'1. 주차장 없어서 30분 헤맴\n2. 분명 강아지 정보 다 말했는데 의사가 다시 만들어야한다고 다시 말해줌\n3. 애기 피빼고 지혈 제대로 안해서 오는길에 피가 뚝뚝\n3. 약타는데 주사기 안줌, 약용샴푸도 의사가 준비해 준다고 했는데 안줘서 가던길 다시 돌아와서\n사감\n\n리뷰 좋아서 갔는데 기본조차 안되있음!','N'),(10504,491,'공기맑고 바람신선하고,올드타운쪽 시장물가가 목동보다 30퍼센트이상 싸고 음식맛은 미원맛 안나요.30분이내 걸어서 북한산둘레길과 북한산 등산길 갈슨있어요.','Y'),(10505,491,'경비실의 직원분들이\n무척 친절하셔서\n배송일을 항상 깔끔하고\n잘하게됩니다\n감사합니다','Y'),(10506,491,'교통 쇼핑 산책로 주변 환경 모든 것이 만족스러움','Y'),(10507,491,'큰도로가에 비교적 편리한 주거지역','Y'),(10508,491,'정원이 멋있어요','Y'),(10509,492,'아가들을 데리고 다니는 병원이예요.의사샘이 넘 친절하고.설명도 잘해주세요. ㅋㅋ 미용샘도 넘 좋아요.간호사언니도요. 가면 편안합니다','Y'),(10510,492,'의사선생님이 친절하시고 너무나 꼼꼼하게 봐주신\n덕분에 더욱더 신뢰감이 생겻고 병원이 크지 않아서\n가족같은 분위기여서 넘 좋았어요 진짜 의사선생님\n꼼꼼하십니다.. 완전 만족스럽고 병원비도 다른데에\n비해 정말 저렴합니다..','Y'),(10511,492,'마음.사랑맘입니다\n항상 환하게 반겨주신 원장님\n쓸게골수술 하는 동안 쉬는 날에도 나오셔서\n우리사랑이를 잘보살펴주시고 수술도 잘해주셔서 감사합니다','Y'),(10512,492,'원장님 친절하시고 우리 까미도 좋아하네요','Y'),(10513,492,'원장님 친절하시고요. 설명 꼼꼼히 잘해주시네요. 고양이 처음키워서 모르는것이 많은데 잘알려주시네요','Y'),(10514,501,'오늘 수술 안했으면 더이상 쪼코를 못볼뻔 했네요 친절하게 잘 알려주시고 빠른 수술에 감사드립니다.','Y'),(10515,501,'의사선생님 친절하고 과잉진료 안하세요.\n두 아이 수술받고 회복도 잘 했어요.','Y'),(10516,501,'건강했던 우리 아가 여기에서 진료받고 하루만에 하늘나라로 갔습니다. 혈변봐서 데려갔는데 검사 이것저것 해서 20만원 넘게 나왔어요. 혈당 수치 30으로 저혈당인데 입원하고 수액 맞히라해서 5시간 입원 시켰습니다. 집에 와서 바로 혈변 보고 경련이 있었는데 퇴원 때 설탕물 먹이라는 얘기만해서 그렇게만 했습니다.\n예후가 나쁘고 심각하다고 했다면, 바로 병원 다시 오라고 했다면 우리 아가 하늘나라 안갔을거예요. 6년 동안 한 번도 아픈 적 없던 아가라 안일했','N'),(10517,501,'고양이때문에 가는데 항상 갈때마다 느껴요~ 의사선생님께서 매우친절하시고 치료또한 잘해주십니다. 다른곳에비해 비용도 많이 저렴하구요~','Y'),(10518,501,'의사선생님 덕분에 저희 밥풀이가 완치되었습니다. 항상 감사합니다. 저렴한 가격과 신뢰도 있는 진료를 원하시는 분 강추합니다.','Y'),(10519,502,'다닌지 5년이상 된 곳입니다.\n궁금한 질문에 대해 다 설명해주셔서 좋아요.\n기록 차트로 아이의 상황을 잘 알 수 있고요.\n추천합니다~!','Y'),(10520,502,'고양이 피를 못뽑네요.\n3번 넘게 시도 다 실패\n그리고 한번도 안갔던 고양이로 만드네요?\n고양이가 헥헥  죽이는줄','N'),(10521,502,'간호사가 갈때마다 바뀌네요','Y'),(10522,502,'발치 수술 저렴하고 잘 해주심','Y'),(10523,502,'최고','Y'),(10524,363,'상담잘해줌....생각보다..괝만앗음','N'),(10527,506,'의사 분이 친절하고 수술하는 장면도 유리창으로 다 지켜볼 수 있음\n주차장이 건물 뒷 편에 있긴 한데 좀 작은 게 흠','Y'),(10528,506,'의사 선생님 간호사 선생님들 모두 모두 너무 친절하시고 진료비 투명해서 좋아요♡','Y'),(10529,506,'고양이 이빨 거의 다 뺐어요 의사선생님 엄청 친절하세요!','Y'),(10530,506,'애견 치과전문병원\n오늘 울레옹이 발치중입니다','Y'),(10531,506,'여기 여자 원장님 엄청친절하고 진료잘보십니다','Y'),(10532,512,'제대로 검진 하시지도 않고 피부병이라고 주사 맞추고 안 맞는 약 처방하셔서 계속 토하고 결국 다른 병원 갔습니다. 다른 병원에서 검진 받아보니까 피부병 아니라고 하더군요. 약 끊고 멀쩡합니다.','N'),(10533,512,'진짜ᆢ친절하시고\n마음이따뜻하셔요\n동물을진심으로\n많이사랑하십니다. 유기묘ㆍ유기견도\n돌봐주시고 보살피십니다\n제경우도 유기견 유기묘를길러서\n여기로병원을옮겼습니다','Y'),(10534,512,'친절하신데 애가 잘 낫지않아 걱정이네요','Y'),(10535,512,'오진 심합니다. 의사가 어떻게 됐을지 의문이 들 정도입니다.','N'),(10536,512,'진료도 잘하고, 선생님하고  직원도 친절해요','Y'),(10537,518,'진료예약하기와 많이 기다려야한다는게 조금 불편하지만\n한결같이 친절하고 꼼꼼히봐주시고 설명해주시는 원장님때문에 또찾게됩니다 그리고 다른동물병원보다 거품없는 진료비가 늘미음을편안하게 합니다','Y'),(10538,518,'화랑 동물병원 원장님 너무 꼼꼼하게 잘 봐주시고 치료만 해 주시는게 아니고  발톱 부터 강아지 입주위 등 털도 깨끗하게 깍아 주시니까 너무 좋아요 우리 강아지 9년째  다니고 있는데 원장님도 친절하시고 동물들에 대한 사랑이 넘치시는 분이라 생각합니다~~~','Y'),(10539,518,'항상다니는울 아가병원이지요  울원장님항상친절하시며꼼꼼하게봐주시고 실장님도 무던하시게 미용잘해주시고..흠잡을거라면음...환자가많아예약하기 넘힘들어용\'\'\'\'\'\'\' 구래도  부지런히예약하며...울강쥐잘챙기고있지요^^','Y'),(10540,518,'의사선생님이 정말 친절하십니다. 남들 같으면 귀찮아할 만한 상담도 친절하게 응해 주시고 전문성도 확실합니다. 가족을 믿고 맡길 수 있습니다.','Y'),(10541,518,'원장님 아주 친절하십니다.경험도 풍부하시고 꼼꼼하시고 대형 병원에서 강아지 발 치료해서 드레싱 받으러 갔는데 훨씬 더 꼼꼼하셨고  전문적이셨습니다','Y'),(10542,525,'초등학교때부터 다니던 곳이에요~ 벌써 20년 다되어가네요~~ 주사를 너무 감쪽같이 놔주심!!!','N'),(10544,533,'일층에 명품한우정육점, 늘솜베이커리, 기쁨약국,\n세컨페이스 안경원 요렇게 있고요.\n나머지는 사진으로^^ 그리고 저희 안경원 광고는 애교😆','N'),(10545,533,'미용실이 아주 마음에 듭니다~~~','Y'),(10546,533,'향후 멋지고 편리하게 변화되는게 기대됩니다.','Y'),(10547,538,'미용하시는여성분이 예의가없으신거같네요','Y'),(10548,538,'선생님 찬절하시고 좋아요','Y'),(10549,538,'가까워서 다니고있어요','N'),(10552,541,'반려견 견주 입장에서 지금까지 본 동물병원중 원탑.\n반려견마다의  습성, 특징,주의해야할것등을 매우 친절하고 상세하게 알려주심.\n무엇보다 수의사 선생님의 진찰 치료 능럭?이 여타 동물병원과 비교가 안됨.\n그리고 비용이 정말 합리적임.\n최근 멀지않은 병원에서 수술비용으로 40만정도 안내.\n여기는 12만원.\n끝.\n2024.02\n10년이 넘도록 이동네 아파트단지에서는 지금도 건재.\n오늘 우리 뚱이 수술 들어갔네요.','Y'),(10553,541,'울집 멍뭉이 많이 아프면 꼭 갑니다. 가성비는 보통인데 치료는 잘 해줍니다. 원장님 두분?은 참 인간적 이시고 이래되서인지 깔끔하진 않습니다. 잴 중요한건 아기들의 건강이죠. 잘 나아요~','N'),(10554,541,'지방에 사는데 시댁에서 키우던 반려견을 데려와 심상사상충 진료받고 지금은 완치된상태이고 선생남들께서 너무도 친절히 해주셔서 믿고 맡겼네요','Y'),(10555,541,'그냥 서울 사는데 애견 수술이 필요하면 여기저기 전화말고 스머프로 가자! 우리 강아지는 6개월 사이에 결석수술, 자궁축농증수술 했는데 오늘 퇴근했더니 장난감 물어옴\n\n여기 진짜 명의심!!','N'),(10556,541,'과잉진료 없이 믿을 수 있는 동물병원 찾는 게 얼마나 행운인지 견주 분들이라면 다들 공감하시겠죠.. 원장님, 대표님 두 분 모두 진심으로 동물을 아껴 주시고 사랑해 주시는 분들이세요. 동네에 다른 병원도 가보면서, 스머프가 과잉진료 없는 곳이란 걸 제가 스스로 깨달았고, 그렇기에 원장님이 권하는 치료는 믿고 맡길 수 있는 곳입니다. 평생 리뷰라는 거 안 써 본 저인데, 제가 처음으로 키우는 강아지가 아파보고, 원장님 만나 치료 잘 받고 나아지는 걸 보니','Y'),(10557,542,'병원규모는 작지만 원장님 신뢰가 갑니다.\n과잉진료 없고 설명도 상세히 해주는 곳입니다. 댕댕이가 갑자기 발을다쳐 근처 동물병원 검사만 실컷 받고 돈만 버리고 다니다 낫지않아서 병원을 바꿨는데 다루에서 수술하고 건강해졌어요. 앞으로도 주욱 이용하고 싶은 곳이예요.','N'),(10558,542,'십자인대+슬개골수술 잘됐어요\n간호사선생님 친절하시고\n원장선생님은 침착한 베테랑느낌\n입원중에 사진 더 많이보내주시면 더좋을거같아용','Y'),(10559,542,'친절히봐주세요','Y'),(10560,542,'고양이 있음^^','N'),(10562,545,'강아지 간식사러 가끔 가는곳인데 그날두 간식사러 갔다가 고양이 귀여워서 만지구 있으니까 원장님이 여기 고양이 보러오는데 아니라 그라서 마상당하고 집감 ㅠ','Y'),(10563,545,'늘 친절하게 진료 봐 주셔서 잘 다니고 있습니다','Y'),(10565,549,'그냥 그래 오랴 됐오','N'),(10566,549,'👍','N'),(10568,556,'아들이 살고있어 가끔 가는데\n아들이 매우 편하고 만족하다네요','Y'),(10569,560,'조류전문진료','Y'),(10570,563,'우리 강아지 여기 맡기고 다른 병원보다 조금 싸서 다행이다 생각했어요. 얼굴 쪽을 마취하고 이를 빼는 수술이였는데, 몇개월 후 마비가 왔고... 반 년 후에 죽었어요. 워낙 민감한 부위의 수술이였는데 잘 안 된 것 같아요. 아직까지도 이 병원에 온 걸 후회합니다. 동네병원은 추천하지 않아요. 실력을 믿을 수 없어요.','N'),(10571,563,'윈장선생님이 매우 친절하시네요.','Y'),(10572,563,'의사선생님 친절하구 좋아요','Y'),(10573,563,'친절하고 좋아요','Y'),(10574,563,'친절해여','N'),(10575,567,'원장님이 친절하시구 강아지도 원장님을 좋아하네요!\n완전 만족!!!\n다음에 또 찾아뵐게요!','Y'),(10579,231,'12년째 이용중입니다. 의술을 강요하며 죄책감을 주는 병원이 아니라 반려동물과 보호자를 위주로 처치를 해 주세요.\n(검사를 종용하지않고 보호자와 상의하며 검사와 치료를 진행합니다. )','Y'),(10580,231,'근처 살 때 늘 다녔던 병원인데, 불광역 근처로 이사오고 나서 인근 병원 가봤더니....여러가지로 정이 안붙더라구요.\n\n결국 아이 아플 때마다 택시비 내가면서 가는 병원인데도\n너무 신뢰가고 원장님부터 시작해서 모든 의료진들이 신뢰가 가요. 이런 병원이 있어서 애들 아플 때도 망설이지 않을 수 있어서 감사합니다. 근처로 다시 이사가고 싶어요.^^','Y'),(10581,231,'이곳에서 여묘, 10년 중성화 수술 하고 지금도 거리가 멀어도 다른곳 못가고 이곳 원장샘에게 진료보러 갑니다. 설명도 차분하게 잘 해주시고 같은 증상으로 재방문하니 초음파 다시 봐주시곤 비용청구 없었습니다. 조제약 진단서도 메일로 보내주셔서 근처 진심 고마운 병원이예요.','Y'),(10582,231,'의사선생님의  친절한 진료와 과잉 진료를  하지 않아 지인 강력 추천 입니다','Y'),(10583,231,'수의사 선생님들이 보호자가 알아들을 수 있도록 쉽고 차근차근 설명해주시고 중성화 수술비 등 가격도 합리적이며 믿을만한 검사와 치료를 제안해주십니다~(돈 벌려고 더 추가시키는 듯한 느낌 없습니다) 특히 원장선생님에 대한 신뢰가 큰 병원입니다. 진료는 다 만족스러우나 수술 외 진료예약은 받지 않아 대기시간이 길 수 있고(사람이 많아요) 병원이 작은 편이고 주차공간이 없어 아쉽습니다~ 그래도 그런 불편을 감수하고 늘 이 병원으로 가고 있습니다 :)','Y'),(10584,572,'친절하고 좋은 병원이에요.\n우리땅콩이 가는날 잘 봐주시고 보내주셨어요.','Y'),(10585,572,'미용하러갔다 갑자기 쇼크와 숨을 못쉬고 축 늘어진 아이 급하게 달려간  피움병원 원장님 처치하에 울  사랑이 살았습니다 기저질환이 있는지모르고 있었어요~~~원장님 정말감사합니다','Y'),(10586,572,'가격 합리적이고 수의사쌤 설명이 매우 디테일 하셔서 좋습니다.','Y'),(10587,572,'간단한 진료였음에도 너무 친절히 안내해주시고 치료해주셨어요^^','Y'),(10588,572,'24시간병원은 아니지만 마감시간  임박해서 급히 방문했는데 꼼꼼히 진료해 주셔서 다행이었습니다','Y'),(10589,573,'7살 먹은 강아지 종양 (양성)과 조직혹이 생겨서 방문했습니다. 은평구로 이사 오기 전부터 가던 데라 믿고 갔고, 간단한 제거 수술이지만 잘 받고 왔습니다. 과잉 진료 안 하시고, 견주들한테 쓸데없는 공포성 발언을 자제하십니다. 무엇보다 원장님께서 동물을 사랑하시는 게 느껴집니다. 수술 받고 나와서 강아지가 잘 노는 것을 보니 집에서 좀 멀지만 잘 갔다 온 것 같습니다. 은평구, 마포구 사시는 분들께 강추하는 동물병원입니다. 주차는 병원 앞에 할 수 있','Y'),(10590,574,'입점 브랜드들이 너무 구림. 지하 롯데마트는 깔끔하고 잘 되어있고 식당가에 빕스가 있습니다. 그치만 전체적으로 정말 살 것도 볼 것도 없다고 느꼈어요.','N'),(10591,574,'주중에 2만원만 소비하면 하루종일 주차 무료!!\n깨끗하고 한적해서 주중 오전시간을 활용해 종종 갑니다. 은평롯데몰 시설부터 주차까지 최상예요.\n\n2층에 스파오 spao 매장 관련 정보가 없어서\n사진 몇장 올려봅니다. 중학생 딸이 종종 가는 곳예요.','Y'),(10592,574,'깔끔한 매장이고 음식은 종류마다 맛이 좀 편차가 있는 듯 해요. 우육탕면은 간장맛이 진해서 취향에 좀 안맞고 탄탄면은 고소하고 국물도 진해요.','Y'),(10593,574,'여러가지 쇼핑시설과 음식점 카페가 있고 지하철 연결통로도 있어서 교통편의성이 좋다','Y'),(10594,574,'주차장을 이용하기 위해 방문\n화장실 이용이 불편했음\n주차장 이용시간과 화장실 이용시간을 동일하게 하면 좋을텐데…','Y'),(10595,583,'소동물 진료하는 동물병원이 많지 않아 그나마 가까운 곳으로 검색하여 처음 방문하였다. 가는데 한시간 남짓 걸리고, 예약을 따로 받지 않아 현장에서 접수하기 때문에 대기시간도 있는 편이지만 원장님이 친절해서 다 상쇄된다. 다음에도 조금이라도 이상이 있어 보이면 여길 방문할 것이다. 다만 개선할 점이 있다면 (1) 대기석이 협소하여 4인정도가 기다리면 만석이었다. 카운터 앞에 서있는 것 보다는 차라리 얇고 긴 의자를 2열로 놓으면 어떨지 or 동네에 카페도','N'),(10596,583,'친절한 선생님들 꼼꼼하고 자세한 진료. 소동물 진료가능해서 기니피그 데리고 갔어요. 주차장이 없어서 아쉽지만 소동물진료로 추천합니다.','Y'),(10597,583,'병원 자체가 아담해서 손님이 셋 이상 대기실에 있으면 북적거려요. 그래도 원장님이 잘 봐주시고 친절하셔서 도마뱀 진료볼 때 방문해요. 딱히 과잉진료도 없으시고 가격도 합리적인편입니다. 햄스터나 토끼 고슴도치 친칠라 등 다소 특수한 동물들이 많이 오고가요.','Y'),(10598,583,'선생님 넘넘 친절하시고 한시도 가만히 있지 않던 우리 햄스터 넘 꼼꼼하고 차분하게 잘 봐주셨습니다. 제 손에선 그리 발버둥 치던 애가 어쩜 그리 가만히 있는지... 감사합니다','Y'),(10599,583,'예약은 안되지만 특수동물 진료보기 가장 좋은것같아요! 급하게 가봐야할땐 예약이 안되는곳이 많았는데 여긴 그런거없어 좋아용\n진료비도 타병원들에 비해서 가성비도 좋습니다!','Y'),(10600,588,'사전에 자세한 설명도 없고 검사 후에도 해당 사항에 대한 결과만 통지했음 전문가도 아닌 사람 상대로 당연하다는듯이 불성실하게 답변함 다른 병원은 어떤검사가 필요한지 결과에 대한 예후라든지 납득가게 설명을 잘 해주던데..\n\n+)답변 보고 덧붙입니다.\n\n진료비 분쟁때문이라고 말씀하시는데, 검사의 필요이유와 항목을 납득되게 설명 하시면 문제될 일이 없겠죠. 사람들이 동물병원에 대해 과잉진료 있다고 하는건 그런 설명도 없이 추진하려고 하는 병원을 얘기하는것 아','N'),(10601,588,'전문적인 선생님의 치료, 특히 피부과 치료로 도움이 많이 됐습니다 서울대 동물병원에서도 모르겠다고 한 울 강아지 피부병 고쳐주신 선생님 감사해요','Y'),(10602,588,'왤케리뷰가안좋은지모르겠는;;\n전 토순이엄만데 몇단전에 갔을땐 토끼 발톱도 서비스로깍아주소 예방주사도 잘놔주시던데요;;오늘이나 낼 또 예방접종맞으러 갈건데 갔다와서 또 후기남길게여','Y'),(10603,588,'검사결과도 안알려주고 챠트도바뀌고 심지어 우리강아지 그 병원서 홍역도 옮았어요. 이런 쓰레기같은 일은 처음 당합니다','N'),(10604,588,'과잉진료가 좀 있는거 같은데 직원들 친절하고 토끼 하늘이 귀여움','Y'),(10605,589,'전반적으로 다 좋습니다 특히 진료를 잘 봐주시고요~ 신촌, 이대, 아현동에 여러 동물 병원을 다녀봤는데 여기 방문 후 다른 곳 안 갑니다.','Y'),(10606,589,'엄청 친절하시고 진료 설명도 잘해주세요! 동물병원 정착하려구요!','Y'),(10607,589,'과잉진료없고 친절 수의사님마다 진료방향이 같지는 않음','N'),(10608,589,'친절하신 의료진들 덕분에 애기 건강검진 잘 받았습니다:)','Y'),(10609,589,'선생님이 친절하시고 동물에 대한 사랑이 넘쳐요','Y'),(10610,590,'👍원장님 갓친절 킹친절👍\n\n11월 21일날 선전화 후 2차 예방접종을 하러 방문했습니다.\n\n상담전화를 한 후에 샵에서 이제 2개월 된 아이를 데리고 간다는 말도 안 하고 1시간 뒤에 방문했습니다. 방문하자마자 아까 전화해주신 분이냐고 기억해주시고 강아지 기본정보, 변상태 등 체크 한 후에 저에게 강아지가 건강하지만 아직 입양 받은지 얼마 안 됐고 샵에서 분양 받은 아이라 전염병 등에 걸려 잠복기가 있을 수 있다고 해서 조금만 더 지켜보자고 해서 예방접종','N'),(10611,590,'원장님도 진료 꼼꼼하시고 과잉진료 안 하는 양심적인 곳입니다.','N'),(10612,590,'이곳은 진짜 수의사 선생님이 있는 병원이에요','Y'),(10613,590,'수의사선생님들은 친절하다.\n집에서 가까워 다른 동물병원도 있지만 주로 헬로우를 이용하고있다.\n근데 강아지미용에 있어선 주변과 비슷하면서도\n조금 비싼편임.','Y'),(10614,590,'습한날씨에 약제봉투를 포리백과 실리카켈까지 챙겨주주신...','N'),(10615,591,'애기가 어릴때 부터 이 병원에 다녔어요. 그런데 제가 해외에 오게 되었고, 부모님이 돌봐주시게 되었는데 병원에서 이미 꾸준히 처방 받던 약도 요청을 드리니 다시 진료를 받으라고 하고 약을 안주시더라구요. 그래서 느꼈어요. 그냥 애기를 위한 마음이 부족하구나.','N'),(10616,591,'절대가지마세요..\n여기서 저희집 강아지가 중성화수술하고 다음날 바로 마취부작용으로 죽었습니다..\n따로 부작용설명이나 주의사항도 설명안해주시고 다음날 상태가 안좋아서 데려가니 새벽에라도 갔으면 이정도로 심하진않았을거라네요. 부원장이 수술했고 자신이 설명도 부족했고 퇴근시간이 얼마안남아서 상태를 더 안보고 빨리보냈다고 죄송하다고 사과를 받았고, 곧 그만두신다고 그러셨는데 언제 그만두실진 모르구요. 이렇게 부작용날지 몰랐다고 죄송하다고만하시면 이미 죽은 강아','N'),(10617,591,'아뇨! 동의 안합니다. 오늘도 친절 하게 진료 잘해주셨읍니다. 전 믿음이 가는 동물 병원입니다','Y'),(10618,591,'우리 탄이를 잘 봐줍니다. 간호사님과 의사쌤 전부 친절해요!','Y'),(10619,591,'친절하고 세심한 선생님과 간호사님들\n불안한 보호자들의 마음을 감싸주는\n따뜻한 돌봄이 감사했어요','Y'),(10620,592,'원장님이친절하고.자세히설명해주시고.또한.다른병원들처럼수술비를많이부르지않고.적당한가격으로\n잘해주십니다\n많은분들이.혜택을받았으면.\n하는바람이있읍니다.','Y'),(10621,592,'오래된 병원이라 좀 좁지만 항상 환자들이 몰리는 곳입니다. 선생님들이 환자를 세심하게 케어해주시고, 말그대로 \'치료\'가 먼저인 병원 다운 병원이지요. 멀리서 오는 환자도 많은 곳, 강추 합니다.','Y'),(10622,592,'고양이 친화적인 병원은 아니에요. 그냥 동네동물병원 느낌이고 고양이 진료는 은평이나 신촌쪽으로 가는게...','N'),(10623,592,'집에서 가까워 자주 가게 되었는데 솔찍히 원장이 별루였다. 어떻게 저런 생각으로 애완견들을 치료하는지...? 모든게 돈으로 보는것 같아 그후로 다신 안간다.','N'),(10624,592,'오래전부터 이용하다 말티즈 하늘나라 먼저 보내고 2년후 베들링턴테리어 입양해서 자 방뮨했는데 변하지 않은 의사쌤과 직원분들의 서비스가 좋았서요~','N'),(10625,597,'딸이 오늘 입주한다.\n새로 사는 전자 제품들이 어제\n온다해서 며칠 동안. 가 있었다.\n건물도 튼튼해 보이지만\n다른. 곳보다. 디자인도예쁘고\n조경이 큰 소나무 가 조화롭게\n있어서 예뻤다.\n아이들 놀이터도 다른곳에 없는 것이 있어서 외손자가 많이. 좋아한다.\n딸 얘기로는 커뮤니티 시설도\n잘되있다는데. 이대역하고 가깝고 이사 잘. 한것 같아 좋다.','Y'),(10626,597,'당근하러 갔는데 지나갈 때마다 느끼지만 1층 상가 라인이 멋지다고 느낀다. 사는 입장에선 어떤지 모르겠지만. 다만 동간 간격이 너무 짧아 답답한 감이 많다.','N'),(10627,597,'제가 4월 17일날  죽다가 살아났는데 대흥동, 염리동 쪽이 싹 다 바뀌어서 몰랐습니다.\n그리고 회사에서 이곳에 가서 마스크좀 얻어오라고 해서 다녀왔습니다','N'),(10628,597,'경사가 큼. 고층은 뷰가 좋은듯. 저층은 외부 노출이 잘되서 커튼 필수임','Y'),(10629,597,'서울 마포구 염리동에 재개발된 멋진 경관이 있는 편리한 자이 아파트','Y'),(10630,598,'부부 원장님 두분 다 자상하고 전문적으로 아이들 치료해주시고, 모든스텝 분들도 친절합니다.시설도 깨끗하고 최신 장비를 갖추고 있습니다.','Y'),(10631,598,'16년도부터 다녔어요 이제 애기들이 노견이되었네요 원장님들 과잉진료 없으시고 세심하게 잘치료해주세요♡ 꼭꼭가세요~~','Y'),(10632,598,'언제나 너무나 친절하시고,\n저희가 물을것없이 먼저 자세히 설명해주세요!\n선생님들을 신뢰하게되니 걱정없어서 좋아요. :)','Y'),(10633,598,'깨끗하고 친절하십니다.\n좋아요.','Y'),(10634,598,'친절하고 진료 잘합니다','Y'),(10635,599,'홍대,상수를 다니면서 넘 좋아보이는 아파트♡','Y'),(10642,615,'수의사선생님들 두 분 뵈었는데 모두 너무 친절하시고 궁금한 점도 자세히 설명해주셨어요. 진료비도 적당하고 주차장도 따로 있고 고양이 진료실도 별로로 있어서 좋았어요.','Y'),(10643,615,'수의사의 상세하고 친절한 설명','Y'),(10644,615,'주차편리하고 원장선생님들 친절하고 자세한 설명해주세요 과잉진료 없어서 멀지만 만족합니다','Y'),(10645,615,'의사 간호사 선생님 모두 친절하고, 과잉진료가 없어서 믿을만 합니다.','Y'),(10646,615,'너무 친절합니다.','Y'),(10647,620,'야간진료로 급해서 다녀옴.\n접수때부터 수납때까지 진료금액 안내가 계속 달라짐.\n조금씩 오르더니 최종결제금액은 처음 안내의 거의 2배였음..\n그리고 무엇보다 \'내 아이의 성향은 내 보호자가 가장 잘 안다\'라는걸 존중해줬으면 하는 큰 아쉬움이 있음.\n24시간이라 급할때 야간진료 방문할 수 있는건 좋음.','N'),(10648,620,'여기 병원을 이용한지 벌써 10년이 넘었네요..\n그만큼 신뢰감 100% 보장하기 때문에 이용하고 있습니다.\n\n아이들의 상태에 대해 정확하게 하나하나 상세히 설명해주시고\n아이들이 잘 따르는 걸 보면...\n우리 강아지를 진심으로 생각해주신다는 걸 마음으로 느낄 수 있었습니다.\n\n항상 최선을 다해서 돌봐주시는 의사선생님(박철 원장님, 최갑철 원장님)과\n간호사님들, 직원분들 정말 감사합니다 :)','Y'),(10649,620,'로드킬 될 뻔한 어린 고양이를 구해주셔서 감사드립니다.\n\n아이들 키워서 치료비 엄두가 안났어요.\n일요일 아침 일찍 문을 연 동물병원 찾기가 무척 어려웠고 운전해 가면서 돈걱정이 많이 들었습니다.\n\n차에 치여 골반뼈도 깨지고 요도도 터지고 신경도 마비된 고양이를 다 고쳤습니다.\n\n동물메디컬센터w\n직원분들께 한달 3일간의 긴 노고와\n따뜻한 환송에 감사드립니다.\n\n막대한 치료비를 병원에서 부담해서 버거워지면\n안될 것 같아요.\n\n사회적 안전망이 길동물들과 집동','Y'),(10650,620,'우리 7살 된 비숑 아가가 PLE 진단을 받고 치료중입니다!\n알부민 수치 때문에 검사를 받고 약도 복용을 해야해서 벌써 병원을 6개월넘게 꾸준히 다니고 있는데요.\n매번 원장님이 디테일하게 설명해주시고 보호자 개인 상황도 고려해주시면서 검사 및 치료를 진행해주셔서 너무 감사할 따름입니다 ㅠㅠ\n카운터에 계시는 간호사분들의 아이 걱정해주시는 따뜻한 말 한마디씩에 검사 결과 기다리며 로비에 앉아있는 불안한 마음이 참 편안해질때가 많았습니다.\n이번에는 아이가 안','N'),(10651,620,'저희 고양이가 매우 아팠는데 발빠르게 고양이 상태 고려하며 치료해주셔서 고비를 넘길 수 있었어요. 그 후로도 매번 고양이 상태 물어보시며 체크하시고 케어해주셔서 감동받았네요:)\n한 번은 저희 고양이가 상태가 안좋아져서 휴가도 반납하시고 선생님께서 달려오셔서 치료해주셨어요.\n\n큰 병원이라 가격이 아무래도 부담이되긴하지만 그만큼 아픈 아이에게 좋은 의료 서비스를 제공하고 싶은게 어쩔 수 없는 집사 마음인 것 같아요. 아이가 안 아픈게 최고지만 혹시라도 아프','Y'),(10652,625,'추천하지않습니다 매우좋지않ㅅㄷㅂ니다','N'),(10653,625,'저렴한 가격에 아이들을 치료해주니\n넘 ㄱㅅ해요','Y'),(10654,625,'입양 도와주셔서 너무 감사드립니다!','Y'),(10655,625,'유기동물 보호소','N'),(10657,157,'꼼꼼하게 잘 봐주시고요.간호사쌤들도 친절하시고,수의사쌤도 무심하게 매우 친절하십니다 :) 병원비도 나쁘지않고...좋아요. 반려묘가 무지개다리 건너기전까지는 계속 다니려구요','Y'),(10658,157,'원장님도 좋으시고 과잉진료 없어요~병원 이전후 고객이 정말 많아진곳 이에요\n작년7월에 뒷다리 두개 쓸개골수술 하고\n완전 날라다녀요~\n처음엔 수술하고 한달까진 잘 일어서지도\n못하더니 한달 지나고 나니 잠시도 가만히\n안있네요..꼬리 물려서 괴사되어 꼬리뼈\n자르고 봉합술 받았는데 수술이 잘되었는지\n밥두 잘먹고 컨디션 너무 좋네요\n항상 의사쌤 믿고 두아이 진료 보고 있어요','Y'),(10659,157,'의사선생님 좋습니다\n강쥐 두마리 맘놓구 진료봅니다\n그런데 카운터에 있는 여자분하나땜\n이 병원을 다녀야할지 고민중입니다\n의사쌤이 모르시는건지,알아도 묵인하시는건지,너무너무 불친전하고\n그 병원에 가면 맘이 너무 불안합니다\n표정,말투 가 화가 잔뜩 나있는사람인거같습니다\n왜 계속 그러고있는건지,왜 계속 그런사람이 응대를 하고있는건지 정말 답답합니다\n말할수없는 답답함에 써봅니다','N'),(10660,157,'친절한 원장님.\n울 냥이가 좀 힘들어했지만.\n그래도 설명도 잘해주시고...\n만족입니다.','Y'),(10661,157,'원장님도 좋으시고 간호사분 중 머리 짧으신 분은 좋으신데 키큰 다른분은 아주 퉁명스러우세요','N'),(10662,639,'전국으로 제주흑돼지 제주돼지 제주한우 제주말고기 유통하는 제주아재 장도영입니다','Y'),(10663,639,'선생님  두분인듯 여선생님이 더 친절','Y'),(10664,639,'동네 동물병원이라고 생각하면 될 것 같습니다. 한계는 분명히 있어보입니다만 그래도 선생님이 친절하시고 가까운 편이라 수시로 애기들 데리고 오가기 좋습니다. 뒤쪽에 크지는 않아도 주차장이 있어 차 가지고 가기 좋다는 것도 장점이네요.','Y'),(10665,639,'푸들 아가 예방접종 2차 맞으러갔는데 주사 맞추고 발톱 깎아준다고 안에데리고가서 느끼기엔 3-4분?도 안되서 다했다고 나오더라구요..주말이어서 바빠보였지만 의사 선생님 말도 심각하게 빨리하시고 그냥 다 후딱후딱.... 집에 와서 제대로 확인했는데 발톱은 그대로인거 보니 주사도 놓아주신건지 의심되네요... 진짜 완전 별로였어요. ㅠㅠ','N'),(10666,639,'의사산생님은 애완동물 배려가 좋으셔서 그런지 사람이 너무 많아효','N'),(10667,152,'원장샘이 방배동 한강동물병원에서 오랫동안 진료하셨던 샘 이시며 오랜 진료경험이 있으신 선생님이십니다.\n자세히 설명해주시고 정확한 진단을 해주셔서 매우 만족합니다.','Y'),(10668,152,'친절하신 선생님과간호사쌤 과잉진료 없고 이해하기쉽게설명해주시네요 강추','Y'),(10669,152,'원장님 늘 친절하시고 진료도 잘 봐주시고 그냥 오래오래 번창하며 여기 계셔주시길 바라는 병원이에요^^','Y'),(10670,152,'의사샘  친절하시고 분위기가 편안해요\n울 레레가 편안해해서 이제 유목민치료 끝~~','Y'),(10671,152,'친절하고 설명도 잘해주시고 좋아요','Y'),(10672,651,'시간 마다 동물친구들과(뱀.새. 등) 사진찍을 수 있고 새 모이주기 체험 . 당근 먹이주기 등 놀거리가 많아서 두번이나 다녀왔어요. 실내 동물원 외에도 아이들이 놀수 있는 공간도 있어서 알차네여','Y'),(10673,651,'우리집 예쁜이가 이용하는 병원입니다.\n친절하시고 과한 진료는 노~\n특히 우리 예쁜이처럼 유기견일때는 특히나 안타까워하시면서 비용도 저렴하게 해주십니다.\n며칠전 예쁜이가 아파서 병원에 들렀었는데 다음날이 쉬는날이라 걱정이 되셨는지 전화까지 주셨어요.','Y'),(10674,651,'친절하신 수의사님 계십니다\n아이들도 편하게 방문하실수 있는곳','Y'),(10675,651,'몇십년 다니는 칼 국수집입니다 안 밖은 허름한데 정말 사람을 끄는\n칼국수 집 입니다','N'),(10679,666,'진료선생님 왕친절, 설명도 잘해주시고 너무 좋아요.\n저희집 고야이 동물병원 여러군데 가봤지만 믿고 맡길데가 없어 두번이상 방문한 곳은 없었는데 올스타로 정착할듯','Y'),(10680,666,'시설 깔끔하고 진료도 불필요한것 없이 잘 봐주십니다. 선생님은 괜찮다고 하시는데 제가 겁나서 검사한적이 몇번 있네요ㅋㅋ 그렇다고 또 대충 보시거나 검사를 안하시는편은 아니에요. 앞의 강아지가 많이 아파서 검사할게 많았는지 거의 한시간 기다린적도 있거든요. 심장사상충약은 6개월치 한번에 사면 하나 더 주시구 제품 구매금액 적립도 됩니다.','Y'),(10681,666,'우리 슈가 자궁축농증으로 수술하기전에 수액 맞는 모습인데...잘 됐음 좋겠습니다.','Y'),(10682,666,'365일 진료  짱이예요','Y'),(10683,666,'여기 꾸준히 약 받아가고 있음\n괜찮은 곳','Y'),(10684,677,'친절하십니다','Y'),(10685,680,'서울시 강서구 방화동 신방화역 사거리에 있는 24시간 동물병원. 총6분의 선생님이 있으며, 매일 당직의사분이 대기중인곳. 주차장도 있고, 2층에누 진료실과 수술실이 있음. 진료비와 약제비 등은 다소 비싼느낌이지만 꼼꼼하게 챙겨주는 모습에 믿음은 가는 병원.','N'),(10686,680,'3세 남아 푸들 중성화수술 하러 갔는데 원장님께서 친절히 꼼꼼하게 상담설명 잘 해주셔서 이해하기도편했고 안심하고 수술시킬수 있게 믿음이 갔네요 병원도 깔끔하고 미용도 같이 맡겼는데 후차에 미용과수술후 사진 함께 올려볼께요...','Y'),(10687,680,'원장선생님 두 분 다 친절하시고,미용실장님 간호사분들 모두 너뮤 좋아요! 저희 강아지들 갈 때마다 반겨주시고 무엇보다 과잉진료다 없어요!!!!!','Y'),(10688,680,'선생님들도 좋아요 한유나쌤 설명도 굿 친절도 굿 마스크넘어로 미모도 굿^^','Y'),(10689,680,'시설이 좋아서 비싼줄 알았는데 가격이 비슷하네요\n그래서 더 좋았어요','Y'),(10691,684,'친절하고 설명달해주심.\n여기서 중성화도 했음.\n굳.','Y'),(10692,691,'살다살다 차량 커버 씌우라는 곳 처음봄 ㅋㅋㅋㅋㅋㅋ','N'),(10693,691,'알파문구 좋아요 넓고 없는 물건 없고\n간단한 출력도 가능한곳','Y'),(10694,691,'거래처에 들렸는데 건물이 무척이나 깔끔하네요.\n건물관리를 철저히 하는듯 싶네요','Y'),(10695,691,'처음가본데인데깔끔하고좋아요','Y'),(10696,691,'엘리베이터가 3개뿐이어서 느림','N'),(10697,696,'벌써 다닌지 5년 되어가는데, 의사 선생님 너무 친절하시고 차근차근 잘 봐주십니다. 과잉진료\n절대없고요 이사가서도 한시간 거리 차타고 여기 병원만옵니다~ 늘 감사드려요','Y'),(10699,697,'과잉 진료\n피검사 와 초음파 검사를 매번 모든항목으로 함\n(다른 병원은 필요한 항목만 검사해 항목별로 돈이 측정됨. 초진후 높은 수치만 재검사 필요)\n과잉 처치로 병원비가 많이 나옴','N'),(10700,697,'진료 잘하시고 친절하고 좋아요~\n주차장도 있긴 한데 동네골목 옆이라 조금 좁고 불편..','Y'),(10701,697,'10년넘게 다니고 있는중 의사쌤이랑 간호사분들 친절하시고 제일 중요한건 우리 애들이 여기랑 잘맞음','Y'),(10702,697,'진료비 ,약값 한번가믄 10만원\n좀 저렴했으면 좋겠어요.\n언제나 보험되려나???','N'),(10703,697,'친절하고  좋아요','Y'),(10704,705,'한국에 방문시 항상 이용하는 병원입니다. 원장님이 알아서 잘 해주시고 친절합니다 :)','Y'),(10705,705,'아이들 책도 사고, 어른들 책도 사고.. 새거 같은 책들 반값에 샀네요.','Y'),(10706,705,'비싸요...','N'),(10707,705,'친절...','N'),(10710,710,'친밀감있게 말씀은 하지 않지만 과잉진료비를 요구하지 않