^ 간호사분은 말투가 참 안 좋으셨어요^^ 못 하셨으면 사과라도 하셔야죠 못 하셔서 그냥 가라고 하시는 건 대체 수의사 맞나요?ㅋㅋ 너무너무 실망했어요 진짜 최악의 동물병원이예요 ㅋㅋ 어이가 없어서 오늘 밤은 잠도 못 잘 거 같네요^','N'),(10739,750,'마음을 추슬렀다고 생각했는데, 아직 너무 힘드네요.\n아이가 이 병원에서 7월에 유선종양 수술을 받고 9월에 무지개다리를 건넜어요.\n다른 강아지는 잘 모르겠지만, 부디…. 제발.. 노견은 이 병원에서 수술 시키 말아주세요...\n저와 저의 반려견과 같은 상황을 겪는 분들이 없었으면 좋겠어요.\n\n-치료: 수술 전/후 제대로 된 검사를 시행하지 않았습니다. 노견들은 수술 전에 암 전이 여부를 확인하기 위해 CT를 찍어야 한다고 하네요.\n그런 말은 일절 하지 않','Y'),(10740,750,'남자원장님 친절하시고 다른 곳보다 저렴한데 진료도 잘봐주셔서 용산에서 항상 와요!','Y'),(10741,750,'고려시대의 길과 조선시대의 길이 공존하는 유일한 장소를 걷는건 의미있는 여행이였습니다.','N'),(10742,750,'의사 선생님, 간호사 분들 모두 친절하시고 좋아요 😄','Y'),(10743,753,'친절하고 선생님이 진심입니다\n다른병원보다 병원비도 착해요','Y'),(10744,753,'전 솔직히 별로였습니다. 필요한 혈액검사 항목수가 적어 다른데선 5만원이면 할 검사를 어떤 생각에서 인지는 모르겠지만 계속 우기셔서 전체검사로 10만원을 굳이 받으시더군요\n설명도 많이 안해주셔서 고객입장에선 호구잡힌다는 생각밖엔 안들었네요.\n완고하신거랑 실력이 비례하는지는 잘 모르겠는데 저랑은 안맞네요.','N'),(10745,753,'반려견을  키우니까 당연히 동물 병원을 자주 이용한다 여기는 솔직히 고양이 전문 병원이라 그런지 강아지를 키우는 나는 그냥 일반 동물 병원과 별반 차이를 못느낀다 직원들이 친절하다 머 그정도? 그런데 그건 당연한건데','N'),(10746,753,'너무 잘 봐주시고 치료도 잘해주세요\n좋은일 많이 하는 유석동물병원이예요 최고최고!','Y'),(10747,753,'의사선생님이 성의껏 진찰해주시는 게 느껴져요. 맨손으로 애들 생식기쪽 분비물도 다닦아주시고 괜찮냐고 전화도 해주시고 넘 좋았네요.','Y'),(10748,754,'지나가기만 해서 잘은 모르지만, 앞뜰(?)에 대리석 미술작품도 있고, 상가건물에 이마트도 있으니 나름 신경써서 지은 곳 아닌가 생각해요.','Y'),(10749,754,'아주 조용한 아파트. 심지어 월드컵 골이 들어가도 조용한 아파트.\n시설 깨끗하고 편의시설 잘 되어있고 주차공간 충분하고,\n지하에 이마트가 같이 있어서 내집처럼 다닐수 있는 아파트','Y'),(10750,754,'저는 비록 여기에 해당되어있는 거주자는 아니지만은요 확연한 사실하나는 이마트가 인접한다는 것을 확연하게 잘 알아주셨으면 감사하겠습니다. 이상 여기까지 저의 의견을 마무리해보는 측으로 끝내보도록 하겠습니다.','Y'),(10751,754,'더블 역세권+이마트  1분거리+바로 뒤에 샛강이 흐르고 산책로가 윤중로인 곳. 살기 진짜 좋았던 곳입니다.','N'),(10752,754,'위치 좋고, 조용하며, 주민공동시설(정원, 마사지실, 헬스장) 등이 잘 되어있음, 주차공간이 쾌적','Y'),(10753,758,'의사,간호사 모두 친절하십니다','Y'),(10754,761,'진료 잘 봐줘요~','Y'),(10755,761,'친절하세요.','Y'),(10758,768,'유기동물을 공고기간까지 돌봐주시고\n주인찻아주시는 좋은 병원입니다\n하지만 가슴아파서 못 가는곳\n\n누구나 할수있지만. 아무나 못해내는 일을\n하는곳이예요','N'),(10759,768,'유기묘 대려다 주었습니다\n좋은 가족 꼭 찾아주시길 바랄께요\n이런곳이 있어 참다행입니다','Y'),(10760,768,'꼼꼼한 진료 그리고 정확한 처방과\n합리적인 진료비 넘 맘에 듭니다','Y'),(10761,768,'우리 고양이 다니는 병원.\n불필요한 처치 안해서 좋아요.','Y'),(10762,768,'절대평가가 아닌 비교..진단이 명확하지 않음','N'),(10763,772,'진료를 꼼꼼하게 잘 봐주시고, 설명도 쉽게 해주십니다.\n무리하게 진료하지 않고, 금액적인 부분도 충분히 고려할 수 있게 배려해주세요.\n점점 입소문이 나는지 항상 사람이 많고, 예약이 풀인 경우가 많지만,\n예약을 못해도 틈내서 진료 봐주세요.','Y'),(10764,772,'원장님과 간호사언니가 엄청 친절해요 원장님은 동물을 사랑하는 마음이 눈에 보일정도에요ㅋㅋ 선생님  실력도좋구 저는지금 이병원을 거의6년정도 다니고있어요ㅋ','Y'),(10765,772,'구글리뷰보고 갔었는데 선생님이 동물 너무 좋아하시고ㅋㅋ 친절하세요. 고양이 수술때문에 병원을 찾았는데 가격도 제일 괜찮았어요. 필요없는 치료 강요 전혀 없었고 사람의 재정도 고려해주시는 편이예요.','Y'),(10766,772,'원장님의 친절함에 빠져서 성북쪽으로 이사간 뒤에도 계속 방문중입니다. 진료시에도 아이들 스트레스 안받게 신경써주시고 진료도 잘봐주십니다. 증상과 관련된 상세내용을 설명해주시고 어떤 진료가 당장 필요한지, 기다리고 지켜봐야할지를 설명해주셔서 과잉 진료 걱정도 없었습니다.','Y'),(10767,772,'수의사 선생님께서 너무너무 친절하시고 아이들에게 관심이 정말 많으세오! 아이 상태에 대해 지속적으로 수의사 선생님과 상담도 가능한 점이 너무 좋습니다^^','Y'),(10770,775,'간호사분이랑 의사선생님 다 친절하세요. 제가 강아지를 미용해주다 강아지 다리를 가위로 베어서 갔는데 간호사분이 울지 말라고 울면 강아지들이 더 불안해한다고 위로해주셨어요. 의사선생님도 마취한 김에 다 해야한다고 강아지 발톱정리해주시고 발털 밀어주시는데 웃음이 나더라고요. 강아지를 다치게 했다는 죄책감때문에 많이 불안했는데 덕분에 잘 치료받고 왔습니다.','Y'),(10771,775,'여기 의사쌤은 친절하신데 뚱뚱한 간호사 하나가 자꾸 의미없이 시비조로 사람 가르치려듭니다~ㅠ 그냥 의사선생님과 나누는 별것 아닌 대화에도 자꾸 기분나쁘게 끼어들고요^^; 지인분께 들어보니 다른분한테도 그런적이 있다네요. 두번 방문했는데 불쾌해서 못가겠네여\n\nI\'m in wholehearted accordance with my neighbor\'s dismay at this animal medical center, as the head nurse being','N'),(10774,460,'오랜 단골병원 입니다.\n믿고 다니는 곳이라 멀어도 이 병원만 가네요','Y'),(10775,460,'친절하시고 진료도 너무 잘하셔서 신뢰감 뿜뿜','Y'),(10778,782,'강아지 이발할때','Y'),(10780,791,'친절하게 잘 치료합니다. 애완견 구입문의하셔도됩니다.','Y'),(10781,791,'감사합니다 선생님','Y'),(10784,794,'한정식 집으로 25명 이내의 소모임을 하기 좋은 룸이 구비되어 있고 친절하고 싹싹하게\n서빙 함. 종료 시간은 9시로 7시에 만나 8시 50분에 끝내려니\n조금 아쉬운 편이었습니다.','Y'),(10785,794,'좋은 가게들도 많고 고속터미널 역과 연결 되어있어 매우 편리하다.','Y'),(10786,794,'여기 아파트에서 몇년을 살았거든여\n\n들르기 엄처엉 편해여\n\n편의점이랑 약국, 파리 바게뜨랑 각종 학원과 병원 다있어여!\n\n여기 입주민이 아니여도 근처에 산다면 들르시길여\n\n입주민인데 너무 멀다면 김영모 상가 가세여 비슷해여','N'),(10787,794,'조금 오래된듯 만듯 상가\n없는거 빼고 다','N'),(10788,794,'이곳은 슈퍼 편의점 헤어샵 등 여러가지 시설들이 있어서 좋아요.','Y'),(10790,798,'병원이 넓진 않지만 수의사 선생님이 친절하시고, 강아지도 예뻐하시는 듯 하여 좋습니다.  사료나 용품 강매도 없고요.  집에서 멀지 않아 자주 가고 있습니다.','Y'),(10791,798,'수의사 선생님 너무 좋으세요ㅎㅎ 아직 아가라 궁금한게 많은데 하나하나 친절하게 설명해 주시고 꼼꼼히 살펴 주셨어요. 이사를 가게 되서 쭉 못다녀 아쉬워요!','Y'),(10792,798,'넓지는 않지만 수의사 선생님 매우 자상하시고 친절하심.  판매하는 사료나 건기식 가격도 합리적인 편.  👍','Y'),(10793,798,'동물을 사랑하는 수의사선생님이 친절히 나의 반려견을 돌봐주십니다.\n강이지 미용도 맏기면 신경써서 조금씩 스타일을 바꿔가면서 예쁘게 해주십니다','Y'),(10794,798,'조그마 하지만 아주 정겹게 치료를 잘 해주는 원장님과 동물친구들 입니다. 외로울때 친구가 필요할때 가 보시면 인생에 반려동물이 있을겁니다','Y'),(10795,802,'여기 아주 좋음! 여러가지로 믿고 다니는 반려동물 병원!^^','Y'),(10796,802,'우리 대박이 건강 책임져주시는 친절하고 진심인곳!','Y'),(10797,802,'우리 멍멍이가 아주 예민해서 어느 병원을 가든 한번 다녀오면 2일은 우울해있는데 여기는 너무 잘해주셔서 데려올때부터 기운을 차리고 방방 뛰어서 오네요... 미용도 잘하세여 ㅋㅋㅋㅋ 저희개 전용컷 해주심','Y'),(10798,802,'친구강아지 접종다녀왔네요 여기 제 친한 누나가 동물을 무지 사랑하는 사람이라서 믿고맏기셔도될듯해요 원장님또한 동물을 좋아하고 사랑하시고 무지 살가우십니다','Y'),(10799,802,'언제나 친절하시고 진료 참 잘보세요~~!!  오래 병원이 그자리 늘 그런이유는 있는겁니다~~!!','Y'),(10800,804,'선생님 친절하시고 꼼꼼히 잘봐주심','Y'),(10801,805,'원장님께서 증상을 친절하고 자세히 알려주세요.\n무엇보다 병원이 너무 깨끗해서 믿음이 가네요.\n개와 고양이 입장문이 각각 다르고요.\n병원 앞에 주차하고 들어갈 수 있습니다.','Y'),(10802,805,'저희 냥이들 아기때부터 돌봐주신 두 선생님이 함께 개원하셨다고 해서 오픈하자마자 바로 들렀습니다. 고양이 진료실이 강아지 진료실이랑 따로 분리가 되어 있어서 안정이 되었는지 저희 겁쟁이가 이동장 밖으로 나와서 둘러보는 모습을 처음을 볼 수 있었습니다 ㅎㅎ 저희 고양이 죽을 고비 여기 선생님들 덕분에 잘 넘길 수 있었고 덕분에 지금은 건강하게 함께 잘 지내고 있습니다~ 요즘 반려동물 믿고 맡길 수 있는 동물병원 찾기 쉽지 않은데 강츄 드립니다! 앞으로도 ','Y'),(10803,805,'친절한 원장님이 맘에 들더군요.\n일요일도 영업하시고 정말 열씸히 일하시네요','Y'),(10804,805,'고양이 출입구. 진료실 따로 있고 세심한배려가 병원곳곳에 숨어있어 편하게 진료받을수있습니다. 검사 강요 없이 보호자 의견 최대한 존중해주시고 설명도 잘해주십니다. 붐빌까봐 나만 알고싶은 병원이에요.','Y'),(10805,805,'과잉진료도 없으시고\n친절하시구요\n\n비글구조네트워크 보호소 강아지들 진료도 봐주시는거 같고 좋은 병원이라고 느껴져요','Y'),(10806,807,'친절하고 좋아요','Y'),(10807,807,'너무 친절하고 잘 봐주세요.\n다른병원 몇군데 다녔는데 이만한 병원이 없네요^^^','Y'),(10808,807,'샘이 친절하게 자세한 설명해주세요. 정직하게 운영하는 느낌받았어요. 샘이 게다가 이쁘세요^^','Y'),(10809,807,'항상 친절하시고 병원도 깨끗하고 좋아요','Y'),(10810,807,'원장님이 참 친절하세요! 너무 좋은 동물병원이예요','Y'),(10812,811,'휴가갈때 두 주정도 서초동물병원에 맡겼는데 이후 전에 없던 여러가지 트라우마가 생겼어요. 분리불안증, 자주 토하고, 다른 사람과 산책도 힘듭니다.','N'),(10813,811,'원장님 덕분에 우리 강아지 심장병 낫고 잘 지내고 있습니다. 가격도 싸고 매번 감사해요ㅜㅜ','Y'),(10814,811,'단골동물병원. 시설 좋아요. 분위기 좋아요. 특히 직원들 아주 좋아요.','Y'),(10815,811,'고양이는 잘 모르세요.','Y'),(10816,811,'진심으로 비추합니다','N'),(10817,813,'3층 4층 생화 판매상이 있고 5층에 부재료 판매하는 상점도 함께 있다.\n3개월 꾸준히 다니면 단골찬스로 덤을 막 얹어 주는 3층 명성화원 사장님 최고!','Y'),(10818,813,'5층에 있는 그레이스 화원...사장님의 친절함과 서비스로 단골 됐어요.예쁘고 종류도 많아 넘 좋네요','Y'),(10819,813,'반포에 있는 귀금속 상가\n크지는 않지만 교통 접근성이 아주 좋다','Y'),(10820,813,'출퇴근 시간에 주변이 길 많이 막히니 피하는 게 좋음','Y'),(10821,813,'귀금속, 한복, 생화, 조화 없는게 없어요.','N'),(10822,816,'울아이 관절염때문에 발을딛으려고 하지않아서 침치료다니다가 지인추천으로 재활차 방문했는데~수중이랑 레이저 치료받고 정말 눈에 띄게 좋아졌어요. 꾸준히 해보려구요~^-^','Y'),(10823,816,'병원이 깨끗하고 선생님들께서도 반려견을 예뻐해주시고 엄청 친절하게 자세하게 설명해주시긴 하셨는데 좀 비쌌던것 같아요.두세군데 비교 해 봤는데 같은 치료법에 같은 시술 내용임에도 비용 차이가 좀 있더라구요.','Y'),(10824,816,'3개월된 Peanut 치킨 뼈 몽땅 먹고 병원 갔는데 수술 하지 않고  잘 케어해 줘서 현재 건강함❤','Y'),(10825,816,'서울대 출신 수의사님이 진료보시고, 매우 친절하세요. 서래마을에서 경기도로 이사갔지만 믿을만한곳 다니려고 일부러 찾아가고 있습니다.','Y'),(10826,816,'여행 갈 때마다 맡겨요\n잘봐주시는 거 같아요\n아이 사진도 잘 보내주시고\n믿고 맡깁니다','Y'),(10827,818,'🧡울사랑 💚 금손이 한방동물병원 다니던때가 생각납니다 ~ 원장님 멀리서 오셨다고 울랑 수액까지 ~~~ 완 사랑💜❤️이지요.  금손👍👍👍','Y'),(10828,818,'고급스러운 유럽 전문 원단이 많네요','Y'),(10829,818,'흔하지않은 강아지 한방치료로 모찌가 효과를 톡톡히 보았디\nㆍ\n오른쪽 앞발을 거의 사용하지 못하다가 한방침  맞은 횟수가 늘어날수록 정상으로 돌아왔다~\n\n말못하는 모찌는 얼마나 불편했을까 생각하니 미안함이 앞선다\n\n사람이나 반려견이나 아프면 안타깝다♡\n건강하게 지내자♡♡♡  모찌야♡♡♡','Y'),(10830,818,'주차문제만 빼면 바쁘지만 나름 진료가 잘 이루어지는 곳','Y'),(10831,818,'친절하세요 상담도 깊고오래자세히봐주셔서 매우만족합니다','Y'),(10832,824,'원장님께서 정말 친절하십니다. 우리 사랑이(강아지)를 너무 친절하게 봐주세요~','Y'),(10835,826,'코스트코 양재점을 마주보고 있은 이마트 양재점\n하이브랜드 지하 1층은 매장, 지하 2층은 주차장으로 사용한다.\n\n이마트 양재점 주변에는 큰 주거단지가 없지만 코스트코 양재점 처럼 주로 차량을 이용해서 찾아오는 지점이다. 영업매장이 단층이지만 식품, 잡화, 가구, 가전, 애플샵, 갤럭시 스토어, 베이커리, 다이소까지 입점되어 있어 복층규모 매장과 비교해도 손색없는 상품 가지수를 자랑한다.\n\n코스트코 매장과 마주한 특수성 때문인지 이마트 양재점 이용객도 타','N'),(10836,826,'마트도 넓고 주차장 공간도 여유가 있어요.','Y'),(10837,826,'있을거 다 있는 이마트.. 셀프로 소량 계산할수있는게 좋다\n코로나때매 잘 보이는 곳에 손소독제 있었음 좋았을듯\n내가 못본건가?','Y'),(10838,826,'넓어요 . 왠만한 물건 다있는 . 위치가  멀어서  좀 불편해요 .  코코 옆이라 항상 차도 밀리구요 .','N'),(10839,826,'푸드코트에 있는 생과일 주스집 후르츠 아일랜드 추천합니다. 장보고나서 수박주스 한잔 마시면 정말 꿀맛이에요! 모든 메뉴를 직접 보는 앞에서 과일 잔뜩 넣고 갈아 만들어주십니다.','Y'),(10840,831,'친절하시고 경험이 많으신 거 같아요~ 초보견주라 넘 많이 도움주시구요~ 애견 미용도 짱입니다~','Y'),(10841,831,'친절하고 또 친절하고 아주 친절하고.','Y'),(10842,831,'친절하고 애들에게 적당한 치료를 해주십니다. 강추','Y'),(10843,831,'영혼이 살아있는 돌봄입니다 우리 귀요미들을 진짜 아껴주세요','Y'),(10844,831,'동물을 엄청 잘 관리해주는 동물병원','Y'),(10845,834,'촣아요!','N'),(10850,836,'저희 강아지 토랑이 미용및 진료를 위해 다니는곳입니다 친절하시고 잘해주세요','Y'),(10851,836,'친절하고 과잉진료 없으시고 모든 의료진이 사랑으로 돌보아주셔서 늘 믿고 맡겨요','Y'),(10852,836,'친절하고 꼼꼼하게 봐주십니다.  그치만 강아지 병원비는 부르는 게 값~','Y'),(10853,836,'9년째 다니는곳...쌤들 모두 모두 친절\n진심으로 애들을 사랑하는곳','Y'),(10854,836,'작지만 잘 진료해 주는 동물병원','Y'),(10855,843,'강아지 귀때문에 8년동안 여러 병원다니며 검사하고 약먹고 결국 동네 병원에서 귀수술했다가 실패한거\n충현동물병원 강종일 원장님께 귀 재건수술받고 1년째 귓병없이 약도 안먹고 잘지내고 있어요. 여기저기 병원다니며 검사비, 약값, 강아지 고생했던거 생각하면 병원비가 저렴한것같다 라는 생각이 듭니다.\n한시간 넘게 걸리는 거리지만 강아지 아프면 충현동물병원만 갑니다.','N'),(10856,843,'원장님한테 진료 받은지 24년입니다. 처음부터 끝까지 저희 아가들 책임져 주셨고, 그동안 죽을 고비도 몇 번이나 넘겼습니다. 언제나 명확한 진료와 환상의 수술 기술로 동물병원만큼은 걱정없이 다녔습니다. 강남에서 충현동물병원 빼고 다른 병원 다니는 분들 보면 너무 안타깝습니다. 저도 24년 전에 양재천에서 산책하다가 추천받은 병원이었는데, 그 때 추천해 주신 많은 견주 분들한테 고맙습니다. 원장님은 우리나라 최고의 실력자이자 수의사입니다.','Y'),(10857,843,'원장님 너무 감사합니다\n친절하시고 꼼꼼해서 믿고 진료받고 있어요','Y'),(10858,843,'선생님 정말 인격적이시고 친절 그리고  확실하세요 비용도 착한편이고 진단이나 치료 베테랑 20년전부터 알게된 정직한 병원이에요 강추~♡','Y'),(10859,843,'강원장님께서 친절하고 완전 치료잘해주시는 전문가이십니다~~ 고가장비들도 다수 보유하고 있구요 치과 전용 x-ray도 가지고 있을만큼 진료 못지않게 장비들도 좋아서 주변에서 가장 믿을만한 곳입니다^^ 추천추천해요','Y'),(10860,858,'서울에 몇개 안되는 토끼 전문병원 입니다.\n작년에 이어  올해  정기 검진 같다가\n천천병력 같은 소리를 들었네요\n수술해야 한다고 ~~ 아이고   ㅠㅠ\n\n1. 왼쪽 아래 잇몸이 농으로 가득차서\n왼쪽 아래 어금니 이빨 전부 뽑고..\n2. 전체 이빨 이갈이가 안되서 갈아야 하고\n3. 햇볕쬐기가 부족해서 ...\n4. 수술이 가능한지 혈액 검사가 필수이고\n\n그려서 수술하러 간 날입니다.\n\n원장님이 아주 후덕하게 생기셨고..\n아이들과 집사람이 들었던 이야기를\n제가','Y'),(10861,858,'아가 변상태가 안좋아서 방문했어요. 꼼꼼히 봐주셔서 좋았습니다! 약 먹이고 나아졌으면 좋겠네요ㅜㅜ','Y'),(10862,858,'아들이 타지에서 댕댕이를키우면서 혼자공부하다 설사,구토로 그지역병원에서 췌장염양성판정으로 무서워하고있어서 저희집가까운 이곳 아크리스에 문의전화를드렸더니 세상 이렇게  저희댕댕이를 걱정까지 해주시며 자세하게 설명해주실줄은 몰랐습니다. 여러곳에 문의전화를 드렸었는데 같은대답으로 답답했는데 원장님 말씀듣고 안심이되었네요. 저의 동물병원의 편견을 깬 최초의병원입니다.\n감사합니다.','Y'),(10863,858,'소동물 잘보는 곳. 수.일요일은 휴무입니다.\n저녁 9시까지 진료보고 8시까지만 도착하면 접수할 수 있어요. 개인적으로 연세있으신 원장님보다 젊은 원장님이 더 친절하고 좋았습니다.\n저는 햄스터를 치료했는데 골절한번, 기생충 한번 치료했어요. 두번 다 친절하시고 동물을 아끼시는게 느껴져서 더 믿음이 갔구요. 편도로 4~50분걸리지만 워낙 소동물 봐주시는데가 별로없어서 오래걸려도 찾게되네요. 꼼꼼하게 잘 봐주시는 편입니다.\n여러번 방문하고 진료 대기하는동안 ','Y'),(10864,858,'토끼진료및수술로 4차례가량방문\n1.진료\n상담진철 및 자세하게 설명해주심.\n2.수술\n뒷다리 탈구로인한 수술과 배에 복수가 차서 수술하였음.\n두번다 성공적으로 해주셨고 지금도 잘살고 있음.\n3.비용\n비용은 좀 나오긴하나 수술로 죽어가던 애를 살려놨는데 뭐가 더 필요하겠나... 다른 동물병원을 방문해본적이 없어서 비교하여 이렇다 저렇다는 평가못함.\n4.추가로할말\n원장님도 건강관리하면서 오래오래사셔요! 간호사분들도 힘들어도 토끼 입원동안 잘 살펴주셔서 감사했습','Y'),(10865,859,'코카스파니엘 15살 입니다\n낮에 외부 활동과  야외배변 하는 아이입니다\n턱과 목과 귀를 심하게 털고 긁고 발사탕도 많이 먹던 아이라 보는것도 힘들었습니다. 검색후 위너스 다니면서 싹 없어 졌고 정기적으로 다니면서 체크하고 있어요. 삶의 질 향상~','Y'),(10866,859,'궁금한 것도 물어보면 친절하게 알려주시고 만족합니다.','Y'),(10867,865,'친절하게 진료를 잘 봐주시고 아픈 반려동물의 상태를 정확하고 확실하게 설명을 잘해주십니다. 진료비도 합리적입니다. 최고의 동물병원입니다!','Y'),(10868,865,'고양이친화진료\n친절하고 꼼꼼히\n잘 봐주셔서 감사합니다~','Y'),(10869,865,'과잉진료. 불필요한 마취 및 수술 권유.','Y'),(10870,865,'우리가 이 멍청이를 방문하기 전까지는 존재하지 않았던 내 강아지의 다리 문제를 엉망으로 만든 진짜 괴물!\n내 개는 시험이 끝난 후 자신의 무릎 관절을 가지고 놀아주는 의사가 얼마나 끔찍한지 나에게 말하려고 했기 때문에 그렇게 많이 짖었습니다.','N'),(10871,871,'원장님께서 여러 전문서적을 집필하셨을 정도로 실력이 있구요~ 환자입장에서 생각을 많이하십니다~~또한 치과장비와 같은 고가장비들도 보유하고 있어서 진료에 신뢰가 갑니다~~^^','Y'),(10872,871,'가족처럼 아가들을 대해주시고 늘 따듯한 마음을 가지고 진료해 주셔요, 원장님이하 일하시는 분들이 다 좋으셔요','Y'),(10873,871,'항상 친절하시고 꼼꼼하게 진료 잘해주세요','Y'),(10874,871,'병을 잘 고치셔요','Y'),(10875,871,'솔직히 바가지 씌우는 듯한 느낌이 듬\n계속 다니시던 분들은 계속 다니시길','N'),(10876,873,'하루 아침에 아이가 아파서 급하게 원장님께 진료를 봤습니다 원인은 독성물질중독이였는데 원장님께서 제이야기를 듣고 빨리 원인을 찾아주시고 치료방향을 잘 잡아주셔서 위험한 상황까지 도달하지 않은 것 같습니다ㅠ 중간에 간,신장 수치도 매우 높게 올라가서 얼마나 아찔하던지 지금은 너무 좋아져서 아이가 밥도 잘먹고 잘걷고 하루하루 새롭게 살아가는 기분이에요. 원장님의 세심한진료덕에 아이가 빨리 나은 것 같아서 너무너무 감사드리고 저희 아이를 너무너무 예뻐해주고 ','Y'),(10877,873,'열살 막 넘은 포메 암컷인데\n갑자기 숨소리가 이상해서 다니기 시작했는데\n여기서 약물 치료하고\n많이 활발해지고 건강해진거 같아요\n근무하시는 분들도 친절하시고 병원도 쾌적해서 맘놓고 맡기고 치료받고 있습니다','Y'),(10879,157,'연륜이 있으신 원장님께서 운영하시는 소박한 병원이다. 이런저런 검사 강요하지 않으시고, 꼭 필요한 검사만 하신 후에 정확히 진단해 주셨다.  문닫는 시간에 다급히 전화를 드렸는데 친절하게 기다려 주셨고, 바로 수술을 진행해 주셔서 너무 감사했다. 여러질문에 자세히 대답해 주셨고, 비교적 정직하게 소통하시고 영업하시는 분이라는 느낌을 받았다.','Y'),(10880,157,'제일 마음에 안드는게 입구에 있는 케이지. 몇년전 추운때 내 강아지 거기에 넣어놓고 찬바람 다 맞아서 애 죽일뻔함','N'),(10881,157,'원장님은 좋아요. 미용은 비추천합니다','Y'),(10882,157,'정직하게 진료','Y'),(10883,157,'실력 최고!','Y'),(10884,875,'진짜 좋은 아파트. 입주민 스카이 라운지와 조경도 멋지게 잘되있고, 지상에 차량이 없어 공원 산책하는 기분.','Y'),(10885,875,'개포공원과 대모산이 인접한 리조트형 아파트','N'),(10886,875,'커뮤니티 시설도 너무 좋고 단지 조경도 너무너무 예쁜데.. 위치가 자주 다니기는 불편하네요 워낙 외진 곳에 있던 아파트가 재건축 된 거긴 한데 주변에 있는 게 있던가 최소한 교통은 편해야지… 처음 이사온 일주일은 좋았는데 계속 사니까 아 집은 위치가 장땡이구나..','N'),(10887,875,'이번에 입주했습니다. 개포단지중 왜 대장자리를 지키는지 알겠습니다.','Y'),(10888,875,'아주 좋네요 조용하고 학군도 좋아요~^^','Y'),(10889,876,'관리소직원들이 매우 친절해서 지내는동안 마음이 좋았고 주차장 쓰러기 버리는곳도 깨끗.그런데 알수없이 주변 오피스텔에 비해 관리비가 너무 많이와서 방뺐음','N'),(10890,876,'친절하고 깨끗해요.','Y'),(10891,876,'일층 산타스푼에 들러 아메리카노 한잔~','N'),(10892,876,'좋음','Y'),(10893,876,'깨끗한','Y'),(10894,879,'수의사 선생님 실력 좋습니다. 단, 근처 주차할 곳이 없어요. 잠시 주차하면 즉각 딱지 땝니다.','Y'),(10898,889,'강아지가 피부병 백신을 맞고 갑자기 출혈과 통증이있어서 토요일날 아침에 방문했습니다\n처음에는 피부병백신 알레르기 같다고 해서 약을 지어먹고 주사를 맞았고 다음날 방문했습니다\n근데 갑자기 악성종양으로 피부괴사가 의심된다며 생후 6개월도 안된 1.6kg아이를 다리를 절단 해야된다고 했습니다\n혈액검사 엑스레이 를 찍고 이제는 ct를 찍어야한다고 해서 다른병원도 방문하겠다고 하고 나왔습니다\n그이후 다른병원 치료후 20여일이 지난 후 아이는 다리도 절단하지않고 ','N'),(10899,889,'역대급으로 최악의 병원이네요\n진짜 돈 너무 아까워서 리뷰 남깁니다.\n\n저희 집 애기가 갑자기 몸이 좀 안좋아서 저녁에 급하게 24시 하는 병원을 알아보다 방문하게 되었습니다.\n\n애기 상태가 안좋아 보여 비싼돈 주고 야간 진료를 받은건데 남자 수의사 분이 상태 얘기는 제대로 듣지도 않고 말을 다 자르면서 자기 할 말만 하더군요.\n\n아이 보는 시늉 한번은 커녕 이게 진료인가요?ㅋㅋ\n\n수의사 면허 장식인거 같습니다.\n세상 이런 돌파리, 책임감 하나 없는 수의','N'),(10900,889,'원장님께서 항상 친절합니다. 매일 많은 강아지들 보면 피곤할법한데 웃는얼굴로 맞이해주시고 진료봐주실때도 애기가 어디 더 불편한 곳이 없나 한번 더 체크해주시고 설명도 꼼꼼히 알아듣기 쉽게 설명해주세요. 다른분들도 애기들 병원갈때 불안해 하지마시고 믿고 가시라고 리뷰남겨요','Y'),(10901,889,'먼저 원장선생님께 감사드립니다 강아지가 두마리여서 다른병원에서 수술 받았는데 너무 힘들어서해서 ㅠ ㅠ 여기로 데리오왔는데 저번 병원과 다르게 회복도 빠르고 치료도 잘되었네요 원장님도 친절 하시고 동물을 정말 좋아하는거 같아 안심이 됩니다','Y'),(10902,889,'강아지 슬개골 수술 상담을 했는데, 1시간반이라는 자세한 검진 끝에, 아주 솔직하고 담대한 결과를 얻고 돌아왔다. 강아지의 입장을 가장 고려해 주는 점이 마음에 들었고 전문성이 느껴졌다.','Y'),(10903,898,'디엠씨 주변이 변화 되려면 아직 먼듯함.이제 재계발로 아파트가 하나하나 들어서지만 주변의 필요한 식당 생필품점이 진짜 없음.건너 상암 에서 부터 배달문화(?)가 형성 되어 증산 까지옴.하루빨리 깨끗하고 정돈된 상가가 들어서야지 현재는 진짜 아님.@@','Y'),(10904,898,'역전이랑은 5분거리정도 됩니다.\n6호선,경의중앙철도\n\n인천국제공한선 은 조금 거리가 있어보이구요.\n\n역전이랑 가깝지 않다고 쓰신분은 도대체 얼마나 가깝게 사시길래.. ㅋㅋㅋㅋ','N'),(10905,898,'조용하고 쾌적해서 좋은것 같아요~ 역도 가깝고 앞으호 기대됩니다~','Y'),(10906,898,'현장인데 진행이 좀 불안요 그다지 주거환경이 좋아보이지는 않아요 역전도 가깝지 않구요','N'),(10907,898,'당첨자 평균가점 71.1 역대 최고\n좋은 분들이 많겠네요.','Y'),(10908,901,'마루 동물병원 깨끗한 분위기가 젤로 좋은 인상 을 받았습니다\n귀한 회원님들 께서도 이용하시면 좋을듯\n합니다  만사형통 행운을 기원드립니다 ~','Y'),(10909,901,'경험이 많으신 원장님께서 다른곳에서 가망없다고 받아주지 않았던 저희 아이를 정성껏 치료해주셨어요 입원했다가 지금은 통원치료중입니다,, 따뜻하게 맘으로 최선을 다하는 곳이에요','Y'),(10910,901,'아주 캐적한 동물병원이고, 원장선생님의 세심하고\n훌륭한 치료와 처방에 만족 합니다.👍','Y'),(10911,901,'일반 동물 병원과 다른점이 원장님 실럭도 그렇지만\n가격도 착하고 희귀질환 동물들 치료를 잘하세요!!','N'),(10912,901,'수의사 선생님 매우 친절하시고 꼼꼼하셔요~\n동믈에대한 애정이 깊으시네요','Y'),(10913,902,'고양이 송곳니 발치 및 구강검진 했습니다. 치과 전문 병원은 처음인데 선생님이 일일이 설명해주시면서 수술을 진행해서(수술 중간중간에 부르심ㅋㅋㅋ) 일단 신뢰가 가고 매우 세심하게 돌봐주신다는게 느껴졌습니다. 간호사 분들도 친절하시고 양치교육도 진행하는 것 같은데 체계가 좀 잘 잡혀있어 보입니다. 선생님ㅋㅋ 진짜 학교 선생님같음ㅋㅋ 요즘 이렇게 직업소명의식 투철한 의사선생님은 처음 봤네요~ 감사합니다','Y'),(10914,905,'점포 엄청 많아요 수선집 많고 먹거리도 좋아요 학원도 많아요','Y'),(10915,905,'이곳의 경비인은 예절 교육을 받아야합니다.\n6월 6일 목요일 오후 10시 50분경, 빌렸던 장비의 반납을 위해 차량을 가지고 방문했습니다. 오후 11시가 되면 건물이 닫힌다는 사실을 방문전에는 몰랐기 때문에 11시가 되어 찾아온 경비인의 나가달라는 요청을 듣고 차를 빼기로 했습니다.\n하지만 이 경비인은 출차하려는 저를 향해 처음왔다는것을 믿지 않는다고 했고 셔터문을 열어줄테니 나가달라고 이야기 했습니다. 너무나 신경질적인 말투였기에 저는 저한테 왜 그러','N'),(10916,905,'잠실새내 역 부근에서 잘 알려진 상가이다. 근처 엘스 아파트가 있어서, 유동인구가 어느정도 있는듯하다. 닭곰탕과 닭칼국수집, 칼국수 전문점, 등이  맛집으로 유명하고, 피자집, 반찬가게 도 잘 알려져 있다.','Y'),(10917,905,'라보엠헤어 다녀왔네요.\n오랫동안 다녔는데 주차도 편하고 원장님컷 맘에 들어요','Y'),(10918,905,'1층에 다양한 점포가 오밀조밀 모여있고 지하 식당엔 맛집이 있어서 골라먹는 재미가 있다ᆢ','Y'),(10919,909,'11년 키우던 강아지 말티즈인데 자궁축농증으로 염증이  모든장기에 번져서  수술도 못하고 큰병원으로   옮겼고 .다시 N동물의료센터  노원점으로 가라고 해서 바로 응급수술했고 중환자실 1주일 있었고 다시일반병실에서  있다가 퇴원해서 수액도맞고.약처방병행하며 치료하고 있고 전보다 식사잘하고 건강도 많이 좋아졌어요.(3개월)','Y'),(10920,909,'트러블이생겨 방문했는데 과별전문진료는 아니고 초임샘같은분이라... 차도가없어 결국 다른병원가서 재진료후치료 받고 있어요.\n실습대상이나 경험치를위한 대상이 되는듯한 기분인라서...매월기생충처방은 할만하다 들었는데 일년마다 종합접종은 꺼려집니다.','N'),(10921,909,'진료비가 비싼 편입니다. 피검사및 초음파 호르몬검사 받았는데 76만원 나왔어요.\n아가 몸상태는 다행히 정상수치 안에 있어서 수술은 받지 않아도 되지만, 호르몬 검사는 상세히 나오는 호르몬 검사 한번에 받으세요. 기본호르몬 검사하고 또 상세히 나오는 호르몬검사를 한번더 해보자고 합니다. 가격이20만원돈입니다. 다녀오실분들은 참고하세요. 유명한 원장님이시고 시설도 좋고 다좋은데 비용면에서는 과잉진료 있으세요. 저는 그랬습니다. 진료예약을 해도 첫진료라 선생','Y'),(10922,909,'아이를 끝까지 책임지려는 의지가 강한 주치의 선생님을 만났어요. 저희 아이는 암이 심했던 터라 결국 하늘나라로 갔지만 노원n동물병원에서 선생님을 만났던건 우리 야옹이에게 축복이었던것같아요.','Y'),(10923,909,'결혼 후 신혼집 근처로 다녀서 거의 7~8년을 다닌 병원으로 해당 병원에서 소중한 한 아이를 떠나보냈고 지금의 아이도 주기적으로 다니고 있습니다. 선생님들마다 차이는 조금 있다고 느낄 때도 있지만 제가 진료 받는 문원장님에 대함 신뢰도는 매우 높습니다. 반려견 진료라는 것이 정확하기 힘들고 사람처럼 예후를 추측하기 어렵습니다. 그래도 선생님의 성의있는 진료 태도는 반려견을 키우는 입장에서 큰 힘이 됩니다. 반려견이 아프면 그 때 알수 있을 것입니다. 비','Y'),(10924,911,'여자 강아지 여기서 중성화하고 안쪽에 봉합한 녹는 실 살 뚫고 튀어나옴 ㅡㅡ','N'),(10925,911,'이 가성비에 여기가 별로면 어딜갈까 싶어요.','N'),(10926,911,'새로운 블루오션 비급여항목 개발중이심','Y'),(10927,911,'원장님이 친절해서 좋았어요!','Y'),(10929,912,'방송에서 출연하시구요.원장샘이 넘잘해주시고요.과잉진료안해주세요.하번가시면 또 찾아가시게될거에요.무지무지 왕추천이에요.','N'),(10930,912,'친절하고 우리망고 진짜이뻐해주며 진료해주셔서 믿음이가요 진료비도 적당하구요','Y'),(10931,912,'친절하시고 자세히 설명해주시네요','Y'),(10932,912,'가격도 저렴하고 늦게까지해서 빠르게\n진료 받을수있었습니다~\n의사선생님포함 세분~  모두 친절하셨고\n급히 통화하고 달려간 저희를 안심시키고\n토해낸 뽀족한 닭뼈를 보여주시며 함께\n다행이라며 공감해주셔서 너무 감사했네요~','Y'),(10933,912,'깔끔하고 친절합니다\n설명도 잘해주시고 반려견이 안심 되게 해줍니다','Y'),(10934,916,'선생님이 참 친절하신 동물병원. 걱정되는 부분은 잘 짚어주시고, 그렇다고 과잉진료는 절대로 안하시려 애쓰시는게 느껴집니다.','Y'),(10935,916,'선생님이 친절하네요  진료비약값도 착한가격이구요','Y'),(10936,916,'수의사선생님이 꼼꼼하게 진료하시고 진료비가 적절합니다\n길아이들 진료비 할인해주셔서 아픈냥이들 병원약 먹이고 있습니다','Y'),(10937,916,'의사 쌤도 친절하시고 과잉 진료 하는거 없으시답니다','Y'),(10938,916,'선생님도 깔끔하고 친절하시고 좋았어요~','Y'),(10939,919,'서울육개장','N'),(10940,925,'원장냠 친절하시고 필요한 물품도\n살 수 있었어요','Y'),(10941,926,'여기 정말 진료 잘봐요\n가격도 너무 저렴해서 미안할정도\n과잉진료 아예 없어요\n덕분에 강아지들 안아프고 잘 키우고 있어요','Y'),(10942,926,'채혈 및 검사 너무 싸게 잘 했어요\n요즘같은 불경기에 감사합니다!!!','Y'),(10943,926,'친절하고 능숙하게 채혈 잘 해주셔서 힘들이지 않고 검진 잘 받았습니다\n감사합니다~^^','Y'),(10944,926,'약이 저렴해서 항상 와서 구매해요','Y'),(10946,927,'줄눈 계약\n줄눈TMP에서...','Y'),(10947,927,'좋아요','Y'),(10948,929,'고양이 예방접종하는데 너무 비싸요.\n주차하기는 좋습니다. 수의사 선생님 친절하십니다.','N'),(10949,929,'친절하신것 같아요','Y'),(10950,929,'저는 이 수의사를 다닌 지 10년이 넘었습니다. 그는 믿을 수 없을 정도로 친절하며 당신의 동물이 당신의 아기라는 것을 이해합니다. 그분은 그들을 동정심으로 잘 보살펴 주십니다!','Y'),(10952,930,'멋진 스튜디오가 있는 공간. sba에 서류를 보내고 심사신청에 통과하면 무료로 예약하고 사용할 수있는 스튜디오다. 장비도 무료대여가능하니 유튜브를 하거나 촬영이 필요한사람들에게 강추','Y'),(10953,930,'주차 정산 웃긴다.\n하루 종일 주차라는게 존재한다.  24시간 15,000원.\n상식적으로/ 일반적으로 그건 정산 하면 24시간 동안은 그 가격이라는 의미로 해석된다.\n운영하는 에스플렉스와 아이클라우드 파킹은 딴 세계 사람들인가보다.\n\n18시에 정산하고 길 막힐 시간이라 21시에 출차했다. 3시간 추가요금으로 9천원을 또 추가로 내야했다.\n\n사전에 그런 안내? 나중에 보니 주차정산기에 쬐그맣게 붙어있다. 매우 매우 상식 이하다.\n\n아이클라우드 파킹에 항의','N'),(10954,930,'2016년 5월 개관한 멀티 비지니스 센터 입니다.\n서울앱비즈니스센터, 앱 개발 무료 테스트베드, 스마트벤처창업학교, TBS, OGN 이스타티움 등이 있습니다.','Y'),(10955,930,'게임방송과 1인미디어의 성지','N'),(10956,930,'건물은  깨끗하고  시설은  좋으나  주차비가  비싸며 주차비는  카드결제가능.\n공연이나  팬사인회등을  이곳에서  한다면  완전히  비추함.\n무대와  관객  의자사이가 너무  멀어서  잘  보이지  않음.','N'),(10957,931,'처음엔 후지마비 증상으로 디스크 때문에 방문했습니다. 근데 검사도중 폐에 종양이 발견되어 다를 검사들과 종양제거 수술을 하게 되었습니다.\n13살 노견이라서 많이 망설였고 수술 후의 리스크가 두려워서 어떤 결정이 맞는 것인지 수천 수만번 고민을 했던거 같습니다. 이곳의 주치의 선생님을 비록해 종양쪽 원장님의 많은 설명과 도움으로 수술 결정을 하였고 지금은 입원중입니다. 그 과정에서 많이 귀찮게 해드렸고 요구사항도 많았으며 때론 눈물을 보이며 감정적이 되고','Y'),(10958,931,'1년 넘는 시간 동대문 vip와 함께 하고 있네요.\n반려견 수술부터 항암까지 진행하며 울고 웃는 순간들 마다 쌤이 함께해주고 계신데 항상 감사해요~\n여러 병원 다녀보았지만 가장 친절했고 가장 신뢰가 갔어요.\n가끔 응급으로 새벽에 찾게 되는 경우도 있었는데 그럴때도 믿고 찾게 되고요 ㅎㅎ\n남은 시간도 함께하고 싶어요!🙂','Y'),(10959,931,'Vip동물의료센터 동대문점은 항상 친절하게 잘봐주세요!! 저희 마루 안과진료갔는데 잘봐주셨답니다.\n\nBest vet clinic in the town.\nYou can trust the vets and staffs.\nLarge breeds are welcome as well :)','Y'),(10960,931,'강아지가 인대파열이 되서 걱정많았는데\n수의사분이 잘 말씀주셔서 안심되었습니다','Y'),(10961,931,'아이가 종종 아파서 매번 방문하는 병원입니다. 담당 선생님께서 잘 봐주십니다.','Y'),(10962,934,'비단 살롱 ㅡ 동물병원 성산동 &  우리 동생 동물병원 성산점\n캣맘한테 소개받은 착한 병원 세 곳 중 제일 가까운 곳으로 갔어요\n#우리동생동물병원 #성산점\n#꾹이 #가을이 #착한병원\n#비단','Y'),(10963,934,'\'우리동생\'은 \"우리동물병원사회적협동조합\"의 약자로 2015년 국내최초로 사회적협동조합 형태의 동물병원을 설립해 운영중인 비영리단체입니다.\n\n\'우리동생\'은 비영리단체이기 때문에 가장 적합한 치료를 하며, 합리적인 치료비를 받고 있어요. 여기는 견주의 입장이 아닌 반려견 입장에서 자세한 설명이 신뢰가 가더군요.\n\n조합원은 되시면, 견주를 위한 여러가지 프로그램과 봉사활동에 참여할 수 있어요. 그 프로그램 중에는 펫로스 미술치료도 있고, 반려견과 인생을 함','Y'),(10964,934,'정말 친절하고 과다진료 따위는 없는 너무나 좋은 병원입니다. 모든약값이 다 적당하다는 생각이 듭니다. 조합에 가입해야 하지만 모두 좋은일에 쓰이는거라 기분도 좋아집니다! 특히 대형견을 키우는 중이라 병원비가 걱정이었는데 좋은곳을 알게되어 너무 감사하네요 중성화 수술후 넥카라 시러 시무룩표정입니다 ^^','Y'),(10965,934,'간호사 분들 매우 친절하시고 진료실도 깔끔해서 좋았습니다. 다 좋은데, 대표원장 남자 수의사를 보고 저는 개인적으로 재방문 의사가 뚝 떨어졌어요. 좋게 말하면 성격이 시원시원하다고 할 수 있겠지만... 원래 모두한테 그렇게 대하는 건지 여성들한테 더 그러는 건지 모르겠습니다만 저는 반려동물을 기르는 한 개인으로서 이 분과 소통하며 안정감보다는 불쾌함이 들었습니다. 비가 너무 많이 와서 수술하기 귀찮다는 발언(백 번 양보해서 이건 비 많이 오는데 수술 끝','N'),(10966,934,'여자 선생님은 친절한데.. 오랜 기간 조합원으로 동네 커뮤니티 역할도 응원하고자 다른 곳 안다니고 계속 갔던 곳인데 많이 실망한 점이 있어 이제 옮깁니다.. 긴 말은 안합니다. 다른 곳 가세요.','N'),(10967,935,'선생님이 실력도 좋으시고 너무 친절하세요.  앵무새 진료하러 갔는데 좋은 선생님을 만나서 마음이 놓였어요','Y'),(10968,935,'선생님들 전부 너무좋으시고 매장?도 깨끗하고 예뻐요! 우리 기니피그도 소중하게 안아주셨어요♥','Y'),(10969,935,'소동물,특수동물 전문 추천\n진료비도 저렴하고 원장님 설명 너무 친절하시고 한꼼꼼 하심.\n선생님들 모두 친절하심','Y'),(10970,935,'원장님께서.넘.자상하게.진료해주십니다.\n우리아이.희망이가.노견에.만은병이있지만.\n원장니께서.잘치료해주신덕에.잧지내고있읍다','N'),(10971,935,'앵무새 진료 추천합니다\n급격히 몸상태가 안좋아져서 한 달 정도 병원 다녔는데 많이 나아졌어요','N'),(10972,936,'사우나,수영장, 피트니스, 탁구장, 골프연습장, 독서실,도서관,커피숍,중석식서비스,독서실, 영화관 등등 편의시설 대부분을 품은 살기 좋은 아파트','Y'),(10973,936,'배달원 관점 리뷰\n동이 15개에다 엄청 넓은데\n지하주차장 출입 불가 하는 최악의 아파트.','N'),(10974,936,'살기 정말 편해요^^ 최고급 호텔같은 커뮤니티 시설도 물론 좋지만 학군이 매우 만족스러워서 아이들이 다 공부하는 분위기라 참 좋네요. 교통이야 뭐 말할 것 없이 매우 편리합니다. 최고같아요!','Y'),(10975,936,'2024년 최고의 아파트','Y'),(10976,936,'아파트가 멋짐 동네도 좋음','Y'),(10977,940,'3차 진료불가한 간단한 진료가능한 동물병원  입니다 .','Y'),(10978,940,'바로 앞 도로에서 우연히 떨어져 있는 새끼참새를 발견했습니다. 데려갈수도 없고.. 도로에 두자니 죽을 것 같고 우연히 돌아보니 동물병원이 보여서 혹시나 해서 문열고 여쭤 보니...너무나 다정하게 봐주시겠다고 날수 있게 해보겠다고 거두어 주셨습니다. 참 마음이 따듯한 원장님이신거 같습니다.','Y'),(10979,940,'20년간 다니는 동물병원.\n나르 골절수술도 잘 치료받음','Y'),(10980,940,'최악입니다  형식적인 치료나 할줄알지   귀 중이염으로 2년을 가도 낫지를 않네요','N'),(10981,940,'정말동물을생각하는\n원장님과선생님들\n감사합니당~♡~','Y'),(10982,944,'5 년전부터 다녔는데 의사선생님이 친절하시면서 부당하게 안하시니까 넘 좋은것 같아요. 믿고 다닐수있어서  좋아요 . 다른 동물병원은 터무니없는 요금을 원하는데 진료 정확하고 진료비 착해서 최고입니다.','Y'),(10983,944,'선생님들 및 스탭들이 너무 친절하세요. 다른 병원들처럼 바가지도 없고요.','Y'),(10984,944,'엄청 친절하시고 고양이를 엄청 이뻐해주세요','Y'),(10985,944,'뱃속에 이물질 든거 잘빼내신다 들어서 갔습니다.갔다와서 싹 나았어요.','Y'),(10986,944,'깨끗하고 선생님이 친절하게진료봐주셔서 좋았어요~','Y'),(10987,949,'우리 아이 솜 십자인대 슬게골 탈구 다리 뼈 기형으로 변해 깍아내고....참  기막히고 참담하게 수술 잘 해 주셨구요 지금 회복중 입니다...입원중 솜 식사때마다 사진찍어 보내주시구 정말 고마웠습니다....저는 제 몸이  아픈데가 너무많아 정부 의료 혜택을 받고있는 기초수급자 입니다 솜이 다리를 갑자기 쓰지못하고 당황했는데 서대문구 에서  추천 해 주시고 서울시 하고 24시 샤인 동물 메디컬 병원에서 구제해 주셔서 우리아이 솜 구제 받았습니다 정말 고맙','Y'),(10988,949,'대기실도 따로있고 선생님 간호사분들 너무 친절하세요!  예민한아기 잘 케어해주셔서 고맙습니다. 앞으로도 방문예정입니다!','Y'),(10989,949,'슬개골 2기 판정을 받고 수술받고 왔어요.\n벌써 수술 후 한 달이 지났는데 울집 막내 숑이는 수술한 강아지가 맞나? 싶을 정도로 예전처럼 열심히 잘 뛰어 다니고 건강하게 지내고 있어요^^ 중성화 수술을 제외하고 이렇게 큰 수술이 처음이라 두렵고 무서웠는데 상담을 시작으로 숑이가 퇴원할때까지 꼼꼼하게 신경 써주신 모든 선생님들께 다시 한번 감사드립니다ㅜㅜ','Y'),(10990,949,'우리 아이는 담석을 제거하는 수술을 받게 됐습니다.\n\n수술 전과 비교해 아이의 상태가 많이 나빠졌음에도 6일동안 총 900만원 가량의 금액을 냈습니다. 시간이 지나도 상황은 나아지지 않았고, 남아있던 일말의 희망으로 제가 아이를 트랜스퍼하려 하자 재수술을 권하였습니다. 그렇게 우리 아이는 첫 수술에서 회복도 못한 채 재수술 후 심정지로 인해 허무하게 세상을 떠나게 되었습니다.\n\n아이는 괴로워 하는데 보호자에겐 잘 지낸다며, 문자에 모든 걸 사실대로 적지','N'),(10991,949,'병원 좋고 시설도 좋아요. 경험 많으신 분들은 정말 실력있으신 분들이에요.\n근데 경험없는 젊은 선생님들이 보호자하고 충분한 상의나 설명없이 처방을 내리네요.\n스테로이드 성분 위험해서 노련한 선생님들은 기피하는 약이고 강아지 오래키워본 분들도 강아지 관련일 종사하시는 분들도 위험하다고 절대 쓰지말라하시고 쓰면 마지막에 쓰는 거라고 다들 놀래하시는데 제가 바보같으니까 저한텐 말도 제대로 안하고 애 데려가서 스테로이드제 주사해놓고 아이 정말 고생은 다하다가 ','N'),(10992,950,'접근성은좋으나 시설이 모던하진않은 오피스텔','N'),(10993,954,'무당만 가득하고 오래된 상가들만 겨우 살아남아있던 동네가 이렇게 상전벽해 할 줄이야. 운도 따라줘서 이 동네에서 계속 자리 잡고 살고 있는게 다행이다.\n예전의 빈민촌, 산골 판자집 동네 이미지가 확 바뀌어서 세상 신기하게 다가온다.\n입지가 참 좋기도 하고 종로 인근 대규모 대형 아파트 단지는 정말 귀하긴 한 듯\n살아보면 고만고만 운좋아서 자리잡은 졸부 티나는 민도가 한계라고 느껴지는 아파트','N'),(10994,954,'재개발 천여세대 단지. 최근 신축아파트며 대단지에 속하며 서대문 내거리 대장아파트라고 본다. 영천시장 건너편 도심권아파트로서 인기 있다. 5호선, 3호선 역세권이기도 하다.\n강북삼성병원, 적십자병원, 역사문하고원, 광화문 등이 가깝다.','N'),(10995,954,'예전에 상가들어갈걸 입주민으로 잘못들어갔는데\n뭐 외부인은 호출해야들어갈수있다 들었습니디만\n주차요원분들이 그냥 들여보내주길래 상가겸용인줄알았음\n코로나 백신맞느라 40분가량 있었는데 8만원인가 10만원인가 청구해주심\n\n부당이득으로 인해 청구대상에 해당하지만\n주차요금 관련하여 고지를 안한점 당시 상가/입주민 주차장 안내문 부착이 없었던점\n설령 미리 고지받았다고 하더라도 금액산정근거가 말도 안되는 수준이라 판례 법령 무엇을 근거로 하든 만에 하나 무효는 아니여','N'),(10996,954,'조용하고 좋다','Y'),(10997,954,'대단지~!! 서울 중심 한복판 좋아요^^','Y'),(10998,325,'믿음을 주는 동물병원입니다. 반려동물을 진정 사랑하시는 맘이 느껴지고 군더더기 없이 치료해 주십니다. 감사합니다.','Y'),(10999,325,'원장님과 간호사분이 친절하시고\n설명을 잘해주십니다. 감사합니다','Y'),(11000,325,'넘 자상하시고 섬세하게 아가들을 진심으로 대하는 원장님 최고의 수의사십니다~','Y'),(11001,325,'시설은 오래되어 보이지만 친절히 잘봐주셨어여','Y'),(11002,325,'굉장히 친절하시고 잘 설명 해주심','Y'),(11003,956,'으휴.... 못 자르고 울 강아지 털 뭉쳤다면서 짜증 있는대로 내고 민망해죽는줄알았네