,1088,'신내프라디움  메가커피..진심   깨끗해요.\n실내  좌석도  굿뜨...음료도 굿','Y'),(11108,1088,'멋진 고층 건물~','Y'),(11109,1088,'오피스텔 과 찾는데 구분하기힘듬','N'),(11110,1088,'업무방문,  상가 공실이 많네요','N'),(11111,1088,'집사러 왔는데 대출 알아봐야겠네ㅋ','Y'),(11112,1089,'질문에 차근차근 설명해주시는 선생님이세요. 유기견을 입양하셨고 아이를 꼼꼼히 살펴주세요. 과잉진료하지 않으시고 접종하러가면 기본관리로 발톱도 깎아주고 항문낭도 봐주시고 귀도 소독해줘요.\n아쉬운건 하나 주차공간이 협소해요','Y'),(11113,1089,'선생님의 진정성이 느껴졌어요.아이를 사랑으로 진료하시더라구요.ㅌㄴ동물병원보다 진료비도 싸고 비치해놓은 사료도 많이 싸고 ㅌㄴ은 바이입니다. 시진을 연예인들 사인 해놓은것밖에 못찍었어요','Y'),(11114,1089,'저희강아지 애기때 우연히 검색해서 다니게된 첫병원인데요 요즘 입소문이났는지 원장님 진료받으려면 대기시간이 길어져서 좀 아쉽지만ㅜㅜ 원장선생님 진짜친절하시고 동물을 진짜 사랑하시는 마음이 느껴진다고해야할까 제가초보견주라 궁금한거 갈때마다 질문을하면  항상 1가지 질문에 10가지씩답변주세요ㅜㅜ 너무도움많이되고 여기밖에 안가봐서 병원이 어떤지 좀 검색해보면 진료비 거품없어 좋다고하시더라구요 암튼 전 너무만족해서 이사가서도 다닐려고하고 생각중이에요ㅋㅋ','Y'),(11115,1089,'간호사님도 친절하시구 무엇보다 의사선생님이 진심으로 생명을  존중해서 진료하시는것보구 ㅂ감동받았어요 진료비도 과잉진료가없어서 저렴해서 조았어요','Y'),(11116,1089,'오늘 처음 가봐서 치료를 잘 하는지는 아직 모르구요, 한시간정도 기다렸다 진료봤는데 의사샘도 직원들도 모두 친절하고 좋았어요','Y'),(11117,1094,'직원분들 친절하고 가격도 적당하다.\n우리집 멍멍이가 좋아하는 병원','Y'),(11118,1094,'과잉진료비없고.친절한 진료는 최고이고요 ..흠이 있다면 넘 자세한 진료를 해주시다보니 예약시간을 넘길때가 많아요.그것이 약간 불만 입니다','Y'),(11119,1094,'강아지 백신 맞추러갔는데, 예상했던것보다 매우 불친절하고, 성의없었음. 이제 1주일 조금 지났는데, 아직도 주사 맞은곳 뭉쳐있음. 다른병원이 훨씬 나음','N'),(11120,1094,'정말 훌륭한 병원입니다. 다른 병원에서는 진료 5분~10분으로 끝나고 설명도 짧은데 여기 원장님은 20분 가량 자세히 설명해주시고 꼼꼼하게 봐주십니다. 정말 감사합니다.','Y'),(11121,1094,'베들링턴견주입니다.\n강사모 추천으로 이곳을 다니다 이사를 하게되어 건 일년을 다른병원을 다니게 되었는데  다시  좀 멀어도 이곳을 찾게되네요~ 원장님 너무 진료 잘보십니다\n친절 하시고 무엇보다  아가들을 사랑 하심이 느껴집니다\n과잉 진료 없으시고ᆢ\n진료 마치고 오는길  저희 신랑 칭찬이 끊이질않네요ㅋㅋ','Y'),(11122,1097,'내 아기 둘이 이곳을 통해 무지개다리 건넜어요\n원장선생님께서 융통성있게 친절하십니다\n보통 장 자 붙은 분들과 아주 다르세요\n그리고 아이들을 치료하는 시설이 따로 있어요\n물과 함께 놀이를 하며 치료하는 곳인데 그냥보면 강아지들을 위한 목욕탕(??) 또는 찜질방 같은 곳이에요\n그리고큰 강아지들을 목욕시키는 시설이 따로 있어요','N'),(11123,1097,'강아지 눈물이 워낙 많이나서 누관시술했는데 누관시술하고나니 눈물이 덜 나오네요 근데 비용이 만만찮게 드네요;;뭐든 다 비용 계산되서 나오니 역시 동물병원이라 병원비가 비싸긴하네요','N'),(11124,1097,'방광 결석 수술 80만원대라고 다른 병원에 물어본 금액보다 수용가능한 선이라 여기서 결정하고 검사 했더니 말이 달라짐.\n12살 노견 강아지 건강 생각하면 이런저런 검사 추가로 더 해야 한다며 계속 안정성, 건강 들먹이면서 검사 추가로 권함.\n그로인해 현재 거의 150만 넘게 들은듯.\n이미 검사하고 수술까지 한 후라 다른 곳으로 옮길 수 없어 울며 겨자먹기로 다니고 있는데 후회 막심.\n방광에 카테터(오줌 줄)도 달고 있는데 일주일이면 된다면서 매일 소독,','Y'),(11125,1097,'기본접종 받으러 가도 뭔가 추가되는게 많음.챙겨주시는 건지 덮어쓰는 건지 헷갈리는데 추가되는 것에 대한 금액에 사전고지가 없어 덮어 쓰는 느낌이  있음, 그래도 친절하심.','N'),(11126,1097,'간단한수술정도를할수있는동물병원입니다\n강아지가열살이넘어가니가끔갈일이생기네요','Y'),(11128,1112,'1. 층간소음 미쳐버림 (쿵쿵쿵 대면 전등과 창문이 흔들림)\n2. 주위 소방서있음.. ..싸이렌소리 가깝게 매일남.\n(주위 5개 차로---- 사고나면 밤새 사이렌 소리나고, 자동차 소음, 먼지..\n거지 같은 곳 하루 빨리 벗어나고 싶음','N'),(11129,1112,'최고의 입지 입니다..북부간선 내부순환로 교착점이고 생활권이 최고 교통이며 지하에 6호선 지하철','Y'),(11130,1112,'화장실이 더러워요','N'),(11131,1112,'ㅋㅋ','Y'),(11132,1112,'KIST 유학생들이 일상적으로 쇼핑할 수 있는 최고의 장소입니다.','Y'),(11134,1119,'선생님 친절합니다\n중성화수술 성북구에서 제일 저렴한듯.\n저렴하게 잘했습니다.','Y'),(11135,1119,'수의사쌤이 냥냥이 키우시는데 친절하시고 TMI셔요 ㅎㅎ','Y'),(11137,1120,'들어가자마자 짐승?들의 냄새가..ㅎㅎㅎ 강아지 열마리이상이니 넘나 당연하쥬?\n공기중 털도 당연히 날리겠쥬?\n아이들이 넘나신나하니 별수있것슈?\n키우기 엄두가안나고 순한 강아지들 보고싶을때 가서 봐야지 뭐 어쩌겠슈.\n실내와 실외를 잇는 문열고닫을때 아이들 주의를 엄하게 꼭주시고 이쁜 강아지아이들과 좋은추억쌓으세요.','Y'),(11138,1120,'강아지들 너무 순하고 사장님도 친절하세요 ㅎㅎ 멈무들 간식 서비스 감사합니당~~🐶🐶 다음에 또 갈게요','Y'),(11139,1120,'강아지들이 교육이잘되어있어요','Y'),(11140,1120,'강아지 좋아해서 가봤는데 사장님도 친절하시고 강아지들도 너무 귀여웠어요!! 강아지들이 케어 잘 받은 느낌이네요 나중에 저도 강아지키우게되면 꼭 여기로 맡기고싶어요','Y'),(11141,1120,'강아지 없이 가도 강아지가 많은거 넘 좋은듯  상주견 3마리 빼고 유치원 다니는 애기들이라는데 유치원 다닌다는 말이 왜케 귀여운지ㅠㅠ 대형견 보기 쉽지 않은데 상주견 두마리가 대형견이구 애들이 덩치에 비해 넘 순해서 키우고 싶은 욕구 뿜뿜🥰  직원분이랑 사장님도 다 착하심요🤭 담에 또 놀러갈께욜~','Y'),(11146,1146,'4년째 다니고 있는데 늘 친절히 설명도 잘해주시고 아이들 많이 예뻐해주셔서 항상 고마운 마음이예요 :) 주변에 이런 병원이 있어 정말 좋아요 ^^','Y'),(11147,1146,'의사선생님이 정말 친절하시고 진료도 잘 봐주십니다. 진료 내용을 카톡으로 상세히 다시 보내주십니다. 진료비도 거품 없이 필요한 부분만 진행해주시고.. 거리가 좀 있는데도 불구하고 근처 동물병원이 아닌 여기로 계속 다니게 되네요 ^^ 앞으로도 번창하시길 바랍니다.','Y'),(11148,1146,'동물병원에 사람이 많네요. 요미독에서 강아지 분양받았는데 제휴병원이라 좀 싸게 수술비용 적용받았어요. 기존 제휴병원보다 깨끗하네요. 현재까지는 좋아요. 좀더 다녀보고 추가로 의견 적어볼게요.','Y'),(11149,1146,'미용가격이 다는곳보다 오천원이 싸고 강아지를 커이지에 가두지 않음','N'),(11150,1146,'대부분의 수의사선생님들은 진료실에서 접종이나 기타 처치를 해주시는데 이곳은 반려견만 데리고 갔다가 다시 돌려준다.\n너무 친절하지만 치료과정을 지켜볼 수 없다는게 가장 큰 단점.','N'),(11151,65,'친절한 상담 감사드려요 24시간 동물병원이 집주변에 있어서 마음이 놓이네요','Y'),(11152,65,'과잉 진료와 미흡하고 미숙한 진료. 이곳에서 고양이가 무지개 다리 건넘','N'),(11153,1156,'새건물이라서 멋있고 전망좋음~^^\n시티랑 오피스텔 구분 잘 해야함','Y'),(11154,1156,'아직 비어있는 상가는 좀 있지만.. 그래도 건물은 잘 지었어요. 여름에 엄청 시원합니다.\n주차장입출구가 넘 좁은건 아쉬워요.','Y'),(11155,1156,'서울 동북부에 멋있게 지어진 복합형 문화공간 겸 업무시설','Y'),(11156,1156,'모임이 있어서 방문을 했는데 빌딩에 입주한 가게를 찾기가 조금 어렵습니다','N'),(11157,1156,'친구들과 점심식사 후 커피와 디저트 먹고 즐거운시간 보내고 왔어요','Y'),(11158,1160,'✅ 방문 전 전화예약 필수\n✅ 친절한 응대. 고양이 룸이 깨끗하게 잘 관리되어 있다.','Y'),(11161,1178,'지하 1층에 영화관 및 푸트코드 있습니다.\n1층 주차장 정산소에서 영화티켓 제시하면 주차 3시간 무료로 해줍니다','Y'),(11162,1178,'건영옴니백화점 2층 상일가구점\n절대 저렴하지 않았습니다.\n\n구입당시때와 구입후의 사장님 대우는 불친절하고 고객에 대한 예의 없다.\n할인해 주는척 하면서 (급해 어쩔수없이)\n나참,  불량인쇼파를 교환했는데 불량쇼파를 보내주셨네요.\n제대로된 하나도 없고 테이블 구입시에는 대리석이라더니 다른점 가격비교후 전화문의 드렸더니 세라믹이라네요. 모두다 상태가 엉망이고 너무 속상해 죽겠네요.\n\n쇼파의 바느질 상태도 엉망이고 이런물건들을 판매한다는건 최악이다.\n별하나도','N'),(11163,1178,'오래 됐는데  지하 마트 저렴해서  장보기 좋아요','Y'),(11164,1178,'오래되었지만 관리가 잘 되어서 주차도 편했구요. 키즈카페 영화관이 있어서 아이와 자주 가요','Y'),(11165,1178,'예식장 이용..식장이 조화와 생화를 잘 섞어놔서 화려하니 이쁨..\n음식맛도 굳~~~','Y'),(11166,1180,'그냥 그래 오랴 됐오','N'),(11167,1180,'👍','N'),(11169,1190,'강아지 까페인데 유치원으로 놀러오는 강아지들이 많아서 즐거운 시간을 보내기가 좋습니다.\n\n이쁘게 생긴 코카스파니엘은 랑이인데 식탐이 엄청 강해요.\n\n달이는 조용한데 할줄 아는게 많고 영리해요.\n(무지개 다리를 건넜어요. 😭 😢 )\n\n재밌어요. 한번 방문해보세요.\n차를 인당 한잔씩 시키면 두시간 즐거운 힐링 시간이 됩니다.','Y'),(11170,1190,'추석여행으로 다른곳보다 넓은 호텔방이라서 호텔링맡기고있는데 여행내내 계속사진을 보내주시고 깔끔하게 관리되는것같아 맘에들어요.\n맡기기전 아이들과 까페 방문했었는데 강아지들도 좋아보이고 까페온 사람하고도 잘어울리게 관리합니다~뭉치맘^^','Y'),(11171,1190,'초딩 아이랑가서 평소보다 조금더 신경이 쓰인것빼곤 괜찮았어요. 여러마리의 개들이 한데\n섞여있어서 정신이 좀 없긴했지만 각양각색의 멍멍이들을 만나보는 재미가있었습니다. 직원2분이서 식사 한번 편히 못하며 개들을 케어하고있었고 마킹이나 배변시 순식간에 치워주셨어요. 규칙안내해주시고 그 규칙안에서는 자유롭게 개들과 어울릴수있도록 자유로운 분위기였습니다. 음료값이 세긴했지만 따로 입장료나 시간제한이 없었어요. 강아지들 관리도 잘돼있었는데 비치된 담요는 교체가 ','Y'),(11172,1190,'강아지가 많은건 좋은데 제가 갔을땐 큰 개들이 너무 많아서 무서웠었고, 음료 값이 너무 비싸요ㅜㅜ','N'),(11173,1190,'사장님이 친절하십니다. 방 크기도 커서 타석 뒤쪽으로 지나다녀도 불편함이 전혀없네요. 주차도 편하고 좋아요!\n계란이랑 식혜도 서비스로 주시고 음식은 배달시켜서 먹어도됩니다.','Y'),(11174,538,'미용하시는여성분이 예의가없으신거같네요','Y'),(11175,538,'선생님 찬절하시고 좋아요','Y'),(11176,538,'가까워서 다니고있어요','N'),(11179,898,'디엠씨 주변이 변화 되려면 아직 먼듯함.이제 재계발로 아파트가 하나하나 들어서지만 주변의 필요한 식당 생필품점이 진짜 없음.건너 상암 에서 부터 배달문화(?)가 형성 되어 증산 까지옴.하루빨리 깨끗하고 정돈된 상가가 들어서야지 현재는 진짜 아님.@@','Y'),(11180,898,'역전이랑은 5분거리정도 됩니다.\n6호선,경의중앙철도\n\n인천국제공한선 은 조금 거리가 있어보이구요.\n\n역전이랑 가깝지 않다고 쓰신분은 도대체 얼마나 가깝게 사시길래.. ㅋㅋㅋㅋ','N'),(11181,898,'조용하고 쾌적해서 좋은것 같아요~ 역도 가깝고 앞으호 기대됩니다~','Y'),(11182,898,'현장인데 진행이 좀 불안요 그다지 주거환경이 좋아보이지는 않아요 역전도 가깝지 않구요','N'),(11183,898,'당첨자 평균가점 71.1 역대 최고\n좋은 분들이 많겠네요.','Y'),(11185,1264,'직원들 매우 친절하고 모두 반려동물을 아끼는게 눈에보임','Y'),(11186,1264,'좋아요','Y'),(11187,1266,'음료는 평균 1.1만원대\n대형강아지가 많아 신선한경험이었습니다.\n의자는 벽쪽에밖에 없습니다\n생각보다 매장내 냄새는 나지않았고\n새로운손님이 입장할때마다 강아지들이 문쪽으로 달려나가고 짖어서 시끄럽긴합니다\n하지만 그래도 다시가고싶을정도로 좋았습니다','Y'),(11188,1266,'일단 가격은 네이버에 표시해둔거랑 다름...;; 아이스티 대략 만원정도 한다길래 갔더니 만 이천원... 에바였다. 더군다나 냄새가 진짜 개에바임. 강아지들 목욕 잘 안해주는 건지 잘 모르겠지만 진짜 개에바임... 환기 몇 분 하다가 바로 닫고... 그리고 강아지들 부를 때 막 소리지름. 야!!!! 이러고... 친구 생일 기념으로 간건데 진짜 너무 에바였음. 그리고 강아지들 싸우고 난리도 아니였음. 갈거면 여기 말고 겨울이머무는집으로 가셈.','N'),(11189,1266,'대형견들이 많은곳이라 맘껏 만지고, 귀여워해주며, 시간을 보낼수 있는곳이라 좋습니다. 다만 직원분들이 견들에게 이름을 많이 불러주고, 교육을 잘 시켜주셨으면 좋겠습니다. 아무리 견이라고해서 욕하고 그러는건 아닌거 같습니다. 특히 손님들이 있어도 소리지르며 머리때리고(꿀밤식으로)  욕하고, 야 야하고...  손님입장에선 굉장히 불편하고, 있는내내 직원 눈치보는 시간이 되는거 같아 많이 불편했습니다. 모두 다는 아니여도 두어마리 견들이라도 손님들에게 친절하','N'),(11190,1266,'최악입니다! 평점1점 잘 안주는데 평점1점도 아까운곳임. 일단 남자 사장이 최악임. 점심쯤에 갔는데 손님 1도 없었고 차 2잔 주문했는데 사장이 직원한테 음료 넘겨줄때도 음료! 이딴씩으로 짜증섞인 큰목소리로 말하고 음료 주고 나서 손님 우리밖에 없는데 매출 안나온다고 궁시렁 차가 많이 팔리는 날은 매출안나온다고 ㅇㅈㄹ.  청소도 안하는지 냄새 ㅈㄴ 역함. 반려견들도 냄새심하고 사장이 반려견들한테 어떻게 하는지 모르겠지만 ㅈㄴ상태 안좋아보이고 불쌍해보였음','N'),(11191,1266,'강아지들이 쉴곳이 없어보여서 안타까웠습니다. 대형견 여러마리가 한곳에 있는데 스트레스 받지는 않을지 걱정도 되었구요.\n하지만 정말 아이들이 순하고 애교가 많았어요. 싸우지도 않고 서로 사이가 좋아보였습니다.\n\n처음에 들어갈 때 애기들이 많이 짖는데, 위협적인 행동이 아니고 반기는 것이니 놀라지 마세요.','N'),(11192,1277,'특히나 엉덩이쪽 털이 정리가 잘 안되서 고민이었는데 시원하게 밀기로 결정을 했어요. 그래도 셀티의 특징은 남기자 싶어 머리는 사자컷으로!!! 역시나 셀티 사자컷 맛집이네요ㅎㅎ','Y'),(11193,1277,'미용을 맡겼는데 꼼꼼하게 신경써 주셔서 감동했습니다','Y'),(11200,1300,'조경이 아름답고 지하주차장이 폐쇄적이지 않아서 쾌적합니다. 치킨 피자를 포장주문하면 식기전에 먹을 수 있어요.','Y'),(11201,1300,'갈산공원과 갈산옆 목동파크자이 산책하기 좋은 곳','Y'),(11202,1300,'아파트내 놀이터가 잘되어 있어요 뒤로 갈산공원이 있어 환경도 좋아요','Y'),(11203,1300,'아파트 뒤 공원이 있어 산책하기 좋고 주거지로서 최고의 아파트 입니다','Y'),(11204,1300,'칼산을 전경으로 사계절을 베란다에서 즐길 수 있는 아파트입니다','Y'),(11205,1306,'빵이 여러가지 이고 맛도 제가40년 넘개\n다녔는데 한결 같이 맛있고 사장님도 매우 친절 하셔요. 번창 하셔요♥♥♥','Y'),(11206,1308,'생각외로 넓지 않습니다\n공원내 식물원 방문 하시면 좋을 듯 합니다\n공원 내 예쁜 꽃들 많으니 연인들끼리 사진 많이 찍으세요','N'),(11207,1308,'마곡나루에 있는 오피스텔은 너무 시끄럽습니다.\n주상복합이라 1층과 2층에 상가들이 있는데 장사가 안되면 접고 다른 가게가 들어서니 거의 매번 인테리어 공사 소음에 시달립니다. 아침에 글라인더 소리에 잠이 깰 정도에요. 또 주변에 술집들이 있어서 양아치들이 많은편이에요 특히 금요일 토요일에 이곳으로 많이 모입니다. 건물 내부는 인근 오피스텔중 가장 넓고 좋습니다.','Y'),(11208,1308,'지하철 역에서 지상으로 나가기 좋은 곳','N'),(11209,1308,'산책하기 좋은 동네입니다.','Y'),(11210,1308,'공원이 넓어서 운동하는 사람들이 많습니다.','Y'),(11213,1314,'우장산역과 마곡역에서 접근성이 좋고 단지가 깨끗하고 조용해서 살기에 쾌적한 아파요 단지입니다','Y'),(11214,1314,'조용한 아파트에요. 주위에 있을거 다있습니다.','Y'),(11215,1314,'살기 좋은 곳','Y'),(11216,1314,'경비들이 별로임','N'),(11218,1326,'시설 좋고 부담없는 숙박비','Y'),(11219,1326,'친절해요!','Y'),(11224,1334,'최악의 건물. 지하7층까지 주차장인데 임차인들한테 1대 주차 제공안하고 주변 공사장 인부들한테 유료주차로 다 채움. 2년 사용하고 마곡 다른곳으로 왔는데 천국임 ㅋㅋㅋ 참고로 출퇴근 시간 바로 앞 사거리 차가 사방팔방 너무 많아 헬게이트니까 들어오려는 분들 잘 알아보세요. 지하7층까지 있어 엘레베이터도 헬게이트임 2대가 있는데 홀짝층으로 운행하니까 시간 널널한분들은 충분히 기다리면서 업무도 볼 수 있음','N'),(11225,1334,'둘러보기 좋아요','Y'),(11229,680,'서울시 강서구 방화동 신방화역 사거리에 있는 24시간 동물병원. 총6분의 선생님이 있으며, 매일 당직의사분이 대기중인곳. 주차장도 있고, 2층에누 진료실과 수술실이 있음. 진료비와 약제비 등은 다소 비싼느낌이지만 꼼꼼하게 챙겨주는 모습에 믿음은 가는 병원.','N'),(11230,680,'3세 남아 푸들 중성화수술 하러 갔는데 원장님께서 친절히 꼼꼼하게 상담설명 잘 해주셔서 이해하기도편했고 안심하고 수술시킬수 있게 믿음이 갔네요 병원도 깔끔하고 미용도 같이 맡겼는데 후차에 미용과수술후 사진 함께 올려볼께요...','Y'),(11231,680,'원장선생님 두 분 다 친절하시고,미용실장님 간호사분들 모두 너뮤 좋아요! 저희 강아지들 갈 때마다 반겨주시고 무엇보다 과잉진료다 없어요!!!!!','Y'),(11232,680,'선생님들도 좋아요 한유나쌤 설명도 굿 친절도 굿 마스크넘어로 미모도 굿^^','Y'),(11233,680,'시설이 좋아서 비싼줄 알았는데 가격이 비슷하네요\n그래서 더 좋았어요','Y'),(11235,666,'진료선생님 왕친절, 설명도 잘해주시고 너무 좋아요.\n저희집 고야이 동물병원 여러군데 가봤지만 믿고 맡길데가 없어 두번이상 방문한 곳은 없었는데 올스타로 정착할듯','Y'),(11236,666,'시설 깔끔하고 진료도 불필요한것 없이 잘 봐주십니다. 선생님은 괜찮다고 하시는데 제가 겁나서 검사한적이 몇번 있네요ㅋㅋ 그렇다고 또 대충 보시거나 검사를 안하시는편은 아니에요. 앞의 강아지가 많이 아파서 검사할게 많았는지 거의 한시간 기다린적도 있거든요. 심장사상충약은 6개월치 한번에 사면 하나 더 주시구 제품 구매금액 적립도 됩니다.','Y'),(11237,666,'우리 슈가 자궁축농증으로 수술하기전에 수액 맞는 모습인데...잘 됐음 좋겠습니다.','Y'),(11238,666,'365일 진료  짱이예요','Y'),(11239,666,'여기 꾸준히 약 받아가고 있음\n괜찮은 곳','Y'),(11243,1363,'별로예요','N'),(11244,1365,'지하철 9호선 라인인 양천향교역이 가까워서\n흔히 말하는 역세권인 휴먼빌아파트.\n농협도 건너면 바로 있고 왠만한 먹을거리는 가까이서 먹기엔 좋은듯 합니다\n허나 후문인지는 모르겠지만 사생활이 조금 노출 되어 거주 시민분들중 사생활이 중요시 하시거나 예민 하시는 분들은 4년마다 특정시기에 약간 스트레스 받을 우려가 있기 때문에 조금 아쉬울수 있다고 판단 됩니다\n그외에는 특별히 시끄러울만한 것은 사거리라 사고소리도 근접하게 느껴질 것이란 생각도 들기는 합니다','N'),(11245,1365,'지하철역 입출구 가까이에 아파트 입출구가 있어서 이용하기에 편해요.','Y'),(11246,1365,'지하철 입구에서 바로 아파트 후문이 있어서 좋다','Y'),(11248,1374,'선생님들이 너무 친철하고 진료도 잘 보셔요\n우리 애기가 입원했었는데 인스타그램으로 상황들을 친절이 상담해주시네요','Y'),(11249,1374,'수의사샘,간호사샘 모두 친절하시고 자세하게 설명해주셔서 좋아요👍','Y'),(11251,1376,'굿','Y'),(11252,1376,'고양이를 하루나 이틀 동안 머물 수 있는 깨끗하고 조용한 장소입니다. 이사하는 날 애비를 여기에 두었는데 잘 대처한 것 같습니다. 고양이 방에는 라이브 캠이 있어서 고양이 친구의 상태를 연중무휴 24시간 확인할 수 있고, 방에는 양방향 사운드 시스템도 있어서 들을 수도 있습니다. 그녀가 그곳에서 보낸 2박 동안 확실히 내 마음이 편안해졌습니다.','Y'),(11253,1376,'나는 여행할 때마다 고양이를 여기에 키운다. 그들은 며칠에 한 번씩 나에게 그의 사진을 보내주고 방에 CCTV 캠이 있기 때문에 앱으로 그를 볼 수 있습니다. 올라가서 놀 수 있는 공간이 있는 멋진 큰 방도 있습니다.','Y'),(11254,1389,'몇일전에 갔는데 가성비도 진짜 엄청 좋아요 고양이 막 보고 만지고 에다가 음료수 까지 8천원인데..;; 안가시 겠어요?!','Y'),(11255,1389,'처음으로 고양이 카페를 방문했는데 이곳의 고양이들은 야생에서 구조된 길 잃은 고양이들이고, 스트레스를 받고, 더럽고, 귀와 눈의 일부가 없어졌기 때문에 공포증을 느꼈습니다. 그리고 가장 중요한 것은 그들이 만지는 것을 원하지 않는다는 것입니다. 익숙해지면 등을 돌리고 만질 수 있게 해줄 것입니다. 하지만 그게 전부입니다. 손톱이 다듬어지지 않아 긁히거나 감염/질병에 걸릴 위험이 있습니다. 문을 열자마자 풍기는 지독한 악취에 머리가 몹시 아팠습니다. 전반','N'),(11257,64,'원장님이 안과진료를 잘보시고 왠만한 2차병원 이상으로 안과검사기계를 구비하고 있습니다.\n뭔가 수술과 치료에 오타쿠스러운 의욕을 병원에서 느꼈고 눈 질환도 정말 좋아졌습니다.\n다만 원장님이 너무 바쁘신데 아래 직원분들은 일을 잘 안하는 느낌을 받아 아쉬웠어요\n하지만 근골격계 수술, 눈질환은 무조건 찾아갈것 같아요','Y'),(11258,64,'난이도가 있는 간종양 수술이었는데 원장님께서 잘 끝내주셨습니다. 노견이라 고민 많이 했는데 긴 상담시간동안 믿음을 주셔서 결정할 수 있었어요. 남은 항암치료도 아이가 잘 버텨줬으면 좋겠어요.','Y'),(11259,64,'의료진 수준이 높고 정성을 다하려는 모습이 확연합니다. 요로결석 수술로 울아들인 포메 입원 시켰는데 안심하고 맡길 수 있었어요. 안과진료도 전문적으로 하는 것으로 보입니다. 주치의 있는 집 앞 병원에서 십분 드라이브 거리에 있는 이곳으로 옮길 예정입니다','Y'),(11260,64,'저희집 노견이 녹내장 수술한 병원입니다. 확실히 앞을 잘 보는 것 같고 걸을 때도 덜 불편해 보입니다. 안과전문병원이라고 추천 받고 내원했는데 확실히 전문성을 갖춘 병원 같습니다.','Y'),(11261,64,'리뷰 정보\n우리아이가 아파 검색해서 급하게 응급실을 찾아간게 이병원과의 첫 인연이었습니다. 원장님, 정말 진심으로 소중하게 아이들 보살펴주시고요 돈만 밝히던 다른병원들과는 비교가 불과할 정도로 금전적인 부분이 아닌 아이들 회복에만 힘쓰십니다.','N'),(11262,1395,'애교많고 귀염뽀짝 멍멍이들이 있어요\n친절한 주인아저씨도 있구요\n바로바로 응가도치워주시고 편안하고 댕댕이들 뛰어놀기.넓은장소로 자주 이용할것같아요\n또 놀러갈께용','Y'),(11263,1395,'지하라서 고민하다 가까워서 갔음\n큰개 두마리와 소형견 네마리가 주인분이 기르는듯 했고 개들은 다 순했다\n사장님도 친절하셨고 입장료도 저렴한 듯\n성인 8천 초등5천원에 캔음료나 캔커피가 포함됨\n음료제조는 안하시는 듯\n시설은..\n벤치의 상태는 꽝이었음..\n개냄새가 안나고 강한향이 났는데 세제냄새인건지 방향제 인건지..\n초딩들과 갔는데 아이들은 개에게 빠졌고\n두시간가까이 있다 온 듯\n시간제한은 없어보임','N'),(11264,1395,'남자분이 친절하셨다. 바닥은 좀 갈라졌지만 강아지가 좋아해서 가끔 가고 음료는 개선했으면 좋겠다. 캔음료만 있어서 아쉽다.','Y'),(11265,1395,'사람이 화장실갔다고 조금만 기다려달라고 적혀있는데 전화도 안받고 화장실을 차를 타고 갔다오셨나봐요? ㅎㅎ 들어가보지도 못했네요','N'),(11266,1395,'강아지들과 함께 놀수있어 좋고 시설이 깨끗해서 좋다','Y'),(11267,1396,'의사선생님들 너무 친절하세요. 과잉진료도없으시고 의료비도 사전에 너무나 잘 상담해주시고요. 무엇보다 동물들도 너무 이뻐하시는게 보여서 신뢰가 가요','Y'),(11268,1396,'대표 원장님 너무 친절하시고 잘 설명히니주십니다. 저보다 더 진료비 많이 나올까봐 걱정해주시고, 과잉진료 없어서 너무 좋아요','Y'),(11269,1396,'깔끔하고 밝은 분위기, 친절한 선생님과 직원들, 24시간 운영이라 응급상황에서도 대처하기 용이함','Y'),(11270,1396,'제 고양이 봐주신 선생님은 젊으셔서 그런지 상황에 따른 전문가의 소견으로 적절한 조치를 취해주기 보다는 FM 대로 처치/발생가능한 부작용을 읊고 선택하라는 식이어서 별로였네요. 초진비 9900원입니다. 병원 자체는 깨끗한거 같아요.','N'),(11271,1396,'언제나 친절합니다. 앞에 주차 2~3대 정도 가능한 것 같고, 2층? 복층? 쪽에 미용하는 모습을 볼 수 있습니다. 진료실은 4개정도 있고, 고양이 입원실과 호텔이 있습니다.','Y'),(11272,1400,'항상친절하고 저희라떼도행복하게잘있네요~♡','Y'),(11273,1400,'울집 대가족 냥이들 1년에 한번씩 방문하는곳입니다.\n매번 발톱정리 이쁘게해주셔 감사합니다.','Y'),(11274,1400,'모두들 친절하고 좋으세여','Y'),(11275,1400,'의사선생님 너무 친절하시고, 간호사선생님분들도 정말 친절했어요.\n애가 배에 가스가 차서 급하게 병원에 갔는데 설명도 잘해주시고 응급처치도 잘해주셔서 정말 감사했습니다.^-^~','Y'),(11276,1400,'선생님들이 친절하고 무엇보다 가격이 투명해서 좋아요','Y'),(11277,1403,'오래됬지만 살기 좋음','Y'),(11278,1403,'거주지 임','N'),(11281,1405,'문래역 4번 출구 근처라 역세권이며 살기 좋은 아파트입니다.','N'),(11282,1405,'문래역, 영등포구청역, 홈플러스, 타임스퀘어, 양화중, 문래초 가깝습니다.','N'),(11283,1405,'존맛이에요!','Y'),(11289,1417,'친절하고 선생님이 진심입니다\n다른병원보다 병원비도 착해요','Y'),(11290,1417,'전 솔직히 별로였습니다. 필요한 혈액검사 항목수가 적어 다른데선 5만원이면 할 검사를 어떤 생각에서 인지는 모르겠지만 계속 우기셔서 전체검사로 10만원을 굳이 받으시더군요\n설명도 많이 안해주셔서 고객입장에선 호구잡힌다는 생각밖엔 안들었네요.\n완고하신거랑 실력이 비례하는지는 잘 모르겠는데 저랑은 안맞네요.','N'),(11291,1417,'반려견을  키우니까 당연히 동물 병원을 자주 이용한다 여기는 솔직히 고양이 전문 병원이라 그런지 강아지를 키우는 나는 그냥 일반 동물 병원과 별반 차이를 못느낀다 직원들이 친절하다 머 그정도? 그런데 그건 당연한건데','N'),(11292,1417,'너무 잘 봐주시고 치료도 잘해주세요\n좋은일 많이 하는 유석동물병원이예요 최고최고!','Y'),(11293,1417,'의사선생님이 성의껏 진찰해주시는 게 느껴져요. 맨손으로 애들 생식기쪽 분비물도 다닦아주시고 괜찮냐고 전화도 해주시고 넘 좋았네요.','Y'),(11294,1421,'윈장님두분너무친절하시고ᆢ간호사두분ᆢ미용사님도너무친절ㆍ이리친절하시고애들도꼼꼼히봐주시고이런병원처음봅니다감사합니다','Y'),(11295,1421,'의사 선생님이 엄청 친절하세요.자세한 설명도 해주시고~단지 간호사님은 약간 쎄~~하네요','Y'),(11296,1421,'원장님 늘 친절하시고, 설명도 잘 해주십니다.','Y'),(11297,1433,'주변 환경이 좋은 편입니다.\n바로 옆에 보라매 병원과 공원이 있으며 롯데백화점이 있습니다.\n또한 근처에 신림역(2호선)과 고개너머 신대방삼거리역(7호선)이 있어 교통도 편리한 편입니다.','Y'),(11298,1433,'소소','N'),(11299,1433,'ㅋㅋㅋㅋㅋㅋㅋㅋㅋ','N'),(11301,1434,'개 1층, 고양이 2층으로 별도로 진료공간이 있으며 적절한 치료를 받을 수 있었습니다.\n병원앞에 주차공간이 있어 편리하게 이용가능한 24시간 동물병원 입니다.','Y'),(11302,1434,'우리댕댕이가 갑자기하혈을해서갔더니 자궁축농증이라고 수술을하지않으면 위험하다고하셔서 수술하고 회복중입니다.                     선생님 친절하시고 실력도 좋으신것같네요','Y'),(11303,1434,'친절한 젊은 부부 원장님이 운영 하시는 곳.\n거의 연중무휴로 밤 늦게까지 운영하시고, 급한 환자가 있으면 영업시간 넘어서까지도 친절히 봐주신다.\n동물 건강이 아니라 원장님 내외분 건강이 걱정 될 정도.\n덕분에 퇴근 후나 주말에 비교적 여유있게 찾을 수 있어 매우 만족한다.\n다른 병원은 그 시간에 가면 야간 진료비 붙는데 품은 아직 야간 진료비 붙는건 보지 못함','Y'),(11304,1434,'병원두 깨끗하고  시설완비\n원장님이  진료를 친절하게  봐주십니다\n오늘도  저희고양이  우리는   병원입원치료로 입원했습니다','Y'),(11305,1434,'이곳분들 엄청 잘하신다고 소문 났어요 가봤는데 잘하시는거 같아요 다른곳에서 치료하다 낫질 않아서 이곳에 갔는데 그전 병원이 오진 난거더라구요 ㅠㅠ','Y'),(11306,1436,'처음 백신맞으러방문했습니다.\n간호사분들 친절하게 안내해주시고 원장님도 세심한 질문까지 혹여 빠트릴수있는 주의사항까지 알려주시네요.\n앞으로 자주 이용하는 병원이 될것같습니다.','Y'),(11307,1436,'나이먹어도 간호사분들이 의사분들이 너무나도 친절하게 대응해주셔서 감사드립니다','Y'),(11308,1436,'병원이라고 하는데가 요즘 우한독감이  유행하고 그러면 손세정제나 화장실에 싸구려 비누 한장이라도 두던지 해야지~ 검사 하나 더 시키려만 하고~ 불친절하고~~','N'),(11309,1436,'건보에서 이런 병원을 국가검진기관이라고 지정하다니. 지저분하고 불친절하고 검사도 엉망으로 하고. 절대 가지마세요','N'),(11310,1436,'데스크부터 간호사 의사선생까지 하나같이 불친절하고 대충 검사하는게 참..','N'),(11311,27,'간호사 분들 친절해요. 불필요한 검사 강요하지 않아요. 거의 9년 정도 방문한거 같네요. 다행히도 저희 강아지가 크게 아파본적은 없어서 큰 수술이나 다른 치료를 받진 않아서 솔직히 그런 부분은 잘 모르겠어요. 저는 저희 강아지 피부병, 근육통, 멍울 같은 문제로 방문해서 진료 받고, 약 처방 받은적 있는데 그런 부분은 잘 개선되었습니다. 물론 피부병은 재발하는 고질병이라 완치는 안되었지만 집에서도 꾸준히 관리중이고, 가려움증이 심각할땐 병원 처방약으로 ','N'),(11312,27,'**저는 여기서 미용만 했습니다**\n이곳에 전화하시면 아시겠지만 전화하시면 미용과 병원 업무가 나눠져있습니다.\n은 대 만족입니다. 동네에서 강아지키우시는 분들 대부분이 여기서 미용하시고 미용사분이 너무 친절하세요.\n미용 이후에 강아지들 스트레스도 적고 가끔 미용 끝나면 귀여운  넥 악세사리 해주세요.\n- 인기가 많아서 2주나 최소 1주 전에 전화하셔야지 원하시는 날짜에 미용 받으실 수 있어요.','Y'),(11313,27,'절대 안가. 무서워라','N'),(11314,27,'좋아요 모두 친절하세요.','Y'),(11315,27,'바가지 요금','N'),(11316,1464,'사장님들도 너무 친절하시고 애들도 너무 착해서 너무 좋은거 같아요!!! 시설도 깨끗하고이용하기 좋은거 같아요!!!','Y'),(11317,1464,'애견카페예요 지하1층에 있지만 사장님들께서 워낙 깔끔하셔서 깨끗하고 애카특유의 냄새라던지 그런것도 없고 사람입장료는 있지만 음료는 꼭 시켜야하는건 아니구요 당연하지만 외부음식 반입안됩니다. 상주견도 있고 믿고 호텔이나 놀이터이용하는 강아지들이 있는만큼 신뢰도도 높은편이예요^^사람 식사류도 있고요 애견들한테 간식제공은 금지예요 잘못하면 피바람이 날수도 있으니까요^^','Y'),(11318,1464,'입장료 6천원(필수)\n음료수(선택)\n사장님이 가게를 깔끔하게 관리하십니다. 처음갔는데 개들이 막 몰려와줘서 좋았어요 ㅋㅋㅋㅋ','Y'),(11319,1464,'요즘 자주 가는 신림 애견카페 ^^#','Y'),(11320,1464,'여기 좋아요^^ 꾸준히 관리하셔서 냄새도 안나고 쾌적하고 강아지들도 귀엽습니다','Y'),(11321,1467,'도베르만 받아주는 곳이 여기 뿐이라서 오게됬지만\n직원 분들도 친절하고 너무 좋아요 종종 가겠습니더','Y'),(11322,1467,'애견 카페는 처음인데 너무 귀여운 강아지들 덕에 힐링되고 좋았습니다 :)','Y'),(11323,1467,'관리가 너무 안되구요,,, 대형견 끊임 없이 짖고 적은 공간에 너무 많은 개들이 갇혀있는 느낌이었습니다.','N'),(11324,1467,'사장님 및 직원분들이 친절하고 강아지친구들이 매우 귀여움','Y'),(11325,1467,'개들이 너무 많고 관리가 안된다는 느낌을 받았어요. 선불권은 구매 시 안내 없었는데 쓰려고 보니 유효기간이 있었다고 소멸됩니다. 구매 시  잘 알아보고 조심하세요.','N'),(11326,1484,'여기 내곡치과 서울대나온 원장님들이신데 진짜 과잉진료없고 잘하심 딴대서 치아새로해야한다는데 여기만 손봐주심.','N'),(11327,1484,'5층 남자 화장실에 비데 있음 꼭 가보셈','Y'),(11328,1484,'기계식 주차장 입구 턱이 굉장히 높습니다. 주의하세요.','N'),(11329,1484,'오라카이 사우나 좋아요','Y'),(11330,1484,'친절하게 잘모시면 고맙겠습니다.','Y'),(11332,805,'원장님께서 증상을 친절하고 자세히 알려주세요.\n무엇보다 병원이 너무 깨끗해서 믿음이 가네요.\n개와 고양이 입장문이 각각 다르고요.\n병원 앞에 주차하고 들어갈 수 있습니다.','Y'),(11333,805,'저희 냥이들 아기때부터 돌봐주신 두 선생님이 함께 개원하셨다고 해서 오픈하자마자 바로 들렀습니다. 고양이 진료실이 강아지 진료실이랑 따로 분리가 되어 있어서 안정이 되었는지 저희 겁쟁이가 이동장 밖으로 나와서 둘러보는 모습을 처음을 볼 수 있었습니다 ㅎㅎ 저희 고양이 죽을 고비 여기 선생님들 덕분에 잘 넘길 수 있었고 덕분에 지금은 건강하게 함께 잘 지내고 있습니다~ 요즘 반려동물 믿고 맡길 수 있는 동물병원 찾기 쉽지 않은데 강츄 드립니다! 앞으로도 ','Y'),(11334,805,'친절한 원장님이 맘에 들더군요.\n일요일도 영업하시고 정말 열씸히 일하시네요','Y'),(11335,805,'고양이 출입구. 진료실 따로 있고 세심한배려가 병원곳곳에 숨어있어 편하게 진료받을수있습니다. 검사 강요 없이 보호자 의견 최대한 존중해주시고 설명도 잘해주십니다. 붐빌까봐 나만 알고싶은 병원이에요.','Y'),(11336,805,'과잉진료도 없으시고\n친절하시구요\n\n비글구조네트워크 보호소 강아지들 진료도 봐주시는거 같고 좋은 병원이라고 느껴져요','Y'),(11337,804,'선생님 친절하시고 꼼꼼히 잘봐주심','Y'),(11338,1499,'친절하고 좋아요','Y'),(11339,1499,'너무 친절하고 잘 봐주세요.\n다른병원 몇군데 다녔는데 이만한 병원이 없네요^^^','Y'),(11340,1499,'샘이 친절하게 자세한 설명해주세요. 정직하게 운영하는 느낌받았어요. 샘이 게다가 이쁘세요^^','Y'),(11341,1499,'항상 친절하시고 병원도 깨끗하고 좋아요','Y'),(11342,1499,'원장님이 참 친절하세요! 너무 좋은 동물병원이예요','Y'),(11343,1501,'원장님이 매우친절하고 꼼꼼하게 봐주세요','Y'),(11344,1501,'병원규모는 작은데 친절함','Y'),(11345,1501,'굿!','Y'),(11346,1501,'친절!','N'),(11348,1502,'저는 개를 키워본 경험이 있는 사람이 아닙니다. 다만 제가 알고 있는 사실이 몇 가지 있습니다.\n\n첫째, 개는 시간이 지난 상태에서 오래전 일에 대해 훈육을 하면 문제행동과 훈육 간의 인과관계를 파악하지 못합니다. 행동에 대한 피드백은 아무리 느려도 3초 이내로 이루어지는 것이 좋습니다.\n둘째, 신체적인 체벌이 훈육의 주된 수단이 되어서는 안되며, 보상을 통제하는 방식이 주가 되어야 합니다. 특히나 코를 때리는 행동은 개에게 큰 고통을 주는 행위로 저는','N'),(11349,1502,'신논현역에서 가깝고 강남역에서도 거의 유일한 애견카페, 몇 안되는 애견호텔이자 유치원. 강아지카페도 하고 위탁호텔과 관리, 유치원까지 모두 겸하고 있으며 카페는 밤 1시까지 운영하는데다가 호텔과 유치원도 24시간 운영하는 만큼 상당히 철저하고 신뢰감 있는 애견카페입니다.\n찾아가는 건 신논현역에 나와서 골목 안으로 들어가셔야합니다. 지하에 있어서 무슨 한식집 옆에 닭꼬치 포장마차 세워진 지하계단 있습니다. 거기로 내려가시면 돼요!\n운영하시는 분들이 카페 ','Y'),(11350,1502,'좋아요','Y'),(11351,1502,'친절하게 대응해 주었다.\n귀여운 활기찬 완짱이 맞아줍니다.','Y'),(11353,811,'휴가갈때 두 주정도 서초동물병원에 맡겼는데 이후 전에 없던 여러가지 트라우마가 생겼어요. 분리불안증, 자주 토하고, 다른 사람과 산책도 힘듭니다.','N'),(11354,811,'원장님 덕분에 우리 강아지 심장병 낫고 잘 지내고 있습니다. 가격도 싸고 매번 감사해요ㅜㅜ','Y'),(11355,811,'단골동물병원. 시설 좋아요. 분위기 좋아요. 특히 직원들 아주 좋아요.','Y'),(11356,811,'고양이는 잘 모르세요.','Y'),(11357,811,'진심으로 비추합니다','N'),(11360,1546,'이른 아침부터 갔는데\n멍멍이들이 세마리나 반겨주네요\n\n직원분께서 저희 아이 배려해주시고 챙겨주셔서\n너무 감사했구요😊\n\n애견카페지만 음료도 만족스러웠습니다👏','Y'),(11361,1546,'\"반려견도 보호자도 행복한 곳\"\n\n청담동 반려견 놀이터, 호텔, 학원, 카페를 겸하고 있는 펫타리움은 이 근방 반려견 보호자들에게는 참 귀한 곳이다.\n\n우리 댕댕이도 가끔 이곳에 가서 친구들과 사회성을 배우며 놀기도 하는데 여기 음식이 생각보다 맛이 괜찮다고 해서 이것 저것 주문을 해봤다.\n\n음식은 주로 기성품을 업그레이드 조리한 형태이다.\n\n청양고추를 넣고 볶아 만든 짜파게티는 아메리칸치즈와 계란후라이로 짜계치를 완성했다. 짜장라면 조차 매운걸 싫어하','Y'),(11362,1546,'가격표가 안나와있음. 강아지 입장이 얼마인지 음료가 얼마인지 안내가 없고 음료 가격도 적혀있지 않은데 인당 1음료 해야함. 손님이 가격을 일일히 물어봐가며 음료와 이용료를 알아내야한다면 그게 과연 좋은 서비스일지 생각해보시면 좋을 듯 함. 태도도 그냥 서비스업이 아직“도” 몸에 안벤 사람인게 느껴져서 내가 비싼돈 내고 여기올게 아니었네 싶음. 위치가 위치인지라 돈을 많이 받아야겠으면 낸만큼 정도의 태도와 서비스가 겸해줘야 재방문 가능할 듯.\n장소만 보자','N'),(11363,1546,'여러가지 복합적으로 최악의 장소입니다 어설푼 호텔이라 일단 주차도 엘레베이터로 되어 있어서 좀만 차량이 커도 진입불가입니다. 그리고 다리가 불편하신분은 못올라갈수도 있게 계단으로 되어있내요','N'),(11364,1546,'친절하고 깔끔한 곳이에요. 공놀이하기도 좋고 여름되니 수영장도 생겼습니다','Y'),(11365,1548,'\n애견카페이고 이용료는 인당 음료비 만원입니다. 따로 시간당 이용료는 없습니다.\n음료는 나쁘지 않습니다. 커피 머신도 브랜드 있는 걸 쓰시는 것 같구요^^\n저는 견주가 아니지만 강아지들이 뛰어놀기에 공간이충분해 보였구요, 매장은 전반적으로 깔끔하게 잘 관리되어 있습니다.\n배변 쓰레기통 바로 뒤에 세면대가 있는 건 센스있는 배치라고 생각되구요👍\n다음에도 저희 아이랑 가 볼 생각입니다🤔','Y'),(11366,1548,'쾌적하고 아주 좋아요\n주차는 맞은편 커피빈에 발렛','Y'),(11369,1577,'개를 키우는 친구따라 들른 곳인데, 다음에는 저 혼자서도 공 하나 사들고 따로 오고 싶을 정도로 너무 좋았네요. 일반적인 개 카페와는 달리 실제로 손님이 키우는 개들이 마음껏 돌아다니고 아무튼 너무 좋네요 개 조아용 흑흑😭💕💕💕💕 2020년 6월 기준으로, 입장료는 딱히 없고 음료수(아메리카노 ₩8000)를 하나 구입하시면 됩니다. 🐶본인 개에게서 눈을 떼면 안되고, 개의 용변도 직접 처리하셔야 합니다. 개의 몸무게 제한은 주중엔 15kg까지, 주말에는','Y'),(11370,1577,'미용해주시는 선생님 친절하게 설명 잘해주시고 미용도 마음에 들었어요','Y'),(11371,1577,'사장님 친절하시고 마당이 있어서 정말 좋았어요.','Y'),(11372,1577,'어떻게 실외 운동장에서 오줌냄새가 일케 많이 날 수가 있는지 의문.... 파리도 진짜 많이 날아 다니고 안전문을 너무 세게 쾅쾅코아어카어앙 닫아서 애들이 계속 놀람.... 물그릇은 더러워서 물을 담았는데 털이 둥둥 떠다님. 내돈과 시간이 넘 아까운 방문이었음.......','N'),(11373,1577,'잠원동 수타 칼국수 집\n메인은 칼국수 번외로 콩국수 판모밀 판매중\n맛은 평타 이상 3.5별점','Y'),(11374,72,'모든 친절하시고 원장님이 자세히 설명해 주셔서좋아요.','Y'),(11375,72,'여자 수의사쌤 친절함~ 비용도 위치가 서울인걸 감안하면 나쁘지 않음~ 새로온 카운터 직원은 표정이 썩어있음~ 수의사와 너무 대비됨~\n==================================\n표정이 썩어있던 카운터 직원이 없었음.\n짤렸거나 그만뒀거나 둘중 하나인듯..\n여자 수의사쌤은 여전히 친절함.','Y'),(11376,72,'실력좋고 친절한 수의사님이 진료하십니다.\n과잉진료도 없고 우리 강아지가 건강해졌어요','Y'),(11377,72,'나이 먹은 울 강쥐 귀가 아파서 다녀왔어요\n쌤 이 치료해주시고 주사맞고 약 하루먹으니 다 나아가는듯해요','Y'),(11378,72,'아주 친절하고 😀 👍','Y'),(11379,836,'저희 강아지 토랑이 미용및 진료를 위해 다니는곳입니다 친절하시고 잘해주세요','Y'),(11380,836,'친절하고 과잉진료 없으시고 모든 의료진이 사랑으로 돌보아주셔서 늘 믿고 맡겨요','Y'),(11381,836,'친절하고 꼼꼼하게 봐주십니다.  그치만 강아지 병원비는 부르는 게 값~','Y'),(11382,836,'9년째 다니는곳...쌤들 모두 모두 친절\n진심으로 애들을 사랑하는곳','Y'),(11383,836,'작지만 잘 진료해 주는 동물병원','Y'),(11384,1587,'동물 병원인데 냄새가 전혀 나지 않습니다. 무엇보다 원장님이 어물쩡 뜬구름 잡는 말을 안합니다. 원인 결과 처치가 명확합니다. 가격도 너무 비싸지 않아요. 굉장히 신뢰 가는 병원이라 우리 애들 노년에 이런 좋은 