술 후 심정지로 인해 허무하게 세상을 떠나게 되었습니다.\n\n아이는 괴로워 하는데 보호자에겐 잘 지낸다며, 문자에 모든 걸 사실대로 적지','N'),(11420,949,'병원 좋고 시설도 좋아요. 경험 많으신 분들은 정말 실력있으신 분들이에요.\n근데 경험없는 젊은 선생님들이 보호자하고 충분한 상의나 설명없이 처방을 내리네요.\n스테로이드 성분 위험해서 노련한 선생님들은 기피하는 약이고 강아지 오래키워본 분들도 강아지 관련일 종사하시는 분들도 위험하다고 절대 쓰지말라하시고 쓰면 마지막에 쓰는 거라고 다들 놀래하시는데 제가 바보같으니까 저한텐 말도 제대로 안하고 애 데려가서 스테로이드제 주사해놓고 아이 정말 고생은 다하다가 ','N'),(11421,1668,'우다닥 고양이 호텔 단기로도 장기로도 이용해봤는데. 심장병 있는아이고 잘 케어해주시고 잘 놀아주세요. 방도 항상 청결하게 유지 해 주셔서 안심하고 맡길 수 있었어요.','Y'),(11422,1668,'주인장님이 왕 친절하시고 비교적 깨끗하게 잘 관리되어 있어 안심하고 있습니다.앱으로 cctv영상도 확인 할 수 있어 아이들 상태 체크도 가능하구요. 저는 픽업 이랑 드랍서비스도 같이 신청했는데 그런 경우 아이들 성격이 무난해야할것 같아요. 저희애들은 초절정 예민냥이라 픽업의 어려움이 좀 있었습니다.집이랑 가까우면 정말 좋았을텐데..ㅠ.ㅠ 그점만 아쉽고 다 만족.','N'),(11423,1668,'최악입니다 빈방있다고 해서 출근길에 짐 다 챙겨서 애랑 사료에 장난감 담요 양손에 들고 택시타고 40분을 갔더니 스케줄 잘못봤다고 방 없다고 하고 다른데 알아보라고 하네요? 말인지 방구인지 모르겠네요? 사람 놀리는 것도 아니고 애들 맡기는게 장난입니까? 처음부터 제대로 알아보던가 사람 오라가라 이제 하다하다 호텔도 갑질하네요? 무슨 시설도 그지같은게 애들 위하는 척은 다하면서 제대로 청소나 됐는지 모르겠네요 방묘문도 없고 현관문은 벌컥벌컥 열고 일처리 ','N'),(11424,1668,'친절하고 뭣보다 냥이별로 공간이 넓음\n사료와 모래에 선택지가 있어 좋음\n룸별Cctv가 있어 언제든 확인가능\n뭣보다 비용이 룸사이즈에 비해 싼편임\n주차는 별도 자리가 없어서 힘듦','N'),(11425,1668,'우리 숙이....우다닥세번째갔는데이제잘가요.....간식은따로챙겨애되지만 이사가면 일주일동안밥안먹는애인데 물도잘먹고...씨시티비에서애교부리는거보고놀람..강남쪽에서제일 친절하고 고양이사랑하는게느껴져서여기계속맡길거에요','Y'),(11426,1672,'선생님 좋으시기로 유명 합니다','Y'),(11428,1679,'한국에 방문시 항상 이용하는 병원입니다. 원장님이 알아서 잘 해주시고 친절합니다 :)','Y'),(11429,1679,'아이들 책도 사고, 어른들 책도 사고.. 새거 같은 책들 반값에 샀네요.','Y'),(11430,1679,'비싸요...','N'),(11431,1679,'친절...','N'),(11433,944,'5 년전부터 다녔는데 의사선생님이 친절하시면서 부당하게 안하시니까 넘 좋은것 같아요. 믿고 다닐수있어서  좋아요 . 다른 동물병원은 터무니없는 요금을 원하는데 진료 정확하고 진료비 착해서 최고입니다.','Y'),(11434,944,'선생님들 및 스탭들이 너무 친절하세요. 다른 병원들처럼 바가지도 없고요.','Y'),(11435,944,'엄청 친절하시고 고양이를 엄청 이뻐해주세요','Y'),(11436,944,'뱃속에 이물질 든거 잘빼내신다 들어서 갔습니다.갔다와서 싹 나았어요.','Y'),(11437,944,'깨끗하고 선생님이 친절하게진료봐주셔서 좋았어요~','Y'),(11438,1684,'진짜 놀랬어요 집에서 발톱만 짜르려해도\n온갗 상처 다 내는데 여기선 무슨 순한 양 마냥 진짜\n엄청 얌전해 지는데 억울하네요ㅋㅋㅋㅋ\n가격은 75000원 이였어요 전신 밀었어요..\n스파도 있다네용ㅋ.ㅋ\n45분만에 순식간에 끝나네용\n\n역시 고양이는 털빨이네요...ㅋㅋㅋㅋ','N'),(11439,1684,'아늑한 분위기와 친절한 돌봄으로 믿고 맡길 수 있는 고양이호텔.