건 우리가 못해서입니다... 반성합시다..','Y'),(11510,349,'원장님께서 너무 친절하세요. 저는 고양이 때문에 가는데.. 고양이 진료도 잘해주세요.','Y'),(11511,349,'수의사쌤이 썩 친절하신편은 아니시지만, 그래도 고양이를 너무나 사랑하시는 분이시라, 정성껏 진료해 주십니다.\n믿고 진료 맡길 수 있어요','Y'),(11512,349,'친절하신 원장선생님입니다 10년 넘게 다른곳을 못가고 힝상 차오름만 가기 있습니다 토끼를 너무 잘 보는 동물병원입니다','Y'),(11513,349,'믿고 진료받습니다. 집 근처 병원으로 옮겨볼까 생각해 봤지만 이원장님 만큼 믿음이 갈까 의문이라 못 옮기겠네요.','Y'),(11514,996,'음~~그냥 편안하다고할까??  이촌동에 살면서 다니던 동물병원 일산으로 이사를 와도 계속 다니는 우리 하니의 병원 ~~~ 항상감사합니다 원장님~~','N'),(11515,996,'원장선생님 감사합니다\n미국에 사는 사람인데 강아지가 오랫동안 아파서 여러번 병원을 옮기고 조직검사도 했지만 원인을 찾지 못해서 속이 상했습니다 급한 마음에 잘알지도 못하면서 전화를 해서 상담을  받았는데 친절하시고 전문적으로 상세하게설명을 해주셨습니다\n다시한번 감사 드리고 강아지가 빨리 회복되었으면 하는 바램입니다','Y'),(11516,996,'정중하게 대응해 주셔, 안심입니다.','Y'),(11517,996,'코코아가 신세를지고 있습니다 (^^) 160507','Y'),(11518,359,'원장님 께서 친절 하시고 자세한 내용 알기 쉽게 설명 해주셔서 좋아요 우리집 강아지 구강종양 있어서 수술 하는 날인데 무사히 끝났으면 좋겠어요.... 사탕아 힘내 사랑하고♡♡♡','Y'),(11519,359,'의사선생님을 포함하여 모든 직원들이 친절하고 세심한 배려가 장점임. 아이상태에 대한 상세한 설명 및 의사결정 우선순위에 대한 정보를 충분히 제공함. 주치의제의 장점도 있지만 분과별 진료여서 진료영역별로 전문성이 느껴지고 신뢰가 감. 이전에 오래 다녔던 병원에서 옮겼는데 이전 병원에서 발견 못한 질병을 발견하여 치료 중이고 증상이 호전되고 있어 만족함. 과잉진료 없고 반려동물들을 정말 사랑으로 케어한다는데 정평이 난 병원인데 그 외에도 시설, 전문성, 치','Y'),(11520,359,'고양이발작때문에 추천받고 가까워서 간병원인데\n저희집고양이 4마리 모두 단골됫어요 비싸긴하지만 비싼만큼 선생님들의.친절함과 꼼꼼함 그리고 장비가 탄탄히갖춰져있고 깨끗해서 너무 좋아요 !','Y'),(11521,359,'시설 너무 좋구 넘나 친절하셔요. 애기가 수술하구 입원중인데 아침 저녁으로 애기 상태설명도 해주시고 사진도 계속보내주십니다!','Y'),(11522,359,'친절하고 자상하게 진료하고 정성을 다한다는 느낌입니다\n추천합니다~','Y'),(11523,984,'용산 최고의 주상복합 아파트.\ngtx-a,신분당선,용산기지창,용산가족공원 등 호재 가득!!','Y'),(11524,984,'살고있는 단지내로 주변인프라 너무잘되어있고 산책로 잘되어있고 주변 공원들도 잘조성되어있습니다.','Y'),(11525,984,'여기 상가에 우리곰탕집이 있더군요 진하게 우려낸 국물이 좋습니다.\n인위적인 맛없이 사골로만 우려낸 맛이라 제 입맛에 딱이네요','Y'),(11526,984,'도심속에 숨겨진공간\n산업의발전과 자연과공존학싶은 욕망이함께하고있다','N'),(11527,984,'1층에 담배피는 사람들이 너무 많이 몰려요.\n낮에는 담배연기가 참기 힘드네요.\n아파트내에서는 멀리 63빌딩도 보이고 약간 보이는 좋은 위치입니다.','N'),(11528,1801,'도배하러 왔어요~~','Y'),(11529,1801,'바로 앞에 5호선 지하철이 연결되고 입구에 롯데마트가있어 멀리 쇼핑갈 일이 드물다 대현산이 뒤에 있어 조망이 좋으며 공기가 좋다','Y'),(11530,1801,'행당역 바로입구 조경도이쁜데 언덕이라 좀 이동이불편','N'),(11531,1801,'초역세권에 인동간격 넓고 조망권 좋고 단지 계획이 잘돼있는 강남아파트에 밀리지 않는최고의 아파트입니다.','Y'),(11532,1801,'좋네요 놀이터도 많고 아이들도  많네요','Y'),(11533,999,'정말 좋은 곳이에요. 난 정말 좋아! 그곳에는 두 명의 스타, 제이홉과 정국이 살고 있습니다. 나는 항상 당신 옆에 있고 당신을 지원할 것입니다. 영원히 영원히 방탄소년단. 인도에서 온 사랑.🧡🤍💚💜💜💜','Y'),(11534,999,'말이 필요 없습니다\n연예인 하우스에 펜트는 주변 갤러리아 포레랑 대림 아크로와 같이 쌍벽을 이룹니다.. 다만 한강뷰는 원톱이구요\n보안시설부터 자체 호텔 조식 서비스까지 말이 필요없는 곳입니다 말 보다는 돈이 먼저죠 ㅎㅎ 우리나라 길고 나는 수입차 여기가면 많이 봅니다','Y'),(11535,999,'나의 최종 목표 이걸 위해 22살때부터 주식을 공부했고 쌩초보자 수준이였던 과거와 달리 26살인 지금은 나름대로 고수가 된거 같다 그때까지 기다려줘 꼭 가고야 만다','Y'),(11536,999,'적절한 원형구조의 모던함이 별미. 90년대엔 한남동등 한강 부촌이였다면 현대에 와선 자양 가까운 쪽의 안락함을 선사해주는 최고. -디자인 담당 킴정음 슈르 박사 돈벌이 : 졸부 딴따라 포섭','Y'),(11537,999,'전국에서 전망으로 치면 탑3엔 무조건 든다고 생각합니다.','Y'),(11538,1002,'성동구 대장아파트','N'),(11543,383,'공부많이하시는 실력파 선생님이 개업하셨다 추천 받아멀리서 왔는데 그럴 가치가 있었다. 전문적인 검사(과잉없음)와 처방. 18세 고양이 기르는데 관리에 대해서도 조언주시고 쓸데없는 보조제는 권하지 않으심. 작지만 깔끔하고 시설도 정말 좋은편이다.','Y'),(11544,383,'진짜 좋은 선생님이세요. 시설 깨끗하고 간호사선생님들 매우 친절하세요! 저희는 병원이 아니라 원장선생님따라 개업하시자마자 오늘동물병원으로 옮겨 강아지 돌봐왔습니다.\n\n쿠싱때매 고생하던 저희 강아지 선생님이 진료하고 나서 4년을 더 살고 갔어요 :) 루이 떠나는 날 같이 슬퍼해주시는 모습에 저희도 너무 감사했습니다.\n\n과잉진료 아니고 항상 친절하고 자세하게 설명해주세요. 서울에서 유명하다는 병원 많이 다녔지만, 정착한 곳은 오늘동물병원입니다.','Y'),(11545,383,'1. 발 만지기만해도 파닥거리던 우리 고양이. 접수하는 짧은 사이에 발톱이 전부 깎여나가는 경이로운 광경을 보며 간호사님 전문스킬에 1감탄.\n2. 다른 동물병원들 방문했을때마다 저 안쪽에서 알수없는 살벌한 비명소리가 들려서 무슨 일이 벌어지고 있는건지 궁금했었는데, 이 병원은 모니터로 실시간 모니터링 가능해서 2감탄+신기방기.\n3. 미용하러 온 어떤 강아지 신나서 선생님한테 앵기는거 보며 3감탄\n4. 선생님이 우리 부부 앉혀두고 진료내용 이상으로 우리 ','Y'),(11546,383,'2022년에 21살된 강아지가 많이아파서 조카의 소개로 \"오늘동물병원\" 을 방문했는데 기존병원 선생님과는 너무 달랐습니다\n과잉진료 없을뿐만 아니라 저희강아지가 그때 너무 아파서 혈관주사을 많이맞아서혈관이 나오지 않는강아지를 다른병원은 말못하는동물을그저 돈벌이 라고 생각했는지 마구꽃아서 혈관이 안나오는데\n윤선생님 은 혈관이안나온다고 배려해주었고\n이뿐만 아니고 윤선생님같은 동물병원 선생님들이\n더 많다면 얼마나좋을까요.\n그리고 다른병원 (( TV 에  나오는','N'),(11547,383,'원장선생님 진심으로 차분, 다정하심. 고양이에 대해 풍부한 학문적 지식을 바탕으로 엄청 꼼꼼하고 자세하게 설명해주시는데 과잉진료도 없어 정말 만족헸습니다.','Y'),(11548,1817,'교통과 주변경관 등 주거환경으론  최고의 입지에 위치하고 있고 관리사무소의 관리,감독도 매우 우수하다는  인상을 받았네요.굳이 터무니없이 고가인 한강 건너 편의 압구정 아파트들을 선호할 필요가 있을 까 싶고 역사적으로도 독서당 길 이라   고 학문을 하기에도 최고의 입지였다고 하네요','Y'),(11549,1817,'서울의 가운데 지역으로 교통이 매우 좋음','Y'),(11550,