들과 아주 다르세요\n그리고 아이들을 치료하는 시설이 따로 있어요\n물과 함께 놀이를 하며 치료하는 곳인데 그냥보면 강아지들을 위한 목욕탕(??) 또는 찜질방 같은 곳이에요\n그리고큰 강아지들을 목욕시키는 시설이 따로 있어요','N'),(11663,1097,'강아지 눈물이 워낙 많이나서 누관시술했는데 누관시술하고나니 눈물이 덜 나오네요 근데 비용이 만만찮게 드네요;;뭐든 다 비용 계산되서 나오니 역시 동물병원이라 병원비가 비싸긴하네요','N'),(11664,1097,'방광 결석 수술 80만원대라고 다른 병원에 물어본 금액보다 수용가능한 선이라 여기서 결정하고 검사 했더니 말이 달라짐.\n12살 노견 강아지 건강 생각하면 이런저런 검사 추가로 더 해야 한다며 계속 안정성, 건강 들먹이면서 검사 추가로 권함.\n그로인해 현재 거의 150만 넘게 들은듯.\n이미 검사하고 수술까지 한 후라 다른 곳으로 옮길 수 없어 울며 겨자먹기로 다니고 있는데 후회 막심.\n방광에 카테터(오줌 줄)도 달고 있는데 일주일이면 된다면서 매일 소독,','Y'),(11665,1097,'기본접종 받으러 가도 뭔가 추가되는게 많음.챙겨주시는 건지 덮어쓰는 건지 헷갈리는데 추가되는 것에 대한 금액에 사전고지가 없어 덮어 쓰는 느낌이  있음, 그래도 친절하심.','N'),(11666,1097,'간단한수술정도를할수있는동물병원입니다\n강아지가열살이넘어가니가끔갈일이생기네요','Y'),(11668,2033,'이곳 상가 몇군데에 매주 신문을 주러 다녀옵니다. 길음뉴타운아파트중 역에서 가장가깝고 길음역으로 통할수 있는 출구를 이곳 지하로 연결하는 공사가 한창입니다. 상가는 아직 비어있는곳이 몇군데 있어요','N'),(11669,2033,'신규건물인데 벌써 하자가 보임.','N'),(11670,2033,'아직 인프라가..','N'),(11671,2033,'여기에 있어요^^','Y'),(11672,2033,'역세권.. 상가 입점중','N'),(11673,2035,'이곳 상가 몇군데에 매주 신문을 주러 다녀옵니다. 길음뉴타운아파트중 역에서 가장가깝고 길음역으로 통할수 있는 출구를 이곳 지하로 연결하는 공사가 한창입니다. 상가는 아직 비어있는곳이 몇군데 있어요','N'),(11674,2035,'신규건물인데 벌써 하자가 보임.','N'),(11675,2035,'아직 인프라가..','N'),(11676,2035,'여기에 있어요^^','Y'),(11677,2035,'역세권.. 상가 입점중','N'),(11680,1112,'1. 층간소음 미쳐버림 (쿵쿵쿵 대면 전등과 창문이 흔들림)\n2. 주위 소방서있음.. ..싸이렌소리 가깝게 매일남.\n(주위 5개 차로---- 사고나면 밤새 사이렌 소리나고, 자동차 소음, 먼지..\n거지 같은 곳 하루 빨리 벗어나고 싶음','N'),(11681,1112,'최고의 입지 입니다..북부간선 내부순환로 교착점이고 생활권이 최고 교통이며 지하에 6호선 지하철','Y'),(11682,1112,'화장실이 더러워요','N'),(11683,1112,'ㅋㅋ','Y'),(11684,1112,'KIST 유학생들이 일상적으로 쇼핑할 수 있는 최고의 장소입니다.','Y'),(11685,2059,'건물이 깨끗하고 좋네요','Y'),(11686,2059,'주차늘만차','Y'),(11687,2059,'좋아요.','Y'),(11688,2059,'살기좋은곳','Y'),(11690,138,'신축이라 깔끔하고 지상에는 차가 다닐 수 없게 되어 있어 쾌적하다. 지하에 헬스장과 독서실 등 편의시설이 모든 동과 연결되어 있어 편리하다. 아파트 현관을 들어가면 엘리베이터가 내려오고 밖에서도 집 안 조명이나 온도조절을 할 수 있는 등 여러가지 편리한 부분들이 잘되어있다.','Y'),(11691,138,'조경좋고 최신 아파트라 깨끗함.\n주변 편의시설이 부족한 점은 있지만 최근 동네가 지속적으로 업그레이드 중~~조만간 살기 좋은 동네가 될듯...','Y'),(11692,138,'신축한지 1년이 되어가는 재건축단지로  단지내 헬스장 골프장등  편의시설이 원스톱으로 가능한단지입다','N'),(11693,138,'조경이 사계절감상을위해 특별한 설계가 아주잘조성된 명품 아파트입니다.','Y'),(11694,138,'단지 깨끗하고 좋지만\n주차장 안내도가 정말 갈때마다 헷갈림 ㅡㅡ.','N'),(11695,1119,'선생님 친절합니다\n중성화수술 성북구에서 제일 저렴한듯.\n저렴하게 잘했습니다.','Y'),(11696,1119,'수의사쌤이 냥냥이 키우시는데 친절하시고 TMI셔요 ㅎㅎ','Y'),(11698,1120,'들어가자마자 짐승?들의 냄새가..ㅎㅎㅎ 강아지 열마리이상이니 넘나 당연하쥬?\n공기중 털도 당연히 날리겠쥬?\n아이들이 넘나신나하니 별수있것슈?\n키우기 엄두가안나고 순한 강아지들 보고싶을때 가서 봐야지 뭐 어쩌겠슈.\n실내와 실외를 잇는 문열고닫을때 아이들 주의를 엄하게 꼭주시고 이쁜 강아지아이들과 좋은추억쌓으세요.','Y'),(11699,1120,'강아지들 너무 순하고 사장님도 친절하세요 ㅎㅎ 멈무들 간식 서비스 감사합니당~~🐶🐶 다음에 또 갈게요','Y'),(11700,1120,'강아지들이 교육이잘되어있어요','Y'),(11701,1120,'강아지 좋아해서 가봤는데 사장님도 친절하시고 강아지들도 너무 귀여웠어요!! 강아지들이 케어 잘 받은 느낌이네요 나중에 저도 강아지키우게되면 꼭 여기로 맡기고싶어요','Y'),(11702,1120,'강아지 없이 가도 강아지가 많은거 넘 좋은듯  상주견 3마리 빼고 유치원 다니는 애기들이라는데 유치원 다닌다는 말이 왜케 귀여운지ㅠㅠ 대형견 보기 쉽지 않은데 상주견 두마리가 대형견이구 애들이 덩치에 비해 넘 순해서 키우고 싶은 욕구 뿜뿜🥰  직원분이랑 사장님도 다 착하심요🤭 담에 또 놀러갈께욜~','Y'),(11706,2077,'1. 층간소음 미쳐버림 (쿵쿵쿵 대면 전등과 창문이 흔들림)\n2. 주위 소방서있음.. ..싸이렌소리 가깝게 매일남.\n(주위 5개 차로---- 사고나면 밤새 사이렌 소리나고, 자동차 소음, 먼지..\n거지 같은 곳 하루 빨리 벗어나고 싶음','N'),(11707,2077,'최고의 입지 입니다..북부간선 내부순환로 교착점이고 생활권이 최고 교통이며 지하에 6호선 지하철','Y'),(11708,2077,'화장실이 더러워요','N'),(11709,2077,'ㅋㅋ','Y'),(11710,2077,'KIST 유학생들이 일상적으로 쇼핑할 수 있는 최고의 장소입니다.','Y'),(11711,447,'일단 병원관계자분들 모두 친절하시고 동물을 좋아하시는게 느껴집니다. 작은 동물병원이라 주로 소형견과 고양이들이 와서 대형견 진료는 조금 힘들거라 생각했는데 막상 진료받아보니 괜한 걱정이였습니다. 과잉진료도 없으시고 병원비도 기존에 다니던 병원에 비하면 저렴해서 큰 병 걸리지 않는 이상 이 병원으로 계속 다니려고 합니다.','Y'),(11712,447,'의사선생님도 친절하고 좋습니다','Y'),(11713,447,'육회비빔밥은\n20점','Y'),(11714,447,'친절하고\n좋습니다','Y'),(11716,2100,'친절한 사장님과 저렴하고 다양한 물건이 있고, 커피도 마실수 있음','Y'),(11717,2101,'삼각산 둘레길이 바로 단지뒤\n초중고와 경전철 솔샘역이 100미터이내  근거리\n살기 좋아요','Y'),(11718,2101,'북한산 끝자락에 위치한 살기좋은 아파트입니다.\n\n서울에서 이 정도 뷰가 나오는 곳이 몇군데나 있을까 싶어요.\n\n여전히 저평가 된 아파트라고 생각하고 있습니다^^','N'),(11719,2101,'북한산 둘레길이 있어서 좋고 .우이선이 생겨서 교통도 좋아요.가을 단풍이 너무 예뻐요.','Y'),(11720,2101,'북한산을 등지고 있으면 북한산 둘레길이 두군데나 아파트에 위치해 있어 진짜 친환경아파트~정말 자연환경이 갑인 곳! 아파트앞 솔샘사거리에 솔샘역도 있어 교통도 좋다~ 서울 치고는 가격도 좋다!','Y'),(11721,2101,'아파트\n고지대에 위치해 있어요\n그렇지만\n대중교통을 이용하기 편리한곳 입니다\n마을버스 버스 등\n특히경전철 우이선이 바로앞에 위치해 있어 좋아요\n아파틀 주거환경은 보통 입니다','Y'),(11722,2104,'미아뉴타운 래미안트리베라1차아파트, 자연친화적인 숲세권아파트, 살기 좋습니다. 단지 조경과 산책로가 잘되있습니다.','Y'),(11723,2104,'몇달전까지 트리베라1단지의 비즈니스 소유가 화목부동산으로 무단 점유 기재되어 있어 화목부동산과 구글측에 수정을 요구했고 구글측에서 수정한건지 화목부동산에서 수정한건지 알 수 없으나 현재는 트리베라 1차 관리실로 정상 수정 되어있습니다\n\n—————————————————————-\n\n화목 부동산? 왜 아파트 단지가 일개 부동산중개업자의 업장으로 등록 되어 있는건가요?\n아주 이동네 부동산 업자들 하는짓이 가관일세\n\n단지는 훌륭하고 주거수준도 높아서 만족도는 대','N'),(11724,2104,'좋은 아파트 입니다.\n거주자를 위한 커뮤니티가 잘 되어 있어요.','Y'),(11725,2104,'매우 좋습니다.\n모든면에서 완전하고 우수한 작품입니다.\n삼성 래미안 트리베라 1차아파트와 정문 경비실 그리고 관리사무소와 시설관리자님 모두 감사드립니다~~~~*^^*\n고맙습니다!사랑합니다!🤷‍♂️','Y'),(11726,2104,'길음에 이게 왜있지?(길음비하아님) 라고 생각되는 단지임\n비유하자면 대림동에 트라펠리스 있는느낌?(대림동비하 절대아님)\n놀러가봤는데 깨끗하고 살기 좋아보임','N'),(11728,2112,'미용 이쁘게 해주시고 미용사분이 강아지를 진짜 좋아하시는게 느껴져서 좋았습니다 담에 또 방문할께요','Y'),(11729,2119,'위아래로 시장... 편한 교통','N'),(11730,2119,'수유에서 가장 뷰가 좋은 아파트에유','Y'),(11734,2132,'친절합니다.','Y'),(11735,2136,'경전철 개통되어 교통이 편리하고 북한산이 바로 옆에 있어 공기좋고 산책하기 좋음. 특히 단지 내에 명문 삼각산초등학교와 삼각산중학교가 있으며 인근에 대일외고와 자사고인 계성고가 있어 교육환경이 매우 좋음.','Y'),(11736,2136,'넓은공간에 너무많은 아파트가 세워져있어 동간거리가 너무가까워 일조권에 영향을 받을것 같읍니다 그러나 자연환경조성은 잘됐어요','N'),(11737,2136,'상가가 편의시설이 잘 갖추워져 있어서 이용하기에 편리하네요','Y'),(11738,2136,'대단지라서 위엄이 있음. 관리 잘되고 역세권, 학세권임. 주차도 넉넉.','Y'),(11739,2136,'단지도 크고 산밑에라 공기도좋다.아쉬운점은 평지가 아니어서 계단이 많다는것이다.','N'),(11740,1146,'4년째 다니고 있는데 늘 친절히 설명도 잘해주시고 아이들 많이 예뻐해주셔서 항상 고마운 마음이예요 :) 주변에 이런 병원이 있어 정말 좋아요 ^^','Y'),(11741,1146,'의사선생님이 정말 친절하시고 진료도 잘 봐주십니다. 진료 내용을 카톡으로 상세히 다시 보내주십니다. 진료비도 거품 없이 필요한 부분만 진행해주시고.. 거리가 좀 있는데도 불구하고 근처 동물병원이 아닌 여기로 계속 다니게 되네요 ^^ 앞으로도 번창하시길 바랍니다.','Y'),(11742,1146,'동물병원에 사람이 많네요. 요미독에서 강아지 분양받았는데 제휴병원이라 좀 싸게 수술비용 적용받았어요. 기존 제휴병원보다 깨끗하네요. 현재까지는 좋아요. 좀더 다녀보고 추가로 의견 적어볼게요.','Y'),(11743,1146,'미용가격이 다는곳보다 오천원이 싸고 강아지를 커이지에 가두지 않음','N'),(11744,1146,'대부분의 수의사선생님들은 진료실에서 접종이나 기타 처치를 해주시는데 이곳은 반려견만 데리고 갔다가 다시 돌려준다.\n너무 친절하지만 치료과정을 지켜볼 수 없다는게 가장 큰 단점.','N'),(11745,2145,'선생님도 너무 친절하시고 미용선생님도 신경많이써주시고 금액도 다른병원보다 저렴해요~  이사왔어도 항상 여기병원만 가요^^','Y'),(11746,2145,'강아지가아파 병원방문 의사선생님 강아지\n아픈이유 예를들어가며 설명해주셨는데\n귀에 쏙쏙들어오고 넘~친절하심','N'),(11747,2145,'친절한