아픈 적 없던 아가라 안일했','N'),(11779,501,'고양이때문에 가는데 항상 갈때마다 느껴요~ 의사선생님께서 매우친절하시고 치료또한 잘해주십니다. 다른곳에비해 비용도 많이 저렴하구요~','Y'),(11780,501,'의사선생님 덕분에 저희 밥풀이가 완치되었습니다. 항상 감사합니다. 저렴한 가격과 신뢰도 있는 진료를 원하시는 분 강추합니다.','Y'),(11781,149,'롯데캐슬 GS프레시를 다녀왔어요\n직원들이 친절하고 내부 온도가 시원해서 물건들이 싱싱했어요 주차장도 넓고 여유가 있네요','Y'),(11782,149,'노원구 최고의 아파트단지 👍','Y'),(11786,115,'냥이 중성화하러갔어요.~ 선생님 너무 친절하시고 차분하셔서 안심했어요. 새로 생긴데라 너무 깔끔하고 주차장도 편해요~','Y'),(11789,2233,'사장님이 친절하고 강아지가 좋아해요\n무엇보다 이 가게에 경호견으로 고용된 \'정이로\'군은 귀여움으로 공격의지를 누그러뜨리는 힘을 가지고 있어요\n\n거 기왕 오신 김에 주인집 강아지 이로 사진이나 몇 장 보고 가슈','Y'),(11790,2233,'따릉이와 탄이 미용\n이쁘게 정성것 미용 해주셨어요','Y'),(11791,1180,'그냥 그래 오랴 됐오','N'),(11792,1180,'👍','N'),(11794,2245,'저렴한 가격으로 충분한 운동을할 수있는곳','Y'),(11795,2245,'가격이 저렴해요','Y'),(11796,2245,'좋아여','Y'),(11799,2246,'미세먼지 때문에 인후통이 심해져 집근처 병원을 찾다가 가게된\n현대가정의학과. 가자마자 공기정화식물 스투키(?) 같은 식물이 많이 있었고 대기실과 진료실에도 큰 공기청청기가 있었어서 뭔가 숨쉬기 쾌적함. 미세먼지 관련해서의 질문도 원장님이 잘 설명 해주셔서 궁금증도 치료. 원장님이 인상도 좋고 목소리도 좋으시다. 젠틀(?)한 느낌의 병원 동네 병원으로는 접근성도 좋고 새로 지어서 그런지 병원 환경이 매우 쾌적했던...','Y'),(11800,2246,'환절기라 편도쪽이 안좋아져서 주변분 추천으로 방문했었는데 새로 생긴 병원이라 깨끗하고 무엇보다 직원분들이 친절하셔서 기분이 좋았네요. 호흡기질환쪽 진료필요하신 분들 계시면 방문 추천드려요~','Y'),(11801,2246,'주변에 가정의학과를 찾다가 방문한 곳인데, 내부가 쾌적하고 깔끔해서 편안한 분위기에서 대기할수있었습니다. 진료도 원장선생님이 이곳저곳 자세히 물어봐주셔서 소통하는데 큰 어려움없이 진료받았습니다. 담에 또 방문할게요 ㅎㅎ','Y'),(11802,2246,'목 너무 부어서갔는데 원장선생님 너무 친절하시고 진료도 꼼꼼하게 잘봐주십니다!! 내부도 깨끗하고 간호사분들도 친절하십니다ㅎㅎ 기분 좋아지는 병원!','Y'),(11803,2246,'어려서부터 자주 가던 병원이에요.','Y'),(11804,1190,'강아지 까페인데 유치원으로 놀러오는 강아지들이 많아서 즐거운 시간을 보내기가 좋습니다.\n\n이쁘게 생긴 코카스파니엘은 랑이인데 식탐이 엄청 강해요.\n\n달이는 조용한데 할줄 아는게 많고 영리해요.\n(무지개 다리를 건넜어요. 😭 😢 )\n\n재밌어요. 한번 방문해보세요.\n차를 인당 한잔씩 시키면 두시간 즐거운 힐링 시간이 됩니다.','Y'),(11805,1190,'추석여행으로 다른곳보다 넓은 호텔방이라서 호텔링맡기고있는데 여행내내 계속사진을 보내주시고 깔끔하게 관리되는것같아 맘에들어요.\n맡기기전 아이들과 까페 방문했었는데 강아지들도 좋아보이고 까페온 사람하고도 잘어울리게 관리합니다~뭉치맘^^','Y'),(11806,1190,'초딩 아이랑가서 평소보다 조금더 신경이 쓰인것빼곤 괜찮았어요. 여러마리의 개들이 한데\n섞여있어서 정신이 좀 없긴했지만 각양각색의 멍멍이들을 만나보는 재미가있었습니다. 직원2분이서 식사 한번 편히 못하며 개들을 케어하고있었고 마킹이나 배변시 순식간에 치워주셨어요. 규칙안내해주시고 그 규칙안에서는 자유롭게 개들과 어울릴수있도록 자유로운 분위기였습니다. 음료값이 세긴했지만 따로 입장료나 시간제한이 없었어요. 