선생님이 반려견을 잘 돌보아 주시네요  감사함다','Y'),(11876,2341,'돈만 밝히는 못된 병원. 사람 봐가면서 가격 올리고 내리고. 강아지를 응급 상황으로 데려갔는데 오자마자 애 상태 확인도 안하더군요. 저는 정말 최악이였습니다','N'),(11877,2341,'항상 전문적인 지식으로, 진심으로 대해주시는 선생님들이 계셔서 믿고 갑니다.','Y'),(11878,2349,'주차가 조금 불편하네요. 그래도 주차할 곳이 있어서 다행이긴 합니다. 다른 병원에서는 호랑이로 유명했는데 이 병원에서 순둥이 됐네요. 선생님께서 잘 봐주시고 설명 열심히 해주셨어요. 부디 울 애기 빨리 나았으면 좋겠어요 ㅠㅠ','Y'),(11879,2349,'광견병 주사 맞고 왔어요.\n자세히 설명해주시고\n주의사항도 얘기 잘 해주셨어요\n\n집 가까이 능력자원자엄 동물병원이 있어서\n정말 좋아요','Y'),(11880,2349,'의사쌤도  넘 꼼꼼하게  진료해주시고  다들 넘 친절 진심친절','Y'),(11881,2349,'예약을 하지 않고 방문해서 대기하는 시간이 길었지만 아픈 냥이에 대해 자세하게 물어보고 설명해주셔서 집사로서는 좋았습니다','Y'),(11882,2349,'원장님이 너무 말도 차분하시고 자세하게 상담해줍니다. ㅠㅠ 냥선생님 감사합니다','Y'),(11883,2353,'교통 편리.\n한분이 야생화꽃밭을 가꾸시는지\n이렇게 예쁜 꽃들이','Y'),(11884,2353,'종로 접근성 좋은 아파트','Y'),(11885,2353,'좋아요','Y'),(11888,2372,'구파발 1번 출구로 나오면 북한산으로 가는 방향입니다.','N'),(11889,2372,'시내로 쉽게 갈수 있다','Y'),(11890,2372,'오늘이 무척 더운 날, 역(전철 승차 대기구역)\n에는 에어콘은 그렇다해도 송풍정도는 해 주셨으면!','N'),(11891,2372,'북한산에 오르려면 704번버스로 갈아타고,  북한산입구에서 내리시면 편리하다.','N'),(11892,2372,'구파발역 1번출구 북한산 과 은평둘레길\n교통 연결..','N'),(11893,583,'소동물 진료하는 동물병원이 많지 않아 그나마 가까운 곳으로 검색하여 처음 방문하였다. 가는데 한시간 남짓 걸리고, 예약을 따로 받지 않아 현장에서 접수하기 때문에 대기시간도 있는 편이지만 원장님이 친절해서 다 상쇄된다. 다음에도 조금이라도 이상이 있어 보이면 여길 방문할 것이다. 다만 개선할 점이 있다면 (1) 대기석이 협소하여 4인정도가 기다리면 만석이었다. 카운터 앞에 서있는 것 보다는 차라리 얇고 긴 의자를 2열로 놓으면 어떨지 or 동네에 카페도','N'),(11894,583,'친절한 선생님들 꼼꼼하고 자세한 진료. 소동물 진료가능해서 기니피그 데리고 갔어요. 주차장이 없어서 아쉽지만 소동물진료로 추천합니다.','Y'),(11895,583,'병원 자체가 아담해서 손님이 셋 이상 대기실에 있으면 북적거려요. 그래도 원장님이 잘 봐주시고 친절하셔서 도마뱀 진료볼 때 방문해요. 딱히 과잉진료도 없으시고 가격도 합리적인편입니다. 햄스터나 토끼 고슴도치 친칠라 등 다소 특수한 동물들이 많이 오고가요.','Y'),(11896,583,'선생님 넘넘 친절하시고 한시도 가만히 있지 않던 우리 햄스터 넘 꼼꼼하고 차분하게 잘 봐주셨습니다. 제 손에선 그리 발버둥 치던 애가 어쩜 그리 가만히 있는지... 감사합니다','Y'),(11897,583,'예약은 안되지만 특수동물 진료보기 가장 좋은것같아요! 급하게 가봐야할땐 예약이 안되는곳이 많았는데 여긴 그런거없어 좋아용\n진료비도 타병원들에 비해서 가성비도 좋습니다!','Y'),(11898,2437,'아파트 단지 인근 상가입니다.\n주로 학원이 많아 아이들 방문이외는 상가로서의 매력은 없는 곳입니다.','N'),(11899,2437,'상가가 비활성화. 상암동 방송국 쪽보다 조용하고 좋음. 근데 상가는?','Y'),(11900,2437,'주위에뭐별거가없네요','N'),(11901,2437,'다다미 초밥집이 좋습니다','Y'),(11902,2437,'일반