수 있는 공간도 있어서 알차네여','Y'),(11948,651,'우리집 예쁜이가 이용하는 병원입니다.\n친절하시고 과한 진료는 노~\n특히 우리 예쁜이처럼 유기견일때는 특히나 안타까워하시면서 비용도 저렴하게 해주십니다.\n며칠전 예쁜이가 아파서 병원에 들렀었는데 다음날이 쉬는날이라 걱정이 되셨는지 전화까지 주셨어요.','Y'),(11949,651,'친절하신 수의사님 계십니다\n아이들도 편하게 방문하실수 있는곳','Y'),(11950,651,'몇십년 다니는 칼 국수집입니다 안 밖은 허름한데 정말 사람을 끄는\n칼국수 집 입니다','N'),(11952,2530,'병원에 가면 사랑스러운 고양이 3마리를 만날 수 있습니다 :-) 선생님도 친절하시고 과잉진료가 없는 것 같아 마음에 들어요!','Y'),(11953,2530,'조아여','Y'),(11957,2536,'목동의 오래된아파트지만\n아직까지는 좋은아파트','N'),(11958,2536,'오래된 아파트 단지','N'),(11959,2536,'😍😍😍','N'),(11962,2547,'나무가 많고 차없는 산책길이 다른 아파트 두배이상인게 가장 마음에 듬.\n그 대신 주차면적이 적어 애먹음.','N'),(11965,1314,'우장산역과 마곡역에서 접근성이 좋고 단지가 깨끗하고 조용해서 살기에 쾌적한 아파요 단지입니다','Y'),(11966,1314,'조용한 아파트에요. 주위에 있을거 다있습니다.','Y'),(11967,1314,'살기 좋은 곳','Y'),(11968,1314,'경비들이 별로임','N'),(11971,2561,'뷔페가 있어 찾는 사람이 많다.','N'),(11972,2561,' 두산더랜드타워 B동 213호\n스와로브스키 무제한 69000!!!!! 👍👍👍','Y'),(11976,119,'주차 편하고 강서지점에서만 구입할수있는 왕새우튀김 새러드가 별미라 자주 갔었는데 왕새우튀김 샐러드 코너가 폐점했네요~ ㅠㅠ','Y'),(11977,119,'직원분들 친절하고 다양한 종류의 제품이 눈길을 끕니다. 하지만 전자제품쪽이 다양하지 못해서 아쉽네요','Y'),(11978,119,'초등생 책상 침대보러 가서 상품 품질이나 가격은 잘모르겠지만 금천시흥 금천독산 강서가양 등에 비해서는 상품 디스플레이가 훨씬 보기 좋게 잘 정리되어 있고 뷰티하며 진열대간 공간도 넓어 아이쇼핑이 안정적인 느낌을 받았고 참 좋았습니다. 첫쇼핑이지만 다음에 근처에 온다면 다시 방문 예정입니다. 출차시에도 주차권 확인 안하시네요!^^* 안개등','Y'),(11979,119,'좋은 위치에있다. 각종 생필품은 물론이고 1층은 키즈카페(챔피언), 푸드코트, 아트박스, 기타 잡화류를 파는 상가가있고, 윗층에도 여러 브랜드샵, 가구, 전자제품까지 여러 상가들이있다. 주차장은 자리가 넉넉한편이긴 하지만 매장 접근성이 좋은 몇몇층은 조금 자리가 부족하게 느껴질때도 있다. 그렇다고 특별히 대기 어렵지는 않았다. 경차 주차장이 중간중간 끼어있는데 의외로 매우 불편하다.','N'),(11980,119,'주말 여행 때문에 장을 보러 다녀옴. 항상 느끼는거지만 홈플러스 강서점은 주차부터, 상품진열, 넓은 이동 통로라서 가양 이마트처럼 병목현상은 없다.\n그래서 이마트보다는 식품종류가 좀 적은듯 해도 강서 홈플러스로 가는 편인듯 싶다.  회코너에서 연어2팩, 물회2팩 사서 카트에 담았더니 어디선가 나타나신 아주머니 몇개의 아이스팩까지 챙겨주시고 완전꽁꽁친절 서비스, 좀 아쉬운 점은 가양 이마트 보다  종류가 많이 없긴 없는듯 싶다.\n\n이마트가 없어지면서 ..','Y'),(11981,2568,'합리적인가격  인접성도좋습니다.\n거리는 120m가 최대라 이것 빼고는 다 괜찮아요','Y'),(11982,2568,'골프는  잘못하고 친구따라 강남 간다나\n구경했는데  시설이 좋고  주차장도 좋고 서비스도 좋다','Y'),(11983,2568,'길이가 짧고 시설도 오래되었지만 가격이 착해요','N'),(11984,2568,'거리가 7~80m 정도되는 실외연습장, 한시간에 13,000원, 주차가능','N'),(11985,2568,'시설이 아주좋지는않지만 좋습니다. 편하게 시작했습니다.','Y'),(11986,2570,'4년간 107동 탑층 리모델링 없이 거주.\n\n진출입로가 좁은 골목이고 주변에 뭐가 별로없음.\n\n집은 탑층이라 나름 전망 시원. 단지내 나무가 많아서 좋음. 단지 청소 열심히함\n\n단점\n엘리베이터 모터소리가 탑층에 있는지 집안에서 밤새 모터소리 들리고, 아랫집 소리가 화장실에서 대화가 되는정도. 최악은 모든 베란다에 결로로 물 줄줄 흐르고 엄청난 곰팡이. (그집에 살때 아이가 온몸을 긁고 상처투성이라 아토피인줄 알앗는데 이사하고 나니 멀쩡해짐)','N'),(11987,2570,'지상72층에서87층까지입니다.','N'),(11988,2570,'좋아요','Y'),(11991,1308,'생각외로 넓지 않습니다\n공원내 식물원 방문 하시면 좋을 듯 합니다\n공원 내 예쁜 꽃들 많으니 연인들끼리 사진 많이 찍으세요','N'),(11992,1308,'마곡나루에 있는 오피스텔은 너무 시끄럽습니다.\n주상복합이라 1층과 2층에 상가들이 있는데 장사가 안되면 접고 다른 가게가 들어서니 거의 매번 인테리어 공사 소음에 시달립니다. 아침에 글라인더 소리에 잠이 깰 정도에요. 또 주변에 술집들이 있어서 양아치들이 많은편이에요 특히 금요일 토요일에 이곳으로 많이 모입니다. 건물 내부는 인근 오피스텔중 가장 넓고 좋습니다.','Y'),(11993,1308,'지하철 역에서 지상으로 나가기 좋은 곳','N'),(11994,1308,'산책하기 좋은 동네입니다.','Y'),(11995,1308,'공원이 넓어서 운동하는 사람들이 많습니다.','Y'),(11996,1334,'최악의 건물. 지하7층까지 주차장인데 임차인들한테 1대 주차 제공안하고 주변 공사장 인부들한테 유료주차로 다 채움. 2년 사용하고 마곡 다른곳으로 왔는데 천국임 ㅋㅋㅋ 참고로 출퇴근 시간 바로 앞 사거리 차가 사방팔방 너무 많아 헬게이트니까 들어오려는 분들 잘 알아보세요. 지하7층까지 있어 엘레베이터도 헬게이트임 2대가 있는데 홀짝층으로 운행하니까 시간 널널한분들은 충분히 기다리면서 업무도 볼 수 있음','N'),(11997,1334,'둘러보기 좋아요','Y'),(12001,2599,'다른데 맡길 필요 없음.\n울집개가 가만히 있질 못하는데,\n다른데 맡겼다가 미용 중간에 포기해서 그지같은 모습으로 되돌아왔었는데\n이곳은 그러질 않음.\n그래서 그런지 예약이 한달정도 차있음.\n\nps. 미용하고나면 엉덩이가 아주 예쁨','Y'),(12002,680,'서울시 강서구 방화동 신방화역 사거리에 있는 24시간 동물병원. 총6분의 선생님이 있으며, 매일 당직의사분이 대기중인곳. 주차장도 있고, 2층에누 진료실과 수술실이 있음. 진료비와 약제비 등은 다소 비싼느낌이지만 꼼꼼하게 챙겨주는 모습에 믿음은 가는 병원.','N'),(12003,680,'3세 남아 푸들 중성화수술 하러 갔는데 원장님께서 친절히 꼼꼼하게 상담설명 잘 해주셔서 이해하기도편했고 안심하고 수술시킬수 있게 믿음이 갔네요 병원도 깔끔하고 미용도 같이 맡겼는데 후차에 미용과수술후 사진 함께 올려볼께요...','Y'),(12004,680,'원장선생님 두 분 다 친절하시고,미용실장님 간호사분들 모두 너뮤 좋아요! 저희 강아지들 갈 때마다 반겨주시고 무엇보다 과잉진료다 없어요!!!!!','Y'),(12005,680,'선생님들도 좋아요 한유나쌤 설명도 굿 친절도 굿 마스크넘어로 미모도 굿^^','Y'),(12006,680,'시설이 좋아서 비싼줄 알았는데 가격이 비슷하네요\n그래서 더 좋았어요','Y'),(12007,696,'벌써 다닌지 5년 되어가는데, 의사 선생님 너무 친절하시고 차근차근 잘 봐주십니다. 과잉진료\n절대없고요 이사가서도 한시간 거리 차타고 여기 병원만옵니다~ 늘 감사드려요','Y'),(12009,666,'진료선생님 왕친절, 설명도 잘해주시고 너무 좋아요.\n저희집 고야이 동물병원 여러군데 가봤지만 믿고 맡길데가 없어 두번이상 방문한 곳은 없었는데 올스타로 정착할듯','Y'),(12010,666,'시설 깔끔하고 진료도 불필요한것 없이 잘 봐주십니다. 선생님은 괜찮다고 하시는데 제가 겁나서 검사한적이 몇번 있네요ㅋㅋ 그렇다고 또 대충 보시거나 검사를 안하시는편은 아니에요. 앞의 강아지가 많이 아파서 검사할게 많았는지 거의 한시간 기다린적도 있거든요. 심장사상충약은 6개월치 한번에 사면 하나 더 주시구 제품 구매금액 적립도 됩니다.','Y'),(12011,666,'우리 슈가 자궁축농증으로 수술하기전에 수액 맞는 모습인데...잘 됐음 좋겠습니다.','Y'),(12012,666,'365일 진료  짱이예요','Y'),(12013,666,'여기 꾸준히 약 받아가고 있음\n괜찮은 곳','Y'),(12017,1363,'별로예요','N'),(12018,1365,'지하철 9호선 라인인 양천향교역이 가까워서\n흔히 말하는 역세권인 휴먼빌아파트.\n농협도 건너면 바로 있고 왠만한 먹을거리는 가까이서 먹기엔 좋은듯 합니다\n허나 후문인지는 모르겠지만 사생활이 조금 노출 되어 거주 시민분들중 사생활이 중요시 하시거나 예민 하시는 분들은 4년마다 특정시기에 약간 스트레스 받을 우려가 있기 때문에 조금 아쉬울수 있다고 판단 됩니다\n그외에는 특별히 시끄러울만한 것은 사거리라 사고소리도 근접하게 느껴질 것이란 생각도 들기는 합니다','N'),(12019,1365,'지하철역 입출구 가까이에 아파트 입출구가 있어서 이용하기에 편해요.','Y'),(12020,1365,'지하철 입구에서 바로 아파트 후문이 있어서 좋다','Y'),(12022,2643,'지하철 근처이라 시끄러울줄 알았는데 방음이 잘되어있고 근처에 공원도 있어서 산책도 가능함 단지내에도 여러 편의시설을 갖추고 있음.','Y'),(12023,2643,'굳','Y'),(12024,2643,'행복주택','Y'),(12027,2646,'재원이라는 정신병자 조심하시길','N'),(12030,2649,'너무 편하고,아이들이 좋아해요','Y'),(12031,2649,'쾌적하고 좋습니다.\n이 곳을  리뷰한 다른 글의 공통된 내용\n그대롭니다.','Y'),(12035,2651,'관리실 여자 입주민이랑 싸울려고 출근하는듯..? 단순문의 때문에 전화한건데 전화 할때마다 엄청 짜증내서 놀람… 입주한 첫날부터 너무 불쾌하게 응대해서 최대한 관리실 연락 안하려고 하는데 가끔 어쩔수없이 연락할때마다 기분나쁨 ㅠ','N'),(12036,2651,'아랫분 말씀처럼 문제가 많아여 여기..\n충간소음때문에 도와달라 했다가, 수위 아저씨인가? 하는 말이 윗집인지 어떻게 입증할거냐며… 여기 그 사무실 직원들도 진짜 너무 ㅇㅇㅇ없고, 진짜 모멸감 느꼈음… 본인들 귀찮은 건 싫고 진짜 입주민들 나몰라라..\n그리고 수압이 너무 심해서 큰일 볼 때마다 물내리면서 샤워기로 안하면 휴지도 안내려감…\n거리공원 있는 걸로 위안 삼으며 삽니다…','N'),(12037,2651,'관리실 직원들 너무 불친절함 특히 관리소장인지 뭔지 하는 아저씨 거주민한테 일부러 화내는거 같음','N'),(12040,2655,'교통편의\n의외로 조용해요','N'),(12041,2655,'아파트주변건물 쵤용표시하면 버스,마을버스가그앞까지가나요 옛전건물앞길목을표시등록해야지','N'),(12042,2655,'넓고 좋아요','Y'),(12047,719,'동물등록(내장칩)하고, 광견병예방주사, 심장사상충 등 기생충구충제 처방을 받았습니다. 예약시각에 가니 주차하는곳까지 간호사님이 마중나와 주차를 도와주셨습니다. 데스크 선생님도 한결같이 친절하게 처리해주셨습니다. 원장님은 제가 몸이 불편하여 직접 못 뵈었지만, 예약 전화를 해서인지 안에서 반갑고 친절하게 우리 순돌이 처리 처방을 해주시는 걸 알 수 있었습니다. 군더더기 없이 깔끔하고 친절하신 모든 스텝분들에 감사드립니다. 거리는 좀 되지만 운전교통과 주차','Y'),(12048,719,'애기한테 주사맞히는데 보호자한테 말 안하고 맞히고,\n넥카라 집에 있는데도 병원측에서 그냥 물어보지도 않고\n구매 체크해버려서 반강제로 구매했어요.\n애기한테 고기, 껌, 우유, 치즈 이런거 먹이지 말랬으면서\n닭가슴살로 만든 제품 구매하라고 하는게 이해가 잘 되지도 않고요.\n미리 안내를 좀 해줬으면 좋겠어요.','N'),(12049,719,'원장님이 아주 친철하시고 다른 동물병원 보다 서비스가 끝내 주네요.\n젊은 남자 원장님인데 엄청 잘생겨습니다. ㅎㅎ\n동물병원의 허준같은 ㅋ','Y'),(12050,719,'반려견사료를 사러갔는데도 반려견 귀속청소\n발톱두 깍아주고 했습니다','Y'),(12051,719,'모든 분이 친절하시고, 특히 의사선생님이 자상하고 꼼꼼하게 잘 봐주십니다.','Y'),(12052,715,'원장님이 진료를 꼼꼼히 봐주시고\n부연설명을 잘해주세요','N'),(12053,715,'원장님이 아주 친절하시고 20년째 다니고있음 진료도 잘봐주심 참고로 한아이만 20년째 다니고있음ㅋㅋㅋ','Y'),(12054,715,'반려견 아플때 치료비가\n다른병원보다 적절합니다\n의사선생님도 친절하십니다','Y'),(12055,715,'저희 강아지는 병원가기 백미터전부터 신나서 난리나요\n원장님도 간호사님도 너무 좋으세요','N'),(12056,715,'원장님친절하시고 일단 저희집강쥐들조금만아파도 원장님만나면언제그랬냐는듯 신기해요','Y'),(12057,1395,'애교많고 귀염뽀짝 멍멍이들이 있어요\n친절한 주인아저씨도 있구요\n바로바로 응가도치워주시고 편안하고 댕댕이들 뛰어놀기.넓은장소로 자주 이용할것같아요\n또 놀러갈께용','Y'),(12058,1395,'지하라서 고민하다 가까워서 갔음\n큰개 두마리와 소형견 네마리가 주인분이 기르는듯 했고 개들은 다 순했다\n사장님도 친절하셨고 입장료도 저렴한 듯\n성인 8천 초등5천원에 캔음료나 캔커피가 포함됨\n음료제조는 안하시는 듯\n시설은..\n벤치의 상태는 꽝이었음..\n개냄새가 안나고 강한향이 났는데 세제냄새인건지 방향제 인건지..\n초딩들과 갔는데 아이들은 개에게 빠졌고\n두시간가까이 있다 온 듯\n시간제한은 없어보임','N'),(12059,1395,'남자분이 친절하셨다. 바닥은 좀 갈라졌지만 강아지가 좋아해서 가끔 가고 음료는 개선했으면 좋겠다. 캔음료만 있어서 아쉽다.','Y'),(12060,1395,'사람이 화장실갔다고 조금만 기다려달라고 적혀있는데 전화도 안받고 화장실을 차를 타고 갔다오셨나봐요? ㅎㅎ 들어가보지도 못했네요','N'),(12061,1395,'강아지들과 함께 놀수있어 좋고 시설이 깨끗해서 좋다','Y'),(12062,1396,'의사선생님들 너무 친절하세요. 과잉진료도없으시고 의료비도 사전에 너무나 잘 상담해주시고요. 무엇보다 동물들도 너무 이뻐하시는게 보여서 신뢰가 가요','Y'),(12063,1396,'대표 원장님 너무 친절하시고 잘 설명히니주십니다. 저보다 더 진료비 많이 나올까봐 걱정해주시고, 과잉진료 없어서 너무 좋아요','Y'),(12064,1396,'깔끔하고 밝은 분위기, 친절한 선생님과 직원들, 24시간 운영이라 응급상황에서도 대처하기 용이함','Y'),(12065,1396,'제 고양이 봐주신 선생님은 젊으셔서 그런지 상황에 따른 전문가의 소견으로 적절한 조치를 취해주기 보다는 FM 대로 처치/발생가능한 부작용을 읊고 선택하라는 식이어서 별로였네요. 초진비 9900원입니다. 병원 자체는 깨끗한거 같아요.','N'),(12066,1396,'언제나 친절합니다. 앞에 주차 2~3대 정도 가능한 것 같고, 2층? 복층? 쪽에 미용하는 모습을 볼 수 있습니다. 진료실은 4개정도 있고, 고양이 입원실과 호텔이 있습니다.','Y'),(12067,1400,'항상친절하고 저희라떼도행복하게잘있네요~♡','Y'),(12068,1400,'울집 대가족 냥이들 1년에 한번씩 방문하는곳입니다.\n매번 발톱정리 이쁘게해주셔 감사합니다.','Y'),(12069,1400,'모두들 친절하고 좋으세여','Y'),(12070,1400,'의사선생님 너무 친절하시고, 간호사선생님분들도 정말 친절했어요.\n애가 배에 가스가 차서 급하게 병원에 갔는데 설명도 잘해주시고 응급처치도 잘해주셔서 정말 감사했습니다.^-^~','Y'),(12071,1400,'선생님들이 친절하고 무엇보다 가격이 투명해서 좋아요','Y'),