접 해드립니다.\n이 숙소 덕분에 즐거웠습니다.😌','N'),(12167,1484,'여기 내곡치과 서울대나온 원장님들이신데 진짜 과잉진료없고 잘하심 딴대서 치아새로해야한다는데 여기만 손봐주심.','N'),(12168,1484,'5층 남자 화장실에 비데 있음 꼭 가보셈','Y'),(12169,1484,'기계식 주차장 입구 턱이 굉장히 높습니다. 주의하세요.','N'),(12170,1484,'오라카이 사우나 좋아요','Y'),(12171,1484,'친절하게 잘모시면 고맙겠습니다.','Y'),(12173,805,'원장님께서 증상을 친절하고 자세히 알려주세요.\n무엇보다 병원이 너무 깨끗해서 믿음이 가네요.\n개와 고양이 입장문이 각각 다르고요.\n병원 앞에 주차하고 들어갈 수 있습니다.','Y'),(12174,805,'저희 냥이들 아기때부터 돌봐주신 두 선생님이 함께 개원하셨다고 해서 오픈하자마자 바로 들렀습니다. 고양이 진료실이 강아지 진료실이랑 따로 분리가 되어 있어서 안정이 되었는지 저희 겁쟁이가 이동장 밖으로 나와서 둘러보는 모습을 처음을 볼 수 있었습니다 ㅎㅎ 저희 고양이 죽을 고비 여기 선생님들 덕분에 잘 넘길 수 있었고 덕분에 지금은 건강하게 함께 잘 지내고 있습니다~ 요즘 반려동물 믿고 맡길 수 있는 동물병원 찾기 쉽지 않은데 강츄 드립니다! 앞으로도 ','Y'),(12175,805,'친절한 원장님이 맘에 들더군요.\n일요일도 영업하시고 정말 열씸히 일하시네요','Y'),(12176,805,'고양이 출입구. 진료실 따로 있고 세심한배려가 병원곳곳에 숨어있어 편하게 진료받을수있습니다. 검사 강요 없이 보호자 의견 최대한 존중해주시고 설명도 잘해주십니다. 붐빌까봐 나만 알고싶은 병원이에요.','Y'),(12177,805,'과잉진료도 없으시고\n친절하시구요\n\n비글구조네트워크 보호소 강아지들 진료도 봐주시는거 같고 좋은 병원이라고 느껴져요','Y'),(12178,804,'선생님 친절하시고 꼼꼼히 잘봐주심','Y'),(12179,824,'원장님께서 정말 친절하십니다. 우리 사랑이(강아지)를 너무 친절하게 봐주세요~','Y'),(12182,2916,'우리 딸래미를 이렇게 만들어 주는곳 ^^','N'),(12183,2918,'음식 사진은 못찍었습니다만.. 제 입엔 그냥..\n약간 면도 푸슬하고, 그랬습니다..','N'),(12184,2918,'다양한 평수의 오피스텔이고 역세권으로 주변 편의시설이 잘 되어있습니다.','Y'),(12185,2918,'장점: 편의시설이 잘되어 있고 건물 주변이 트여있어서 전망도 좋음, 관리비가 다른곳에 비해 평균 이하, 주차장 이용(1가구 1주차)이 편리함, 깨끗한 건물\n단점: 예술의전당 주변이라 그런지 음악(성악,피아노,바이올린 등)하는 사람들이 많음. 옆집에 성악하는 사람 때문에 주말에도 스트레스. 옷 수납 공간이 너무 적음. 기존 설치된 고장난 빌트인 냉장고에서 악취','N'),(12186,2918,'주변에 식당 및 카페 인프라가 잘되어있음','Y'),(12187,2918,'입구앞에 흡연장이 있고 심지어 입구 바로앞에서 담배피는 사람도 많고... 담배냄새 때문에 다시는 가고싶지않은곳...','N'),(12188,1499,'친절하고 좋아요','Y'),(12189,1499,'너무 친절하고 잘 봐주세요.\n다른병원 몇군데 다녔는데 이만한 병원이 없네요^^^','Y'),(12190,1499,'샘이 친절하게 자세한 설명해주세요. 정직하게 운영하는 느낌받았어요. 샘이 게다가 이쁘세요^^','Y'),(12191,1499,'항상 친절하시고 병원도 깨끗하고 좋아요','Y'),(12192,1499,'원장님이 참 친절하세요! 너무 좋은 동물병원이예요','Y'),(12193,816,'울아이 관절염때문에 발을딛으려고 하지않아서 침치료다니다가 지인추천으로 재활차 방문했는데~수중이랑 레이저 치료받고 정말 눈에 띄게 좋아졌어요. 꾸준히 해보려구요~^-^','Y'),(12194,816,'병원이 깨끗하고 선생님들께서도 반려견을 예뻐해주시고 엄청 친절하게 자세하게 설명해주시긴 하셨는데 좀 비쌌던것 같아요.두세군데