집','N'),(12294,845,'살고 있는데 일단 교통편이 최고예요, 버스정류장 바로 앞이고 지하철역도 5분거리예요.\n지하에 헬스장 롯데마트 있구요. 27층에 헬스장, 독서실, 요가실? 뭐 그런거 있어요.\n부모님이 좋다고 하시는건 주변 주상복합보다 관리비가 저렴하시데요! 그리고 무엇보다 안전하고요 24시간 security하시는 분이 계시고 카드 다 찍고 들어가서 보안장치 좋고, 얼마전에 로비가 엄청 밝아졌어요..뭐.. 위험하면 뛰어가서 로비만도착하면될거같아용. 아 그리고 엄청 시원해서','Y'),(12295,845,'지하에 롯데 슈퍼가 있어서 가끔 갑니다\n반찬집과 김밥 ㆍ떡볶이집도 있고 옷가게와 face 샵ㆍ시계방ㆍ커피샵이 있습니다\n주차도 지상과 지하3층까지 됩니다','Y'),(12296,845,'주차장 청소도 보수도 왜 안하는지 의문...\n관리비 절감에만 열의가 있는건지 싶을 정도로 심함 ㅠㅠ','N'),(12297,3123,'복합 쇼핑몰과 호텔, 사무실과 주거 공간이 있는 대형 단지 입니다.\n엄청 많은 건물이 있네요','Y'),(12298,3123,'스포애니 사람 개많','N'),(12302,1648,'쇼핑몰이큰데도 아직 공실이 많고, 업종이 다양하지 않네요. 학원이 많네요.','N'),(12303,1648,'주차장 들어가는 길이 너무 협소해 차량이 카니발 정도 크기 이시면 회전시 많이 조심해야 될것 같아요\n편리한 상점이 많이 입점되어 있고 이동 동선은 편합니다','N'),(12304,1648,'안녕하세요 여러분 오늘은 제가 직접 글을 읽어 보았습니다','N'),(12305,1648,'지하에 gs마트 자주가요','N'),(12306,1648,'엘리베이터 많고 시설도 좋아요.','Y'),(12308,3142,'물건이 쿠팡 물류센터 뺨 치게 많고, 아가랑 산책하거나 스타벅스가 잇어 커피 마시며 쇼핑도 좋아요, 대가족용 음식도 많아요. 극장도 잇고.','N'),(12309,3142,'장지동가든파이브점은안쪽으로쭈욱걸어들어가야있어요.바로앞에버스정류장이있기도해요.지하에있어서내려가야하고넓은매장이에요.가전제품부터푸드코트까지\n다양하고많은물품이있고요,카드가있다면무인결제도\n가능해요~','Y'),(12310,3142,'주차가편리함\n깨끗함\n쇼핑안쪽에 식당가가있음\n\n주차장도 어둡지않음\n강남과가까움','N'),(12311,3142,'주차도 편리하게 할 수 있어 좋았고 매장내 구성도 잘 구획되어 있어 쇼핑이 참 편했던 매장입니다.','Y'),(12312,3142,'주차장이 넓고 대기가 없어서 좋아요.\n매장 규모도 커서 거의 모든 것을 살 수 있어요','Y'),(12313,3143,'가족과 함께 여기에 4년간 살면서 리뷰할게 너무 많지만 우선 이번 봄에 찍은 벚꽃 사진부터 올린다. 완전 꽃이 피었다가 비가 약간 오고 기온이 떨어질 때 찍은 거라 100% 짜리는 아님','N'),(12314,3143,'지하의 길이 다소 헷갈리며 어두워 사고 위험이 있어 보입니다. 국내 최대 규모 아파트 단지인 만큼 크지만 단지 자체는 쾌적하며 인도가 바둑판형으로 뚫려 있어 크기에 비해 접근이 편리합니다. 지상 및 지하 1층을 통해 도보로 출입이 가능합니다. 차 없는 아파트라 도로가 지하 1층이 되었고 그래서 지대가 주변 지역보다 높아 사실상 지하 1층이 지상입니다. 상가도 이용하기 편리하며 근처에 가락시장을 비롯하여 여러 시장들이 있어 좋습니다. 단지 내에도 다양한 ','Y'),(12315,3143,'건물 사이의 공간이 최근 지어지고 있는 아파트에 비해 넉넉합니다. 서울의 이미지에 어울리는 공간이며 지하의 공간 배치가 상당히 인상적입니다.','Y'),(12316,3143,'대단지라 부대시설은 잘돼있습니다.어르신 경노당이 훤하고 쾌적합니다.\n시니어스 클럽~멋집니다♡♡','Y'),(12317,3143,'큰 세대 수의 아파트.\n처음에는 너무 넓어서 길을 헤매는 일이 생길 수 있습니다. 조경이 잘 되어 있고 산책하기 좋아요','Y'),(12318,3149,'줄눈 계약\n줄눈TMP에서...','Y'),(12319,3149,'좋아요','Y'),(12320,1661,'물건 다양하고 주차 편하고 좋아요','Y'),(12323,1665,'무엇보다 선생님들이 정말 친절했고 나와있던 개들도 다 귀여웠어요','Y'),(12324,1666,'줄눈 계약\n줄눈TMP에서...','Y'),(12325,1666,'좋아요','Y'),(12326,157,'연륜이 있으신 원장님께서 운영하시는 소박한 병원이다. 이런저런 검사 강요하지 않으시고, 꼭 필요한 검사만 하신 후에 정확히 진단해 주셨다.  문닫는 시간에 다급히 전화를 드렸는데 친절하게 기다려 주셨고, 바로 수술을 진행해 주셔서 너무 감사했다. 여러질문에 자세히 대답해 주셨고, 비교적 정직하게 소통하시고 영업하시는 분이라는 느낌을 받았다.','Y'),(12327,157,'제일 마음에 안드는게 입구에 있는 케이지. 몇년전 추운때 내 강아지 거기에 넣어놓고 찬바람 다 맞아서 애 죽일뻔함','N'),(12328,157,'원장님은 좋아요. 미용은 비추천합니다','Y'),(12329,157,'정직하게 진료','Y'),(12330,157,'실력 최고!','Y'),(12331,949,'우리 아이 솜 십자인대 슬게골 탈구 다리 뼈 기형으로 변해 깍아내고....참  기막히고 참담하게 수술 잘 해 주셨구요 지금 회복중 입니다...입원중 솜 식사때마다 사진찍어 보내주시구 정말 고마웠습니다....저는 제 몸이  아픈데가 너무많아 정부 의료 혜택을 받고있는 기초수급자 입니다 솜이 다리를 갑자기 쓰지못하고 당황했는데 서대문구 에서  추천 해 주시고 서울시 하고 24시 샤인 동물 메디컬 병원에서 구제해 주셔서 우리아이 솜 구제 받았습니다 정말 고맙','Y'),(12332,949,'대기실도 따로있고 선생님 간호사분들 너무 친절하세요!  예민한아기 잘 케어해주셔서 고맙습니다. 앞으로도 방문예정입니다!','Y'),(12333,949,'슬개골 2기 판정을 받고 수술받고 왔어요.\n벌써 수술 후 한 달이 지났는데 울집 막내 숑이는 수술한 강아지가 맞나? 싶을 정도로 예전처럼 열심히 잘 뛰어 다니고 건강하게 지내고 있어요^^ 중성화 수술을 제외하고 이렇게 큰 수술이 처음이라 두렵고 무서웠는데 상담을 시작으로 숑이가 퇴원할때까지 꼼꼼하게 신경 써주신 모든 선생님들께 다시 한번 감사드립니다ㅜㅜ','Y'),(12334,949,'우리 아이는 담석을 제거하는 수술을 받게 됐습니다.\n\n수술 전과 비교해 아이의 상태가 많이 나빠졌음에도 6일동안 총 900만원 가량의 금액을 냈습니다. 시간이 지나도 상황은 나아지지 않았고, 남아있던 일말의 희망으로 제가 아이를 트랜스퍼하려 하자 재수술을 권하였습니다. 그렇게 우리 아이는 첫 수술에서 회복도 못한 채 재수술 후 심정지로 인해 허무하게 세상을 떠나게 되었습니다.\n\n아이는 괴로워 하는데 보호자에겐 잘 지낸다며, 문자에 모든 걸 사실대로 적지','N'),(12335,949,'병원 좋고 시설도 좋아요. 경험 많으신 분들은 정말 실력있으신 분들이에요.\n근데 경험없는 젊은 선생님들이 보호자하고 충분한 상의나 설명없이 처방을 내리네요.\n스테로이드 성분 위험해서 노련한 선생님들은 기피하는 약이고 강아지 오래키워본 분들도 강아지 관련일 종사하시는 분들도 위험하다고 절대 쓰지말라하시고 쓰면 마지막에 쓰는 거라고 다들 놀래하시는데 제가 바보같으니까 저한텐 말도 제대로 안하고 애 데려가서 스테로이드제 주사해놓고 아이 정말 고생은 다하다가 ','N'),(12336,1672,'선생님 좋으시기로 유명 합니다','Y'),(12338,3193,'미용후 귀다쳤는데 얘기도 안해주는 병원. 미용하러갔는데 본인들 마음대로 주사놓고 비용청구하는 병원.','N'),(12339,3193,'집고양이한테 광견병 주사 필수라고 해서 맞혔는데 알고보니 필요도 없고 매우 독해서 고양이 몸에 안 좋은거였네요.','Y'),(12340,3193,'원장님 친절,자상하시게 잘 봐주십니다.','Y'),(12343,556,'의사선생님 매우 친절하심. 과잉진료도 안하시고, 가격도 합리적인 편. 상담도 꽤 길게 해주시고 이것저것 물어봐도 귀찮은내색 전혀없이 다 알려주심.  진료시에도 고양이를 살살 달래면서 최대한 제압 하지 않고 진료해주시는데, 그래서 고양이도 별로 스트레스 받지 않아하는게 느껴짐.\n\n*그리고 병원에서 키우는 고양이(키다)가 병원에만 들어가면 냐옹거리면서 다가오는데 매력이 터짐.','N'),(12344,556,'2017년에 딱 한번 고양이 진료 받았었는데 여기만 생각하면 너무 화가 나요 진짜... 카운터에 계신 분 인상이 좋고 해서  괜찮겠지 하고 갔는데, 고양이에 대해서는 잘 모르시는지, 상담받을 때 안쪽으로 들어가셔서 고양이 백과사전 찾아보시는 것 같은 모습을 보이셨고, 가장 결정적인건 멀쩡한 고양이를 대체 어떻게 검사하셨길래.. FIV음성이라고 고양이 희귀병인 에이즈 걸린 걸로 오진하셨던 것! 추가 혈액검사했던것도 대부분 수치가 다 미달이고 다 죽어가는 ','Y'),(12345,556,'진돗개 견주입니다. 진돗개는 외국에서 동물병원 출입이 안된다고 개 면박을 주더군요.\n수의사라는 양반이 남에 개 알기를 아주  개성기같이 아는거 같습니다. 돈되는 손님 아니고서는 인간이든 개든  가리는듯 합니다.  말못하는 짐승\n과연 똑바로 진료나 하는지 모르겠습니다.','N'),(12346,556,'원장님. 간호사분 다 친절.. 원장님이  동물을 정말 좋아하시는거 같고.. 무리한 진료 안하시는거 같다. 동물 입장을 우선시하심.. 이사하니 젤 아쉽다. 키다리 못가는게... ㅠㅠ','N'),(12347,556,'별 하나도 아까운 돈에 눈이 먼 내 반려동물 진료 못시킬 병원이네요 불친절하고. 병원 한두군데 다녀본거 아닌데 유독 비싼 치료로 유도하는것처럼 느껴집니다','N'),(12348,1679,'한국에 방문시 항상 이용하는 병원입니다. 원장님이 알아서 잘 해주시고 친절합니다 :)','Y'),(12349,1679,'아이들 책도 사고, 어른들 책도 사고.. 새거 같은 책들 반값에 샀네요.','Y'),(12350,1679,'비싸요...','N'),(12351,1679,'친절...','N'),(12353,3203,'3차 진료불가한 간단한 진료가능한 동물병원  입니다 .','Y'),(12354,3203,'바로 앞 도로에서 우연히 떨어져 있는 새끼참새를 발견했습니다. 데려갈수도 없고.. 도로에 두자니 죽을 것 같고 우연히 돌아보니 동물병원이 보여서 혹시나 해서 문열고 여쭤 보니...너무나 다정하게 봐주시겠다고 날수 있게 해보겠다고 거두어 주셨습니다. 참 마음이 따듯한 원장님이신거 같습니다.','Y'),(12355,3203,'20년간 다니는 동물병원.\n나르 골절수술도 잘 치료받음','Y'),(12356,3203,'최악입니다  형식적인 치료나 할줄알지   귀 중이염으로 2년을 가도 낫지를 않네요','N'),(12357,3203,'정말동물을생각하는\n원장님과선생님들\n감사합니당~♡~','Y'),(12358,944,'5 년전부터 다녔는데 의사선생님이 친절하시면서 부당하게 안하시니까 넘 좋은것 같아요. 믿고 다닐수있어서  좋아요 . 다른 동물병원은 터무니없는 요금을 원하는데 진료 정확하고 진료비 착해서 최고입니다.','Y'),(12359,944,'선생님들 및 스탭들이 너무 친절하세요. 다른 병원들처럼 바가지도 없고요.','Y'),(12360,944,'엄청 친절하시고 고양이를 엄청 이뻐해주세요','Y'),(12361,944,'뱃속에 이물질 든거 잘빼내신다 들어서 갔습니다.갔다와서 싹 나았어요.','Y'),(12362,944,'깨끗하고 선생님이 친절하게진료봐주셔서 좋았어요~','Y'),(12363,286,'기침을 많이하여 다른 동물병원에서는 폐가 안좋다 하였는데 심장이 안좋다고 병명을 정확하게 진단해 주어 걱정이 많이 즐어들었다. 지금까지 여러 동물병원 많이 가봤지만 가장 신뢰가 간다.','Y'),(12364,286,'주변에 비해 약값, 사료값, 간식값 특히 부르는게 값이라는 치료비 뭐하나 비싼거는 눈 씻고 찾아볼 수 없는 곳입니다~~^^ 우리 강아지들도 많이 이뻐해주시고 서비스도 잘 챙겨주시고 미용언니도 친절하시고 강추×강추입니다~~^^','Y'),(12365,286,'과잉진료 없이 솔직하게 진료