0,'상일동역 근처 주상복합 아파트 입니다 지하에 수영장, 다이소 등 상가, 지상엔 자주 이용하는 서울시민대학이 있습니다','N'),(12394,3260,'상일역 앞에 위치한 주상복합. 벌써 주차장 여유가 업어 불편함. 어직 상가가 완정히 갖추어지지 않았음. 대중교통은 편한곳','Y'),(12395,3263,'고덕천이 단지앞에 있어 산책라기 좋고, 물놀이장이 있어 아이들에게 인기. 강일역이 인접해서 교통편리. 강명초, 강명중이 단지 앞에 있음. 2200세대 대단지.','Y'),(12396,3263,'법무부의 자식으로써 이 집을 떠납니다','N'),(12397,3263,'쉬프트제공 장기전세 아파트\n2010년 2월부터 입주를 시작했다','Y'),(12398,3263,'아주 좋아요.','Y'),(12399,3263,'마음에 들어요','Y'),(12400,1714,'선생님과 원장님이 완전 친절해요 강추 :)','Y'),(12406,3283,'친절하고 좋으세요. 앞으로도 잘부탁 드려요','Y'),(12407,3283,'진료 참 잘하는 동물병원','Y'),(12408,3283,'저는 10년 동안 피카소의 충성스러운 고객이었습니다. 그곳의 수의사는 표현력이 가장 뛰어난 친구는 아니지만, 그는 결코 당신에게 필요하지 않은 것을 당신에게 강요하지 않을 것입니다. 그는 내 두 마리의 개에게 총 6번의 수술(치아 세척 제외!)을 수행했으며 우리는 그와 어떤 문제도 겪은 적이 없습니다. 간단히 말해서, 2~3시간 거리에 살아도 피카소와 함께 있을 것입니다.','Y'),(12409,3284,'우리 댕댕이가중서화 수술을 했는데 하나도 아프지 않아했어요. 원장님이 명의인듯.','Y'),(12410,3284,'5년째 믿고다니는 우리냥이들 병원','Y'),(12411,3284,'친절한 선생님\n감사합니다!','Y'),(12412,3284,'친절합니다','Y'),(12414,3293,'아파트 상가 내 매장을 방문하려고 했는데요. 그리고 나는 끔찍한 경험을 하고 그 곳을 떠나서 깜짝 놀랐습니다! 2개의 문이 있는데 하나는 주민용이고 다른 하나는 방문객용입니다. 부스에는 경비원은 없었고 인터폰만 있었습니다. 내가 어디로 가는지 말하려고 전화를 걸었을 때, 대답한 사람은 나에게 태도를 보여주고 내가 말했어야 할 것에 대해 설교하고 있었습니다. 아마 그 사람은 제가 언급한 가게가 여기에 있다는 사실도 몰랐던 것 같아요. 글쎄, 방문자가 주민','N'),(12416,3296,'선생님이 참 친절하신 동물병원. 걱정되는 부분은 잘 짚어주시고, 그렇다고 과잉진료는 절대로 안하시려 애쓰시는게 느껴집니다.','Y'),(12417,3296,'선생님이 친절하네요  진료비약값도 착한가격이구요','Y'),(12418,3296,'수의사선생님이 꼼꼼하게 진료하시고 진료비가 적절합니다\n길아이들 진료비 할인해주셔서 아픈냥이들 병원약 먹이고 있습니다','Y'),(12419,3296,'의사 쌤도 친절하시고 과잉 진료 하는거 없으시답니다','Y'),(12420,3296,'선생님도 깔끔하고 친절하시고 좋았어요~','Y'),(12421,3298,'친절~가격도 좋음\n시설도 깔끔\n예약제','Y'),(12426,3300,'수의사 선생님이 친절 / 과잉진료없음','N'),(12427,3300,'의사 선생님이 친절해요.','Y'),(12430,241,'친절해요~','Y'),(12431,919,'서울육개장','N'),(12432,3313,'동네 저렴하고 진료잘보는 동물병원\n한가지아쉬운점은 24시간 하면좋겠지만 그건 내 욕심이겠죠','Y'),(12433,3313,'친절하고  잘봐주십니다. 주차불가','Y'),(12434,3313,'세심하게 잘 보살펴  주세요~','N'),(12435,3313,'정말 친절하세요','Y'),(12436,3313,'친절한 선생님','Y'),(12437,3330,'12살 친구들과 다녀왔는데 다른곳 보다 훨씬 저렴하고 사장님도 친절 하시고\n무엇보다  고양이가 너무 귀여워!!','Y'),(12438,3330,'친구가 고양이를 너무 좋아해서 방문했는데요. 여기에 방문하기만 해도 유기묘를 도울 수 있다해서 왠지 모르게 뿌듯해지는 느낌이 들었습니다. 10000원만 내고도 1시간 30분을 이용할 수 있고, 음료 종류도 많았습니다. 그리고 고양이가 다 너무 귀엽습니다. 진짜ㅠㅠ 꼭 한번 쯤 와보세요!!','Y'),(12439,3330,'귀여운 고양이도 많고 진원도 친잘합니다.특히 이 냥이가 좋았습니다.','Y'),(12442,3341,'동네에 카페가 있어서 방문해봤습니다 ㅎㅎ','Y'),(12443,3341,'새로 생긴 곳이라 그런지 깔끔하고 고양이들도 진짜 많고 귀여워용','Y'),(12447,3356,'한 건물을 통으로 쓰고 있지만 공간이 크지는 않습니다.\n1층에서 매표하시고 지하 1층부터 관람하고 2,3,5층이 동물원으로 구성되어 있습니다. 동물원이라기에 많이 협소합니다. 환경부와 협약을 맺어서 관리하고 있다는 여러 자격증과 인증서를 붙여 두었는데 진짜 동물원에 비해서 동물들 생활하는 곳이 너무 열악했습니다.\n나름 동물들을 만지지 못하도록 하고 각각 특성을 고려해서 간식을 주도록 안내하고는 있으나 제대로 지켜지지 않았습니다. 딱히 지키는 사육사가 없','N'),(12448,3356,'초등학생 이하 어린이들과 가볼만한곳입니다.주차는 최대4대까지 가능하네요. 참고하세요.','N'),(12449,3356,'보시면 아시겠지만 만지지도 못하는 동물들이 아닙니다.. 파충류도 시간맞춰서 라쿤도 시간맞춰서 체험 할 수 있고 사육사분들도 굉장히 친절하십니다. 동물들은 굉장히 순하고 상냥해서 만져주는걸 굉장히 좋아하는것같더라고요. 흑흑 홍대 최고의 실내동물원가게라고 말해도 과언이 아닐겝니다ㅠ 귀여움은 세계 공통단어인거 아시죠? 외국인 친구 데려와도 환장할겁니다. 안좋아할사람 없을거에요..','Y'),(12450,3356,'카페는 이용 안하고 동물 간식주고 동물들이랑 교감하는 이색데이트 하고 싶어 방문했는데 평범한 데이트가 아닌 이색 데이트 하고 싶을때 방문하심 좋을거 같네요.','Y'),(12451,3356,'도심 속 실내동물원.3층은 동물체험도 할수있어요\n아이든과가면 정말 좋은곳. 젊은친구들은 데이트하러도 오더라구요~^^\n관리자분들 친절하시고 무엇보다 청결합니다\n가볼만한곳~^^\n지하에서 5층까지\n1층에서 음료드실수있고 폰충전도 가능.','Y'),(12452,1266,'음료는 평균 1.1만원대\n대형강아지가 많아 신선한경험이었습니다.\n의자는 벽쪽에밖에 없습니다\n생각보다 매장내 냄새는 나지않았고\n새로운손님이 입장할때마다 강아지들이 문쪽으로 달려나가고 짖어서 시끄럽긴합니다\n하지만 그래도 다시가고싶을정도로 좋았습니다','Y'),(12453,1266,'일단 가격은 네이버에 표시해둔거랑 다름...;; 아이스티 대략 만원정도 한다길래 갔더니 만 이천원... 에바였다. 더군다나 냄새가 진짜 개에바임. 강아지들 목욕 잘 안해주는 건지 잘 모르겠지만 진짜 개에바임... 환기 몇 분 하다가 바로 닫고... 그리고 강아지들 부를 때 막 소리지름. 야!!!! 이러고... 친구 생일 기념으로 간건데 진짜 너무 에바였음. 그리고 강아지들 싸우고 난리도 아니였음. 갈거면 여기 말고 겨울이머무는집으로 가셈.','N'),(12454,1266,'대형견들이 많은곳이라 맘껏 만지고, 귀여워해주며, 시간을 보낼수 있는곳이라 좋습니다. 다만 직원분들이 견들에게 이름을 많이 불러주고, 교육을 잘 시켜주셨으면 좋겠습니다. 아무리 견이라고해서 욕하고 그러는건 아닌거 같습니다. 특히 손님들이 있어도 소리지르며 머리때리고(꿀밤식으로)  욕하고, 야 야하고...  손님입장에선 굉장히 불편하고, 있는내내 직원 눈치보는 시간이 되는거 같아 많이 불편했습니다. 모두 다는 아니여도 두어마리 견들이라도 손님들에게 친절하','N'),(12455,1266,'최악입니다! 평점1점 잘 안주는데 평점1점도 아까운곳임. 일단 남자 사장이 최악임. 점심쯤에 갔는데 손님 1도 없었고 차 2잔 주문했는데 사장이 직원한테 음료 넘겨줄때도 음료! 이딴씩으로 짜증섞인 큰목소리로 말하고 음료 주고 나서 손님 우리밖에 없는데 매출 안나온다고 궁시렁 차가 많이 팔리는 날은 매출안나온다고 ㅇㅈㄹ.  청소도 안하는지 냄새 ㅈㄴ 역함. 반려견들도 냄새심하고 사장이 반려견들한테 어떻게 하는지 모르겠지만 ㅈㄴ상태 안좋아보이고 불쌍해보였음','N'),(12456,1266,'강아지들이 쉴곳이 없어보여서 안타까웠습니다. 대형견 여러마리가 한곳에 있는데 스트레스 받지는 않을지 걱정도 되었구요.\n하지만 정말 아이들이 순하고 애교가 많았어요. 싸우지도 않고 서로 사이가 좋아보였습니다.\n\n처음에 들어갈 때 애기들이 많이 짖는데, 위협적인 행동이 아니고 반기는 것이니 놀라지 마세요.','N'),(12457,3368,'사장님도 너무 친절하시고 고양이들도 너무 젠틀~~~\n규칙이나 시스템이 너무 잘되어 있어 다녀오기도 편함.\n단점은 애기 (초등학생)들이 좀 많을수도 있음\n여러번 가본 결과 빨간날 (휴일)이 제일 사람 많고 주말에는 오후 (1시 이후)부터 사람 많아짐. 평일 및 주말 11시에는 사람이 엄청 많지 않음.\n고양이 간식은 조금 비싼감이 없잖아 있지만 2시간+기본음료가 만원이라는것을 생각하면 나름 괜찮은듯 함. 고양이 특징 (궁딩팡팡을 싫어하는것 만지면 안되는것)','Y'),(12458,3368,'음료도 많이 싸고 맛있습니다 그리고 2시간에 기본음료까지 해서 10000원이면 이득인것 같아요 직원분도 착하시고 고양이도 많고 엄청 귀여워요 나중에 또 올 생각 충분히 있을것입니다!꼭 가보세여!','Y'),(12459,3368,'항상 고양이들에게 아픈마음 치유받고 갑니다. 다들 너무너무 사랑스러워요♥','Y'),(12460,3368,'넘 힐링된당. 꼭 가보세염','Y'),(12461,3368,'- 주상복합건물 9층에 있는 고양이카페. 덕분에 주차하는 것은 편리함. 2시간 주차 가능. 주인장님이 블로그에 오픈 여부를 공지함. 어린이는 동시입장 인원이 제한돼 있어서 아이를 데려가면 기다려야 할 수도 있음.\n\n- 2021.4 입장료 9천원. 캔 음료수만 제공하는 것으로 바뀌었음. 입장료 결제하면 음료수 or 고양이 간식 1개 제공. 식사, 와플 등 음식은 판매하지 않음.','Y'),(12462,1389,'몇일전에 갔는데 가성비도 진짜 엄청 좋아요 고양이 막 보고 만지고 에다가 음료수 까지 8천원인데..;; 안가시 겠어요?!','Y'),(12463,1389,'처음으로 고양이 카페를 방문했는데 이곳의 고양이들은 야생에서 구조된 길 잃은 고양이들이고, 스트레스를 받고, 더럽고, 귀와 눈의 일부가 없어졌기 때문에 공포증을 느꼈습니다. 그리고 가장 중요한 것은 그들이 만지는 것을 원하지 않는다는 것입니다. 익숙해지면 등을 돌리고 만질 수 있게 해줄 것입니다. 하지만 그게 전부입니다. 손톱이 다듬어지지 않아 긁히거나 감염/질병에 걸릴 위험이 있습니다. 문을 열자마자 풍기는 지독한 악취에 머리가 몹시 아팠습니다. 전반','N'),(12465,1395,'애교많고 귀염뽀짝 멍멍이들이 있어요\n친절한 주인아저씨도 있구요\n바로바로 응가도치워주시고 편안하고 댕댕이들 뛰어놀기.넓은장소로 자주 이용할것같아요\n또 놀러갈께용','Y'),(12466,1395,'지하라서 고민하다 가까워서 갔음\n큰개 두마리와 소형견 네마리가 주인분이 기르는듯 했고 개들은 다 순했다\n사장님도 친절하셨고 입장료도 저렴한 듯\n성인 8천 초등5천원에 캔음료나 캔커피가 포함됨\n음료제조는 안하시는 듯\n시설은..\n벤치의 상태는 꽝이었음..\n개냄새가 안나고 강한향이 났는데 세제냄새인건지 방향제 인건지..\n초딩들과 갔는데 아이들은 개에게 빠졌고\n두시간가까이 있다 온 듯\n시간제한은 없어보임','N'),(12467,1395,'남자분이 친절하셨다. 바닥은 좀 갈라졌지만 강아지가 좋아해서 가끔 가고 음료는 개선했으면 좋겠다. 캔음료만 있어서 아쉽다.','Y'),(12468,1395,'사람이 화장실갔다고 조금만 기다려달라고 적혀있는데 전화도 안받고 화장실을 차를 타고 갔다오셨나봐요? ㅎㅎ 들어가보지도 못했네요','N'),(12469,1395,'강아지들과 함께 놀수있어 좋고 시설이 깨끗해서 좋다','Y'),(12470,3323,'지나다니면서 보기만하다가 아이가 궁굼해해서 가봤어요~토욜 5시쯤갔는데 손님도없고 한가해서 좋았어요~고양이들도 얌전하고 냄새날줄알았는데냄새 1도안나고 나름 깨끗해보였어요~처음가본거라 고양이를 어떻게 대해야하는지몰라 거의 한시간동안 구경만하다가  ㅠ\n나중에 오기전에야 용기내서 만져보고왔네요~ㅎ\n아이가 너무너무신나했고 담에 또가고 싶다네요~어른11000아이9000\n입장료겸 음료교환요금이고 고양이 간식값은 따로에요~간식한캔이면 고양이들한테 인기폭팔~다먹음 다들','Y'),(12471,3323,'진짜..청소를 대체 언제 한건지 고양이 털 뭉치째 날아다니고 사람 머리카락도 엄청 많이 떨어져있고 담요라고 밑에 깔아둔건 언제 빨았는지 이상한 것들 많이 묻어서 더럽기 짝이 없다. 고양이 장난감도 없고 물어보니 사서 놀아주라 그러고.. 고양이 털 모질도 안 좋아서 애들 제대로 관리해주나 싶다. 그 와중에 입장료는 다른 캣카페처럼 9천원이니 날강도 같다. 박스 같은 쓰레기나 저렇게 두고..캣카페 가서 사진 1장만 찍은 적은 처음임. 손님이 줄어서 정신 좀','N'),(12472,3323,'귀여운 친구들이 한가득- 아주 좋답니다 ㅎㅅㅎ\n사진을 많이 찍었네용','Y'),(12473,3323,'주말 낮에는 안가봤지만 주말, 평일 저녁은 사람 없어서 좋음..','Y'),(12474,3323,'고양이 많습니다. 네다섯마리 유치시켜놓고 고양이카페다 우기는 카페보다 좋네요. 근데 사나운 요주의 고양이가 있지만 미리 어떤 앤지 고지해주니 조심하시면 됩니다.\n그리고 고양이는 먼저 다가가든 겁나 시간들여 기다리든 둘중 하납니다. 안놀아준다고 너무 섭섭ㄴㄴ','Y'),(12475,1464,'사장님들도 너무 친절하시고 애들도 너무 착해서 너무 좋은거 같아요!!! 시설도 깨끗하고이용하기 좋은거 같아요!!!','Y'),(12476,1464,'애견카페예요 지하1층에 있지만 사장님들께서 워낙 깔끔하셔서 깨끗하고 애카특유의 냄새라던지 그런것도 없고 사람입장료는 있지만 음료는 꼭 시켜야하는건 아니구요 당연하지만 외부음식 반입안됩니다. 상주견도 있고 믿고 호텔이나 놀이터이용하는 강아지들이 있는만큼 신뢰도도 높은편이예요^^사람 식사류도 있고요 애견들한테 간식제공은 금지예요 잘못하면 피바람이 날수도 있으니까요^^','Y'),(12477,1464,'입장료 6천원(필수)\n음료수(선택)\n사장님이 가게를 깔끔하게 관리하십니다. 처음갔는데 개들이 막 몰려와줘서 좋았어요 ㅋㅋㅋㅋ','Y'),(12478,1464,'요즘 자주 가는 신림 애견카페 ^^#','Y'),(12479,1464,'여기 좋아요^^ 꾸준히 관리하셔서 냄새도 안나고 쾌적하고 강아지들도 귀엽습니다','Y'),(12480,1467,'도베르만 받아주는 곳이 여기 뿐이라서 오게됬지만\n직원 분들도 친절하고 너무 좋아요 종종 가겠습니더','Y'),(12481,1467,'애견 카페는 처음인데 너무 귀여운 강아지들 덕에 힐링되고 좋았습니다 :)','Y'),(12482,1467,'관리가 너무 안되구요,,, 대형견 끊임 없이 짖고 적은 공간에 너무 많은 개들이 갇혀있는 느낌이었습니다.','N'),(12483,1467,'사장님 및 직원분들이 친절하고 강아지친구들이 매우 귀여움','Y'),(12484,1467,'개들이 너무 많고 관리가 안된다는 느낌을 받았어요. 선불권은 구매 시 안내 없었는데 쓰려고 보니 유효기간이 있었다고 소멸됩니다. 구매 시  잘 알아보고 조심하세요.','N'),(12485,3387,'고양이 아주 많아요\n하도 음식을 많이 줘서 통통해요. 음식을 사서 계속 주는게 고양이 건강에 좋을지 모르겠어요. 한 30% 고양이들은 한시간 내내 조금도 움직이지 않고 잠만 자요.\n아이들이 좋아해 가자 해서 간건데 고양이는 주로 어른들에게 가지 애들에겐 잘 안가요. 좀더 반기고 애교있는 고양이면 좋을텐데 하도 만지는 사람들도 많고 놀아주는 사람들도 많아 고양이들이 스포일 된거 같아요.','Y'),(12486,3387,'너무 예쁘고 관리 잘된 야옹이들~ 이 사랑스러운 아이들이 가지고 있는 아픔들이 조금이나마ㅈ위안이 되어줬음 좋겠어요 사장님도 많은 아가들 돌보시느라 힘드실텐데 감사합니다~^-^','Y'),(12487,3387,'나눠진공간에 공간도 잘 꾸며 놓았네요 냥이들은 약 20마리쯤 되구요 노령묘부터 아기냥이까지 다양한 연령대로 편안한 분위기에 잘 어울리고 있어요 지금은 입장료 9천원에 1시간 30분이용이에요 잠깐 쉬어가기 좋습니다^^ 동물을 좋아하시는 분들은 참고하시길~','Y'),(12488,3387,'일반 고양이 카페가 아닌 유기묘 카페라고 해서 갔는데 생각보다 더 좋은 공간이었습니다\n특히 인상적이었던건 베란다가 천장만 뚫린 거였어요!\n냥이랑 같이 햇빛과 바람 맞으며 앉아 있을 수 있다는 게 진짜 집사가 되어본 느낌이라 행복했어요\n사진으로 못남긴 아늑한 공간도 또 베란다 옆에 있어서 꽤 넓어요','Y'),(12489,3387,'고양이도 너무 귀엽고 너무 좋아요~매장도 넓고 청결하고 고양이가 엄청 건강하고 생기가 넘처보이네요\n츄르 가격은 2,000원 하는데 꽤 괜찮아요','Y'),(12490,3388,'고양이 숫자가 많습니다.\n여러 종이 있고 모두 다른 고양이 카페 대비해서는 온순한 편입니다.(성깔 있는 개체들도 한 둘 있음)\n다만 전체적으로 고양이들 성정이 부드러운 편이라 어린아이의 우악스러운 손길에도 잘 참아주는 편이며(다만 보호자가 제지를 해주는 편이 좋을 것 같습니다)\n애교도 많습니다.\n커피는 고양이 카페인 만큼 높은 질과 맛을 기대할 수 없지만 사장님께서 매우 친절하시고 고양이들이 만들어내는 오염들을 즉시 즉시 정리해주시기 때문에 카페 청결도','Y'),(12491,3388,'고양이들이 다 너무 순하고 조용합니다. 냄새도 별로 없고 시설이 편안합니다. 사장님도 정말로 친절하게 고양이에대해 설명해주셔서 너무 괜찮았습니다 ㅎㅎ','Y'),(12492,3388,'고양이 꽤있음 한 20마리정도??있는거같긴한데 다 자고있어서 체감 느껴지는건 많진 않았음ㅜ\n어떤 고양이 카페들어가면 냄새 확나는데 여기는 냄새안남\n다들 고양이 순한 편\n사장님 친절하심','Y'),(12493,3388,'긔여운 아이들이 있어요. 활발하지는 않지만 사람을 좋아해요~~~ 보드게임도 할 수 있어서 좋아요','Y'),(12494,3388,'너무 귀여워요 다들…\n외국인 분들도 많이 오시네요\n고양이는 야행성이고 하루의 대부분을 잔다는 사실을 간과하고 가셔야 합니다\n낮잠시간이라 다 자는게 아니고 고양이는 원래 야행성입니다','Y'),(12495,3390,'해외에서 한국 방문했다가 고양이가 보고싶어 방문했어요. 리뷰보고 물어 물어가길 참 잘했어요. 사장님께서 전화통화로 길안내도 친절히 잘 해주셨고 방문했을 때도 따뜻하게 맞아주셨어요. 열아홉마리 고양이들도 넘 순둥순둥 예쁘고 카페도 깨끗하고 분위기도 참 좋아서 또 가고 싶어요. 한국에서 만든 가장 특별한 추억 중 하나가 될거에요. 고양리라 좋은 날 카페 이름대로 딱 맞네요. 감사해요!','Y'),(12496,3390,'20여마리의 고양이천국, 고양이라 좋은 날.\n\n여타 반려동물까페와 다르게 정말 건강하게 관리된 개냥이들만 모여있다.\n\n평일: 음료포함 1만원(사실상 무제한)\n주말: 가격동일, 90분 시간제한\n\n90분이면 지치고도 남는다. 단순 개냥이를 너머 이불보만 깔아주면 와서 머리를 먼저 대고 눕는다.\n\n애교 만점, 활동성 만점의 다양한 냥이들의 집합소\n\n러시안 블루인 블루부터 뽀뽀 등 종류도 다양하고 사납지 않아 냥이초심자도 편한 모습으로 만날 수 있는 곳.','Y'),(12497,3390,'고양이들이 매우 건강하고 편안해보였어요. 주인분께서도 아끼시는게 느껴졌습니다. 냥이들이 만지는걸 좋아하지 않는 눈치라 구경만 했어요. 바라만보아도 행복하게 해주는 냥냥이들 🩷','Y'),(12498,3390,'여기 진짜 좋아요!\n고양이 카페는 처음인데\n이렇게 좋을줄 몰랐어요.\n엄청 깨끗하고 냥들도 프랜들리해요!','Y'),(12499,3390,'고양이들이 엄청 많아요. 사람들도 끊임없이 들어오는데 고양이들이 너무 사랑스럽고 이뻐서 보다보면 시간 가는 줄 모르겠더라고요.','N'),(12500,3400,'고양이들이 많아서 시간 가는 줄 모르고 놀았어요! 사장님두 친절하시구 냥이들도 다 애교가 흘러 넘쳐요🩵 내부도 깔끔하고 음료도 맛있어요 ❤️','Y'),(12501,3400,'아이가 너무너무 행복해해서 잘 갔다싶어요^^\n주말이라 사람이 많았는데\n냥이들이 누구 하나 소외되지 않게 사람들 사이로 왔다갔다 놀아?주더라구요ㅎㅎ\n애들이 다~~이뻐요. 또갈게요^^','Y'),(12502,3400,'얼마 전에 귀여운 아기 고양이 한 마리가 추가 되었어요.너무 어려서 쭈루도 못주네요ㅠㅠ','Y'),(12503,3400,'고양이를 배려하고 사랑하는 분이 키우는 곳에서 고양이들과 잘 어울리다 온 곳입니다.\n인원수 제한으로 들어가있을때 전혀 북적임없이 편안하게 고양이들과의 시간을 즐길 수 있었어요. 1시간 대기하는동안 근처 도서관에서 책도 충분히 보다가 들어갔기때문에 시간을 알차게 쓴듯해서 더 좋았습니다','Y'),(12504,3400,'몇세 이상 이런 기준이 있어야 할 듯 해요 .\n어플에서 쿠폰구매하여 예약전화드리고 갔는데도  쿠폰사용기준이 성인이 아니라 어린이라 적용 안된다고 하시고 전화드려서 연령도 말씀드리니 주의사항도 숙지하고 오라셔서 설명하고 갔는데 할퀴고 다칠 수 있다는 말씀을 도착해서야 말씀주셨어요 . 결국 창밖에서 음료만 마시고 왔어요 ㅜ   냥이들을 사랑하시고 보호하시려는 마음은 이해하지만 너무 경계하시는 듯한 느낌이 저는 좀 별로였어요.\n물론 막무가내인 아이들을 경험하','N');
